INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4, 173, 'dsg-description', 'self', 'Multibranched with large stems in fully grown specimens. Branches large, fluffy and thick when feeding polyps are extended. Color is usually dark pink - reddish. Branches look bulbous when polyps are withdrawn and are flexible if touched. Small specimens should be compared to Corallium and Sibogogorgia cauliflora.', '2019-01-02T09:19:53.040');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (5, 338, 'dsg-description', 'self', 'Large and shaggy appearance. Branches moderate thickness. Color creamy with brown-yellow, sometimes orange hue. Long tendrils of unknown function found at base of stalk. Polyps contract and expand, but do not withdraw completely.', '2009-01-01T00:00:00.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8, 166, 'dsg-description', 'self', 'Salp chain often seen tightly coiled like an `ammo belt` (as per L. Madin).', '2015-04-15T11:50:31.797');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9, 603, 'dsg-description', 'self', 'Contain chemosynthetic bacterial symbionts within their bodies that convert energy from sulphide- and methane-rich waters, supplying nutrition to the host worm.', '2015-03-30T09:01:03.897');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (14, 603, 'dsg-habitat', 'self', 'Benthic. Cold seep and hydrothermal vent communities.', '2015-03-30T09:03:59.793');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (18, 622, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-04-02T10:30:11.303');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (22, 622, 'dsg-depth-distribution', 'self', '91 - 795 m', '2015-04-02T10:30:17.187');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (26, 622, 'dsg-size', 'self', 'to 46 cm', '2015-04-02T10:30:36.480');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (27, 622, 'dsg-range', 'self', 'Gulf of Alaska to central Baja.', '2015-04-02T10:30:43.190');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (30, 623, 'dsg-description', 'self', 'Compare with Opsithoteuthis. Relatively long fins (used for robust swimming), elongate mantle and body. Species appear to be associated with the deep ocean floor in all oceans of the world.', '2021-05-04T08:02:00.843');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (32, 623, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-01T15:13:14.747');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (36, 622, 'dsg-description', 'self', 'No defined bars or stripes, but look for an inverted "u" shape on the side under the dorsal fin; red and white; large eyes; concave forehead; commonly sit on the seafloor with the tail tucked beside the body; split nose rarely visible. Juveniles are more pelagic. Younger animals many appear light-pink and without apparent (or with very faint) markings. ', '2015-04-21T09:10:26.693');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (37, 626, 'dsg-depth-distribution', 'self', '4 - 487 m', '2015-03-30T13:20:48.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (42, 626, 'dsg-range', 'self', 'Unalaska, Alaska to San Diego, California', '2009-01-01T00:00:00.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (43, 626, 'dsg-size', 'self', 'to 30 cm', '2015-03-30T13:21:08.970');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (44, 626, 'dsg-reproduction', 'self', 'Off the coast of central California, the majority of gravid females are found September through March.', '2015-04-13T13:20:21.630');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (47, 625, 'dsg-size', 'self', '10 - 21 mm', '2015-04-10T14:28:30.210');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (48, 625, 'dsg-depth-distribution', 'self', '875 - 1221 m', '2015-04-10T14:28:49.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (50, 625, 'dsg-description', 'self', 'Capable of producing blue and green bioluminescence. Exhibits a combination of larval and adult characteristics. May possibly be feeding on sinking marine "snow" particles caught in mucous web.', '2015-04-10T14:30:28.677');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (55, 625, 'dsg-habitat', 'self', 'Mesopelagic; adults in this family are typically benthic or tubiculous.', '2015-04-07T16:50:18.597');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (68, 635, 'dsg-depth-distribution', 'self', '572 to 1482 m', '2015-03-31T10:29:55.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (70, 635, 'dsg-range', 'self', 'Hawai''i and South Pacific.', '2015-03-31T10:30:07.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (71, 635, 'dsg-size', 'self', 'to 50 cm', '2009-01-01T00:00:00.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (75, 637, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-07T07:47:14.787');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (81, 674, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-03-30T08:47:03.920');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (86, 705, 'dsg-depth-distribution', 'self', '256 - 2904 m', '2015-03-29T12:10:16.800');
