INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (109, 758, 'dsg-consulting-taxonomist', 'self', 'David Pawson, Smithsonian Museum of Natural History.', '2015-04-07T13:53:35.193');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (113, 759, 'dsg-consulting-taxonomist', 'self', 'David Pawson, Smithsonian Natural History Museum.', '2015-04-07T14:05:14.010');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (115, 134, 'dsg-consulting-taxonomist', 'self', 'Jeff Drazen, University of Hawai`i at Manoa.', '2015-04-02T15:08:23.943');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (117, 139, 'dsg-description', 'self', 'May not be distinguishable from C. yaquinae on video (may be annotated as C. armatus-yaquinae complex), however refer to Jamieson et al. 2012.', '2015-04-02T14:21:03.517');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (118, 139, 'dsg-consulting-taxonomist', 'self', 'Jeff Drazen, University of Hawai`i at Manoa.', '2015-04-02T14:21:08.937');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (120, 138, 'dsg-consulting-taxonomist', 'self', 'Jeff Drazen, University of Hawai`i at Manoa.', '2015-04-02T15:18:32.983');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (121, 138, 'dsg-description', 'self', 'May not be distinguishable from C. armatus on video (may be annotated as C. armatus-yaquinae complex), however refer to Jamieson et al. 2012.', '2015-04-02T15:18:43.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (122, 402, 'dsg-consulting-taxonomist', 'self', 'Philip R. Pugh, National Oceanographic Centre.', '2015-04-23T11:02:42.453');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (125, 484, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories.', '2015-04-07T14:24:56.937');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (127, 486, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories.', '2015-03-31T10:21:09.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (136, 800, 'dsg-consulting-taxonomist', 'self', 'Henry Reiswig, University of Victoria, BC.', '2015-04-07T11:38:32.943');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (138, 806, 'dsg-consulting-taxonomist', 'self', 'Henry Reiswig, University of Victoria, BC.', '2015-04-07T11:51:45.473');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (139, 806, 'dsg-shape', 'self', 'Flat.', '2020-10-28T13:55:42.143');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (140, 800, 'dsg-shape', 'self', 'Flat.', '2020-10-28T13:56:04.863');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (141, 800, 'dsg-description', 'self', 'Compare with Bathydorus laniger. Beige-white, many visible oscula, and has a relatively sparse mass of straight basal spicules.', '2015-04-07T11:38:47.557');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (142, 806, 'dsg-description', 'self', 'Compare with Docosaccus maculatus.  Blue-white, a single large central oscula and no small pores visible (there may be other sediment-filled indentations visible but these are not oscula), a relatively dense mass of curled basal spicules.', '2013-05-06T09:55:56.330');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (155, 868, 'dsg-consulting-taxonomist', 'self', 'Henry Reiswig, University of Victoria, BC.', '2015-04-01T10:35:55.783');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (160, 869, 'dsg-description', 'self', 'The spicule column is like a twisted rope.', '2015-04-01T10:36:24.383');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (166, 871, 'dsg-description', 'self', 'Tall, stalked, white. Typically with epizoanthids growing on the stalk. There are likely multiple morphs of this sponge; they are deformable in that they contract and expand.', '2021-02-26T14:12:50.073');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (178, 876, 'dsg-consulting-taxonomist', 'self', 'Henry Reiswig, Unversity of Victoria, BC.', '2015-04-07T11:52:12.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (179, 876, 'dsg-description', 'self', 'Large, bucket-shaped; long vertical spicule fringe at base.', '2015-04-07T11:52:20.463');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (180, 880, 'dsg-consulting-taxonomist', 'self', 'Timothy D. Swain, Department of Biological Science, Florida State University.', '2015-04-06T10:02:12.453');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (184, 886, 'dsg-description', 'self', 'Long, thin, white.', '2015-04-07T11:06:08.187');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (185, 887, 'dsg-description', 'self', 'Multiple stalks of non-twisted spicule columns, ball-shaped.', '2015-04-07T11:06:25.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (191, 931, 'dsg-reference', 'self', 'Winston, J.E. and S.E. Beaulieu (1999). Striatodoma dorothea (Order Cheilostomatida: Family Tessaradomidae), a new genus and species of bryozoan from deep water off California. Proceedings of the Biological Society of Washington, 112: 313-318.', '2015-08-07T12:34:31.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (192, 935, 'dsg-consulting-taxonomist', 'self', 'Angel Valdes, California State Polytechnic University, Pomona, California.', '2015-04-17T11:57:48.427');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (206, 3722, 'dsg-consulting-taxonomist', 'self', 'Robert Lea, Emeritus, California Department of Fish and Game.', '2015-04-07T15:32:31.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (215, 3011, 'dsg-description', 'self', 'Keel around mantle, papillae on dorsal head and over each eye.', '2010-11-15T08:39:12.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (216, 436, 'dsg-description', 'self', 'Two sucker rows, massive mantle but small head, medium to short arms, smooth skin, small eyes; eyes do not protrude, when seen in males the ligula is pointy.', '2010-11-12T09:26:12.333');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (219, 637, 'dsg-description', 'self', 'One sucker row, skin tuberculate (warty) or granular; funnel may be visible; primarily move by crawling over the substrate; also capable of swimming via jet propulsion and/or pumping the arms and flared webs; G. boreopacifica and G. pacifica may be two different species with G. boreopacifica ocurring shallower and with smoother, less conspicuous skin texture and minimal cirri over the eyes. ', '2011-08-22T14:28:06.457');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (225, 3733, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories.', '2015-03-31T08:53:07.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (227, 3734, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories. ', '2015-03-31T10:14:41.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (231, 3740, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Museum of Natural History.', '2015-04-17T12:09:28.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (232, 3741, 'dsg-description', 'self', 'Golden or green-colored with white triangles (hooves) on the ends of the spines vs. purple ones which are T. panamense.', '2015-04-07T12:14:08.543');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (234, 3745, 'dsg-description', 'self', 'Frond, leaf-like sponge.', '2015-08-07T14:59:49.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (238, 3781, 'dsg-consulting-taxonomist', 'self', 'Leslie Harris, Natural History Museum of Los Angeles County.', '2015-03-30T08:15:29.547');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (241, 3762, 'dsg-range', 'self', 'Circumglobal, excluding the western Atlantic. Eastern Atlantic from Liberia to Nigeria.', '2011-10-17T15:16:31.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (243, 3761, 'dsg-range', 'self', 'Eastern Atlantic, scattered records in the Mediterranean, off Cape Blanc in Mauritania, Azores, Gulf of Guinea and off equatorial Africa. Western Atlantic from USA to Gulf of Mexico including Caribbean and along Rio Grande Rise. Western Indian Ocean: Mozambique Channel. Elsewhere, equatorial western Pacific and eastern Pacific.', '2011-10-17T15:10:10.813');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (249, 3728, 'dsg-depth-distribution', 'self', 'Over 800 m. Because Haliperis and Funiculina are indistinguishable per G. Williams, the morphotype is annotated as Funiculina-Halipetris complex when observed between 600-799 m).', '2019-04-18T14:01:43.560');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (255, 3798, 'dsg-consulting-taxonomist', 'self', 'Jeff Drazen, University of Hawai`i at Manoa.', '2015-04-02T14:39:57.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (256, 3798, 'dsg-description', 'self', 'These two species may not be reliably distinguished from each other on video, however refer to Jamieson et al. 2012.', '2015-04-02T14:40:04.293');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (260, 623, 'dsg-consulting-taxonomist', 'self', 'Stephanie Bush.', '2015-04-01T15:13:32.257');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (263, 1168, 'dsg-description', 'self', 'Species in this genus do not have pigmented eyes. Multiple species of Munidopsis have been identified along the Pacific coast; these may not be distinguishable on video.', '2015-09-08T07:17:45.163');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (266, 2850, 'dsg-description', 'self', 'This is a placeholder name only- all annotations look morphologically similar to each other, but may be a different genus.', '2015-04-28T14:42:49.177');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (279, 3744, 'dsg-consulting-taxonomist', 'self', 'James H. McLean, Curator Emeritus, Natural History Museum of Los Angeles County.', '2015-04-07T08:44:14.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (281, 3744, 'dsg-description', 'self', 'Undescribed species.  See L. Kuhnz.  Often covered in zoanthids. This is a place-holder name.', '2013-03-12T08:31:51.667');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (282, 3800, 'dsg-consulting-taxonomist', 'self', ' Anders Warén, Swedish Museum of Natural History, Stockholm, Sweden.', '2017-11-01T14:31:40.383');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (283, 3800, 'dsg-description', 'self', 'These two genera cannot be reliably distinguished from each other when seen at a distance on video.', '2012-01-04T11:15:43.137');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (284, 1918, 'dsg-description', 'self', 'Jay Orr and others found the Rougheye in Alaska to be a complex and that there were two genetically distinct types (going under the name of aleutianus).  The second type was determined to be S. melanostictus, Blackspotted Rockfish. In a 2014 fishereies genetic study (NOAA), ~11% of the fish ID''d as S. aleutianus were in fact S. melanostictus.', '2015-07-01T07:30:12.990');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (286, 1788, 'dsg-description', 'self', 'Note that this species and the Slender Sole (Lyopsetta exilis) will look similar on video.', '2015-04-01T15:15:39.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (288, 1791, 'dsg-description', 'self', 'Large eyes, elongate, slender body. May have a thick white bar running across the body.', '2015-03-29T14:53:25.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (289, 1931, 'dsg-description', 'self', 'A large fish, may have a light-colored body with a brown pattern (vs. images in Love, et al.). Juveniles may look like shortbellies (S. jordani). Could be confused with boccacio (S. paucispinus), but have a much smaller mouth. Look for the two front colored bars angled toward the head.', '2015-03-29T16:55:11.390');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (290, 3801, 'dsg-description', 'self', 'These two species sometimes cannot not be reliably distinguished from each other on video.', '2015-03-29T16:52:55.480');
