INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (318, 3002, 'dsg-consulting-taxonomist', 'self', 'Janet Voight, Associate Curator, Invertebrates, The Field Museum.', '2015-03-27T10:58:41.530');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (319, 3002, 'dsg-description', 'self', 'Body flattened, thick web, short cirri, may have areolar spots. Males with enlarged suckers.  ', '2015-03-27T10:59:20.437');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (320, 290, 'dsg-consulting-taxonomist', 'self', 'Daphne Fautin, University of Kansas.', '2015-04-06T08:12:35.753');
