INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (322, 3813, 'dsg-description', 'self', 'Flat, bent-tentacle.', '2015-04-22T15:19:56.250');
