INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (327, 358, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-29T12:08:21.993');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (328, 2861, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-04-06T14:16:24.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (330, 3748, 'dsg-description', 'self', ' Multiple species of "little red jellies" may not be reliably distinguished from each other on video and should be annotated as LRJ unless: 1). Below 3,000 m annotate as Benthocodon unless sampled and confirmed to species.', '2019-02-13T14:06:45.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (332, 1917, 'nil', 'nil', 'nil', '2009-01-01T00:00:00.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (333, 3854, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-04-06T14:54:23.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (334, 3856, 'dsg-description', 'self', 'Confirmed with gene sequencing September 2009 (Asta Audzijonyte).', '2015-04-06T15:24:49.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (335, 3853, 'dsg-color', 'self', 'Purple.', '2020-10-28T15:07:34.383');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (336, 3862, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-04-07T15:11:11.570');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (337, 686, 'dsg-consulting-taxonomist', 'self', 'Gary Williams, California Academy of Sciences.', '2015-04-07T15:06:57.340');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (342, 1416, 'dsg-depth-distribution', 'self', '33 - 1306 m', '2016-03-16T10:05:39.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (343, 1416, 'dsg-description', 'self', 'Long, broad, bell-shaped snout (shorter than A. kampae), deep body (humped in the mid section), can be dark or medium brown; you may see some subtle dark margins on the fins. Broad caudal fin, anal fin short and angular. Eye size is relatively small and gills slits realtively short, compared to A. kampae.', '2019-01-23T13:30:11.527');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (344, 1417, 'dsg-depth-distribution', 'self', '180 to 1888 m', '2015-03-31T10:29:31.420');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (345, 1417, 'dsg-description', 'self', 'Long broad, bell-shaped snout with a white rectangle on the dorsal surface, deep body (humped in the mid section; trunk strongly tapering toward head), pinkish-brown to dark brown; posterior fin edges are white and can usually be seen on video. Rounded anal fin is approximately twice as long as it is high, broad caudal fin. Gill slits are relatively long and eye relatively large compared to A. brunneus.', '2019-01-23T13:25:31.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (346, 1419, 'dsg-depth-distribution', 'self', '91 - 1251 m', '2015-04-20T13:29:01.063');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (347, 1419, 'dsg-description', 'self', 'These are the most abundant catshark in a lot of areas in the bay.  Eye is relatively large, elongate, oval. They have a short, rounded/blunt snout, nasal flaps broad and triangular. Slender and cylindrical; they don’t have the hump in the middle of the body like Apristurus species. Short gill slits. Gray-brown coloration dorsally, and white ventral side. Although not readily visible on most of the animals we observe, the fins can be dark, but with white edges. In the Gulf of California, these sharks co-occur with Cephalurus cephalurus and may be difficult to tell apart when distant, when small, and when they uncharacteristically have the gills expanded in a low O2 environment.', '2019-01-23T13:09:35.640');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (348, 3917, 'dsg-description', 'self', 'Reddish-brown anterior, translucent tan body, narrow-lipped, short squat body when compared to TorquaratoridaeA sp. 1. Most have been observed on mud; one was atop lava.  ', '2021-05-04T08:04:49.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (349, 3918, 'dsg-description', 'self', 'Transparent or reddish-brown anterior with transparent body, gonads visible, narrow-lipped.', '2010-10-19T08:20:12.243');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (350, 3919, 'dsg-description', 'self', 'Translucent purple, extrawide-lipped with a very broad collar, high-dome proboscis and moderately-sinuate intestines.  ', '2010-10-21T10:54:25.103');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (351, 3921, 'dsg-description', 'self', 'Dark brown anterior, light-colored posterior, moderately broad collar, low-dome, pointed proboscis, wide-lipped. Lighter colored at smaller sizes, and nearly colorless when very small. Commensal with polynoid worm Macellicephala sp. A.', '2018-06-12T09:08:59.990');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (353, 491, 'dsg-description', 'self', 'Large; uniform white to light-medium gray. Snout extends beyond indented pectoral fins. May have slightly darker margins, and alar thorns are evident in some darker-colored males. Note the thick base of the tail (compare to B. abyssicola). Claspers may appear white-tipped in darker males.', '2016-07-07T09:23:24.660');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (354, 491, 'dsg-size', 'self', 'to 150 cm TL.', '2016-07-07T09:23:57.970');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (361, 491, 'dsg-reproduction', 'self', 'Oviparous; young born from within a leathery eggcase.', '2015-03-31T10:18:09.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (364, 491, 'dsg-depth-distribution', 'self', '800 - 2938 m', '2015-03-31T10:18:17.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (366, 491, 'dsg-range', 'self', 'Waldport, Oregon to Isla Cocos, Costa Rica and the Galapagos Islands.', '2016-07-13T16:35:50.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (367, 491, 'dsg-habitat', 'self', 'Benthic. Demersal over hard substrate (lava, seamounts).', '2015-03-31T10:18:35.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (375, 3864, 'dsg-range', 'self', 'Vancouver Island, British Columbia to southern California seamounts.', '2015-04-06T11:02:40.447');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (376, 3864, 'dsg-habitat', 'self', 'Benthic, hard substrate; sponges (live and dead).', '2015-04-06T11:02:53.580');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (381, 2994, 'dsg-size', 'self', 'Less than 50 mm mantle length in many species.', '2015-04-17T15:09:04.793');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (382, 2994, 'dsg-range', 'self', 'Arctic, boreal Atlantic and Pacific; tropical western Atlantic Ocean.', '2015-04-01T16:24:19.960');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (384, 3934, 'dsg-description', 'self', 'Very gelatinous. Chiroteuthis-like in appearance (long neck, body and fin shape) but is distinguished by subequal arms and fusion of each funnel-mantle locking apparatus. Scattered chromatophores and small eyes.', '2010-09-22T15:52:22.453');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (385, 3934, 'dsg-range', 'self', 'World-wide distribution in tropical to temperate seas.', '2010-10-21T11:56:56.003');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (386, 418, 'dsg-range', 'self', 'Lower mesopelagic to bathypelagic depth distribution within tropical to temperate oceans of the world.', '2010-09-21T15:30:42.820');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (387, 418, 'dsg-description', 'self', 'Unlike other chiroteuthids, the subadult retains the unusual ornamented tail.', '2010-09-22T15:48:56.687');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (388, 2961, 'dsg-size', 'self', 'Maximum size to 76 mm mantle length.', '2015-04-01T16:25:35.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (389, 2961, 'dsg-description', 'self', 'Distinguished from subadults of other members of the genus by the small fins and few suckers on arms IV; long and decorative tail, which was first captured on video by MBARI''s ROV Tiburon in the Gulf of California.', '2015-04-01T16:27:45.400');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (391, 2961, 'dsg-range', 'self', 'Has been described only from the waters off southern California and northern Baja California.', '2010-10-26T09:09:51.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (393, 961, 'dsg-description', 'self', 'Often appear to have bloated bodies and short arms. Often observed in the "cockatoo posture" with the arms and tentacles folded back over the head.', '2010-09-22T16:01:39.463');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (394, 963, 'dsg-size', 'self', '150 mm mantle length.', '2015-05-05T15:57:26.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (395, 963, 'dsg-description', 'self', 'The mantle is covered by large, multi-pointed cartilagenous tubercles. When disturbed, the squid often pulls its head and arms into the mantle cavity and folds its fins tightly against the mantle to form a turgid ball. The tubercules, presumably, provide some type of protection but it is unclear what predators are affected and how. In addition, the squid may ink into the mantle cavity, making the ball opaque.', '2010-09-21T15:50:43.933');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (396, 963, 'dsg-range', 'self', 'This species occurs throughout tropical and subtropical waters of the world''s oceans.', '2010-09-21T15:51:55.703');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (397, 2966, 'dsg-description', 'self', 'A Cranchid with one to three photophores of very different sizes and shapes on eyes.', '2010-09-22T16:02:49.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (398, 609, 'dsg-description', 'self', 'Hooks on the tentacular clubs, lacking hooks on the arms, and long, slender, terminal fins.', '2010-09-22T16:06:31.440');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (399, 609, 'dsg-range', 'self', 'Members of this genus are found circumglobally in all oceans except the Arctic Ocean.', '2010-09-21T16:00:23.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (401, 2964, 'dsg-size', 'self', '2.7 m mantle length.', '2015-05-05T16:04:28.193');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (403, 2964, 'dsg-description', 'self', 'Ocular photophores bar-shaped. When disturbed, this squid inflates the mantle with water and releases ink inside the mantle cavity. ', '2010-09-22T16:07:35.063');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (404, 2964, 'dsg-range', 'self', 'Extends from off Baja California to the Bering Sea to off northern Japan.', '2010-09-21T16:05:50.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (405, 2965, 'dsg-description', 'self', 'Large funnel and small paddle-like fins that attach above the muscular mantle. ', '2010-09-22T16:08:31.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (406, 2965, 'dsg-size', 'self', 'maximum 100 mm mantle length', '2010-09-21T16:15:56.823');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (407, 2965, 'dsg-range', 'self', 'Throughout the world''s tropical and subtropical oceans and, in the Atlantic Ocean, in north temperate waters.', '2010-09-21T16:17:04.553');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (409, 600, 'dsg-size', 'self', 'Up to 660 mm mantle length.', '2015-08-08T11:15:28.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (410, 600, 'dsg-description', 'self', 'Long, slender terminal fins and hook-like teeth on largest club suckers.', '2015-05-05T16:09:41.647');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (411, 600, 'dsg-range', 'self', 'Cosmopolitan.', '2015-05-05T16:09:49.733');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (413, 2970, 'dsg-description', 'self', 'Three photophores on eyeball and anterior third of fins attaching to mantle.', '2010-09-22T16:37:29.673');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (415, 2971, 'dsg-description', 'self', 'Large, black photophores at the tips of arms IV and hooks on arms in two series.', '2010-09-22T16:46:06.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (419, 5403, 'dsg-range', 'self', 'North Pacific, Japan.', '2015-03-31T10:42:40.647');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (420, 3937, 'dsg-consulting-taxonomist', 'self', 'Nicholas Holland, Scripps Institute of Oceanography.', '2015-04-07T09:47:35.660');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (421, 2975, 'dsg-description', 'self', 'A gonatid without tentacles as a subadult.', '2015-04-01T16:45:14.140');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (423, 2974, 'dsg-range', 'self', 'offshore waters of the North Pacific.', '2010-10-01T15:47:05.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (424, 778, 'dsg-size', 'self', 'Maximum 39 cm mantle length.', '2010-10-01T15:50:49.450');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (425, 779, 'dsg-size', 'self', 'Maximum 240 mm mantle length.', '2010-10-01T15:53:56.883');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (426, 780, 'dsg-reproduction', 'self', 'Brood their young in deep water. ', '2010-10-01T15:58:33.663');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (429, 3790, 'dsg-description', 'self', 'The only Gonatus known to possess photophores. The photophores are on the ventral surface of the eyeballs. ', '2012-08-02T12:42:37.373');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (430, 181, 'dsg-range', 'self', 'Found off of Japan, Hawaii, and California.', '2015-04-23T15:05:13.020');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (433, 181, 'dsg-description', 'self', 'No tentacles; dark reddish brown coloration; rough surface texture; four to seven oral arms; 24 - 50+ lappets; thick bell and oral arms.', '2015-04-23T15:05:17.863');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (434, 181, 'dsg-size', 'self', 'To 75 cm in diameter.', '2015-04-23T15:05:23.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (435, 2796, 'dsg-description', 'self', 'Visible warts covering the skin surface.', '2015-03-29T14:13:47.100');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (436, 3846, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-04-06T15:09:41.210');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (438, 5407, 'dsg-description', 'self', 'Siphosomal zooids, except for the bracts, have a milky white appearance; the yellow of the cnidobands of the tentilla is the only nocticable pigmentation; common name R200 references its relatively narrow depth range centered around 200 meters.', '2011-08-22T13:16:36.993');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (440, 5407, 'dsg-depth-distribution', 'self', 'about 150 - 300 m', '2015-04-23T14:36:07.377');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (443, 5409, 'dsg-depth-distribution', 'self', 'Narrow depth range around 600 m. (563 - 799 meters from Pugh and Haddock, 2009).', '2015-04-23T14:36:21.113');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (444, 5410, 'dsg-depth-distribution', 'self', '462 - 1888 meters, but most occurred at depths greater than 900 meters (from Pugh and Haddock, 2009).', '2015-04-23T14:34:35.063');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (445, 5410, 'dsg-description', 'self', 'Like the other species of Resomia, the nectophores are extremely transparent, but can be distinguished by the deep orange-red coloration of the gastrozooids and palpons in the siphosome.', '2010-10-13T16:39:28.573');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (446, 5414, 'dsg-consulting-taxonomist', 'self', 'Kuhnz L., MBARI; Holland, N., Scripps Insitute of Oceanography; Osborn, K., Smithsonian Natural History Museum.', '2015-03-27T13:14:31.913');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (447, 5414, 'dsg-range', 'self', 'Central California: Davidson, Guide and Taney Seamounts.', '2015-03-27T13:14:41.430');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (448, 5414, 'dsg-depth-distribution', 'self', '1774 - 3156 m', '2015-03-27T13:14:55.290');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (449, 5414, 'dsg-description', 'self', 'Translucent gold/orange, narrow-lipped, high-dome rounded proboscis. Very long body. Can be found in high density.', '2015-02-05T14:26:27.793');
