INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (497, 3928, 'dsg-description', 'self', 'Transparent body, high dome proboscis and extra-wide lips very broad collar, no genital wings visible, moderately-sinuate intestines, longer and narrower than TorquaratoridaeB sp. 1, pigment on anterior trunk is light brown.', '2010-10-19T09:18:13.613');
