INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (583, 3900, 'dsg-description', 'self', 'Cylindrical body; head large; a pair paddle-like wings extends perpendicularly mid-way along the body and are used to swim.', '2015-05-06T11:44:25.070');
