INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (597, 2884, 'dsg-description', 'self', 'Arms 3X the length of the disc size.', '2015-08-07T13:55:41.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (598, 2884, 'dsg-depth-distribution', 'self', 'Generally under 1,000 m locally.', '2015-08-07T13:55:47.693');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (599, 2885, 'dsg-depth-distribution', 'self', 'Generally over 1,000 m locally.', '2015-08-07T13:55:12.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (600, 2885, 'dsg-description', 'self', 'Arms many times longer than disc size.', '2015-08-07T13:54:51.550');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (601, 3390, 'dsg-description', 'self', 'From a gravity or debris flow that sweeps down the canyon', '2010-12-23T15:18:41.447');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (602, 5444, 'dsg-description', 'self', 'Insite Pegasus zoom camera and a current meter on it.', '2010-12-23T16:06:08.287');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (603, 2440, 'dsg-size', 'self', 'Bell to 12 mm tall.', '2015-04-20T16:36:43.337');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (604, 2440, 'dsg-description', 'self', 'Four radial canals and tentacle bulbs. One to four tentacles which can be different lengths. Bell transparent, tentacles bulbs, tentacles, and manubrium often scarlet or may be white, yellow or orange.', '2011-01-05T15:45:03.300');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (605, 2440, 'dsg-range', 'self', 'California to the Bering Sea.', '2015-04-21T14:52:52.937');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (606, 2440, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-06-13T11:59:34.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (607, 2451, 'dsg-size', 'self', 'Up to 23 mm in diameter.', '2011-01-05T16:20:16.887');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (608, 2451, 'dsg-description', 'self', 'Exumbrella with long nematocyst tracks running up from the base of the tentacles. Manubrium with 4 ruffled lips. No gastric peduncle. Umbrella transparent, white gonads, pale yellow tentacle bases.', '2011-01-05T16:23:43.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (609, 2451, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-21T15:49:36.653');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (611, 2452, 'dsg-size', 'self', 'Bell 8-20 mm tall.', '2011-01-05T16:36:58.113');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (612, 2452, 'dsg-description', 'self', 'Gelatinous apical projection; large, frilly mouth; four broad, ribbon-like radial canals; laterally compressed tentacle bulbs and 12-48 tentacles; manubrium red, yellow, or brown.', '2015-04-21T15:50:12.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (615, 2464, 'dsg-size', 'self', 'Bell up to 10 cm high.', '2011-01-07T16:24:08.957');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (616, 2464, 'dsg-description', 'self', 'Gastric peduncle extends more than half the length of the bell with 4 frilly lips. Up to 256 tentacles with red ocelli at the bases of smaller tentacles.  ', '2011-01-07T16:26:21.467');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (617, 2464, 'dsg-range', 'self', 'Found from Baja to Northern California.', '2011-01-07T16:26:58.980');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (618, 2464, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-07-11T09:30:06.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (619, 2452, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-07-09T08:37:11.593');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (620, 2479, 'dsg-description', 'self', 'Four radial canals with a manubrium that hangs down below the bell, with 4 frilly lips on the mouth. Up to 200 fine, short tentacles. ', '2011-01-12T16:17:12.343');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (621, 2479, 'dsg-size', 'self', '25 - 35 mm maximum bell diameter.', '2011-01-12T16:18:11.270');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (622, 2479, 'dsg-range', 'self', 'Southern California to the Aleutian Islands and off Russia and northern Japan.', '2011-01-12T16:19:08.923');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (623, 2479, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-06-13T12:06:36.907');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (624, 2483, 'dsg-description', 'self', 'Four broad, white gonads forming a cross pattern across the bell. Up to 500 fine tentacles. Square stomach had 4 simple lips.  ', '2011-01-12T16:27:30.693');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (625, 2483, 'dsg-size', 'self', '1 - 9 cm bell diameter.', '2011-01-12T16:28:02.857');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (626, 2483, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-07-11T08:53:33.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (627, 3872, 'dsg-description', 'self', 'Eight yellow, linear gonads slong the radial canals with transparent bell. The stomach is short and broad. Up to 88 large tentacles alternating with smaller ones.', '2011-01-12T16:40:43.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (628, 3872, 'dsg-size', 'self', 'Bell 14 mm maximum length.', '2011-01-12T16:41:20.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (629, 3872, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-07-09T10:47:16.543');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (630, 3866, 'dsg-size', 'self', 'Bell is an average 10 mm diameter and 4.3 mm tall.', '2011-01-13T15:26:42.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (631, 3866, 'dsg-description', 'self', 'Thick, transparent mesoglea is slightly thicker at the apex of the bell. Exumbrella is covered evenly with nematocysts. The manubrium is dark purple, short, and quadratic. Mouth is quadratic with light purple lips. Four simple radial canals with cream colored gonads. Gonads are large and sinuously folded. Up to 57 long tentacles.', '2011-01-13T15:30:29.497');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (632, 3866, 'dsg-reproduction', 'self', 'The hydroid colonies of this species are found to be symbiotic on the shrimp Pasiphea pasicfica. The hydroid colonies are found on the dorsum of the cephalothorax on the shimp.', '2011-01-13T15:35:24.380');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (633, 2488, 'dsg-size', 'self', 'Bell diamter up to 90 mm.', '2011-01-13T15:43:04.717');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (634, 2488, 'dsg-description', 'self', 'Bell margin is lined with several hundred fine tentacles. The 4 radial canals are attached to white gonads form a "cross" which gives the species the common name "Cross jelly". ', '2011-01-13T15:43:54.100');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (635, 2488, 'dsg-range', 'self', 'Found nearshore from Central California to Alaska.', '2011-01-13T15:45:41.073');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (636, 2518, 'dsg-size', 'self', 'Bell up to 8 cm in diameter.', '2011-01-13T16:40:52.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (637, 2518, 'dsg-description', 'self', 'Long, conical peduncle with a small stomach. Six radial canals continue all the way down the peduncle. There are 12 tentacles, alternating 6 long and 6 short.', '2011-01-13T16:42:52.767');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (638, 2518, 'dsg-range', 'self', 'Tropical to subtropical, but can occasionally be found as far north as Central California.', '2011-01-13T16:43:55.893');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (639, 2518, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-06-28T09:47:56.403');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (640, 2488, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-07-09T10:54:36.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (641, 3851, 'dsg-taxonomist-assessment', 'self', 'John Yeh (UH) - The synaphobranchid observed by MBARI on T945 at Davidson Seamount looks like either Histiobrachus bathybius or Ilyophis arx. I (Dr. Yeh) collected both species in NWHI in 2009. In photographs they look very similar - both having very small round pectoral fins and dorsal insertion is level with the pectoral fins. However, looking at both specimens side by side they differed most distinctly by gill slits. I. arx has small distinctly separated gill slits while openings in H. bathybius are larger and almost confluent. They also differ in in head pore counts and dentition (not visible in in situ video or images). They occur similar depths.', '2011-08-18T15:53:57.190');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (642, 1167, 'dsg-reference', 'self', 'Jensen, G.C. (1995). Pacific Coast Crabs and Shrimps. Sea Challengers, Monterey, CA. 87 pp.', '2018-07-09T10:56:57.940');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (643, 1167, 'dsg-depth-distribution', 'self', '12 - 1463 m', '2015-03-30T11:12:29.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (644, 1167, 'dsg-description', 'self', 'Reddish-brown to orange with very long, slender claws (compare to Pleuroncodes planipes).', '2015-03-30T11:12:50.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (645, 1167, 'dsg-range', 'self', 'Sitka, Alaska to Los Coronados, Baja California.', '2015-04-09T14:24:13.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (646, 1171, 'dsg-reference', 'self', 'Jensen, G.C. (1995). Pacific Coast Crabs and Shrimps. Sea Challengers, Monterey, CA. 87 pp.', '2018-07-10T10:14:25.207');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (647, 1171, 'dsg-description', 'self', 'Reddish with short, stout claws (compare to Munida quadrispina).', '2015-03-30T11:29:26.153');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (648, 1171, 'dsg-range', 'self', 'San Francisco, California to Baja California.', '2015-04-09T14:24:57.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (649, 1171, 'dsg-size', 'self', 'Carapace to 50 mm.', '2015-04-09T14:25:03.030');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (650, 1171, 'dsg-depth-distribution', 'self', '45 - 90 m.  In recent years, MBARI researchers have observed these crabs much deeper than the reported depth.', '2015-03-30T11:35:24.037');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (651, 1171, 'dsg-habitat', 'self', 'Benthic, and can be found free-swimming in the water column.', '2015-03-30T11:53:56.680');
