INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (699, 132, 'dsg-range', 'self', 'West coast, North America. This species is not found offshore Monterey Bay.', '2015-04-02T15:57:51.973');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (702, 420, 'dsg-description', 'self', 'Large, uniformly light to medium gray-brown. Long snout, with tip acutely rounded and extending far beyond indented pectoral fins. One to five (usually two) nuchal thorns, and a continuous row of tail thorns. Posterior pelvic fins are elongate, notched and rounded. Tail moderately long and narrow; dorsal fins separated by a large interdorsal thorn. Anterior pelvic fins (walking legs) appear white-tipped in darker animals. In mature males, the claspers are long, narrow and white-tipped (visible in darker animals).', '2016-07-07T09:12:33.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (704, 5469, 'dsg-range', 'self', 'Off mouth of Columbia River, Oregon to southern California.', '2015-03-30T14:28:16.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (707, 5474, 'dsg-depth-distribution', 'self', '18 - 1272 m', '2011-04-12T13:23:56.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (708, 5474, 'dsg-range', 'self', 'Eastern Central Pacific; Baja California to Panama; MBARI ID from S. CA Bight and Gulf of California.', '2015-08-14T08:51:34.970');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (710, 5477, 'dsg-description', 'self', 'A very distinctive species and the only known species off Southern California; it has numerous small integumental photophores and a much larger photophore on each eyelid and large club suckers.', '2015-04-01T15:28:10.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (711, 5477, 'dsg-range', 'self', 'Known off Southern California and Northern Hawaii waters.', '2011-05-11T08:23:18.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (713, 1743, 'dsg-description', 'self', 'Small snake eels with  relatively thin head and most times with no white on the jaw; potentially juvenile Lycenchelys croatalinus.', '2019-05-29T13:57:18.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (714, 1744, 'dsg-description', 'self', 'Adults are larger than Lycenchelys sp. 1. Note white coloration on lower jaw. When pectoral fins are splayed, they appear white.', '2019-05-21T09:54:37.643');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (715, 1503, 'dsg-depth-distribution', 'self', '500 - 3000 m', '2015-04-20T09:25:17.087');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (717, 1503, 'dsg-size', 'self', 'up to 80 cm in length.', '2015-04-20T09:25:27.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (718, 1503, 'dsg-description', 'self', 'This species has an elongate body with a luminous organ at the end of the tail and tiny eyes close to the snout. It has several rows of small teeth and large jaws. The species is black, sometimes with a white line or groove on either side of the dorsal fin. The Pelican Eel is the only species in the family Eurypharyngidae.', '2011-05-09T11:35:36.223');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (719, 1503, 'dsg-range', 'self', 'Occurs in midwaters of tropical and temperate seas worldwide.', '2011-05-09T11:36:41.073');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (721, 2850, 'dsg-description', 'self', 'Looks similar to Henricia sanguinolenta (which may not exist in central California); note the difference in the attachment of the arms to the disc as compared to and Myxoderma platyacanthum.', '2021-03-22T18:05:35.853');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (730, 2806, 'dsg-consulting-taxonomist', 'self', 'David Pawson, Smithsonian Natural History Museum', '2012-01-04T11:01:11.003');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (731, 2805, 'dsg-consulting-taxonomist', 'self', 'David Pawson, Smithsonian Natural History Museum.', '2015-03-29T14:24:32.540');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (735, 5495, 'dsg-depth-distribution', 'self', '898 – 2161 m', '2015-04-01T10:16:59.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (736, 5495, 'dsg-range', 'self', 'Monterey Canyon to Santa Cruz Basin (Southern California).', '2015-04-01T10:17:05.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (737, 5495, 'dsg-habitat', 'self', 'Benthic: typically soft sediment and mud, often found near whale-falls, but might inhabit hard rock as well.', '2015-04-01T10:17:17.347');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (738, 5495, 'dsg-description', 'self', 'Live animals uniformly reddish brown, with digestive gland visible through semi-translucent body as a purple mass. Buccal mass and hermaphroditic gland also visible as pale yellowish masses on anterior and posterior ends of the body, respectively.', '2015-04-01T10:18:14.347');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (739, 961, 'dsg-depth-distribution', 'self', '200 to 1,000 m', '2011-08-08T11:43:11.217');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (740, 961, 'dsg-size', 'self', '10 cm to 2 m (mantle length).', '2015-05-05T15:57:04.067');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (741, 961, 'dsg-range', 'self', 'Worldwide in tropical and temperate waters; also known from the Arctic and Southern Oceans.', '2015-05-05T15:57:14.340');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (743, 420, 'dsg-habitat', 'self', 'Benthic, mud and hard substrate areas.', '2015-03-25T13:16:31.957');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (744, 420, 'dsg-range', 'self', 'Bering Sea to northern Baja.', '2015-03-25T13:17:23.060');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (745, 3734, 'dsg-description', 'self', 'Gray, sometimes with significant mottling.', '2015-03-31T10:14:37.157');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (746, 3734, 'dsg-habitat', 'self', 'Benthic, abyssal plain.', '2015-03-31T10:14:31.450');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (747, 492, 'dsg-description', 'self', 'Dorsal color uniformly light gray or mottled gray-brown with faint eyespots sometimes visible on the pectoral fins. Ventral color white, appearing as a white rim on the snout and pectoral fins. Snout shaped more acutely in males. Discontinuous row of medial thorns rarely seen in imagery.', '2016-07-07T09:15:05.770');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (748, 492, 'dsg-range', 'self', 'Gulf of Alaska (?), British Columbia to northern Baja.', '2015-03-31T10:16:01.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (749, 489, 'dsg-range', 'self', 'Washington state to the Gulf of California.', '2019-09-30T14:05:47.430');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (750, 489, 'dsg-description', 'self', 'Medium gray to dark gray, pectoral fins with dark trailing margins. Claspers in mature males are long, narrow and white-tipped.', '2016-07-07T09:22:33.833');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (751, 490, 'dsg-description', 'self', 'Dark-colored (plum, brown, black). Juveniles and immature animals with distinctive dark "v" shape on snout. Snout shaped more acutely and alar thorns prominent in males. Reportedly may have 1–3 nuchals, no mid-back thorns, line of white tail thorns usually prominent, dorsal fins close together (no interdorsal thorn). Claspers white-tipped in males.', '2016-07-07T09:32:23.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (752, 490, 'dsg-range', 'self', 'Japan and northern Kuril Islands to western Bering Sea, eastern Bering Sea and Gulf of Alaska south to the Gulf of California.', '2019-09-30T14:06:48.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (753, 490, 'dsg-habitat', 'self', 'Benthic, mud, canyon walls, and other hard substrate.', '2015-08-08T18:30:12.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (754, 486, 'dsg-habitat', 'self', 'Benthic, mud, or hard substrate.', '2015-08-08T18:29:19.643');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (755, 486, 'dsg-description', 'self', 'Chocolate brown (occasionally lighter-colored) with darker mottling and spots; white spotting is often observed as well. Disc wider than length. Continuous line of thorns along the mid-line of body and tail. Scapular thorn pairs (2–3) present on shoulders, but not normally visible in imagery. Short tail, with two small, closely spaced dorsal fins. Posterior pelvic fins lobate, relatively long, and narrow. Wide claspers in mature males. Note: molecular work has established that A. badia and A. hyperborea are the same species (see Eschmeyer''s Catalog of Fishes, IUCN, and Last et al. 2016).', '2019-04-30T07:21:42.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (756, 486, 'dsg-range', 'self', 'Bering Sea to Panama, including the Gulf of California.', '2016-07-07T09:05:59.173');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (757, 1406, 'dsg-depth-distribution', 'self', '<75 m (Bizzarro et al. 2014).', '2016-03-16T10:54:18.950');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (758, 1406, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-03-31T10:24:04.690');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (759, 1406, 'dsg-description', 'self', 'Can be difficult to distinguish from the more abundant Bathyraja kincaidii. Gray to brown; actutely pointed snout, eyespots.', '2016-06-14T16:43:52.287');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (764, 2783, 'dsg-description', 'self', 'Pointed, flesh-colored papillae; mottled brownish-orange body.', '2015-04-07T13:19:24.637');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (765, 2783, 'dsg-size', 'self', 'to 50 cm in length.', '2015-05-04T11:47:40.357');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (766, 2783, 'dsg-range', 'self', 'Gulf of Alaska to Cedros Island, Baja.', '2015-04-07T13:19:32.600');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (767, 2783, 'dsg-depth-distribution', 'self', '0 - 249 m', '2015-04-07T13:19:41.280');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (768, 2783, 'dsg-habitat', 'self', 'Benthic: mud, gravel, shell, rock rubble or solid bedrock.', '2015-04-07T13:19:59.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (770, 2785, 'dsg-habitat', 'self', 'Benthic, soft sediment and rock outcrops.', '2015-04-07T13:21:13.960');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (771, 2785, 'dsg-depth-distribution', 'self', '24 - 285 m', '2015-04-07T13:21:19.230');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (772, 2785, 'dsg-description', 'self', 'Orange with rusty brown patches, with small white papillae that look round on video.', '2015-04-07T13:21:24.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (773, 2785, 'dsg-range', 'self', 'British Columbia to Point Conception, California. ', '2015-04-07T13:21:28.607');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (774, 2785, 'dsg-size', 'self', 'at least 38 cm.', '2015-05-04T11:48:49.087');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (776, 755, 'dsg-size', 'self', 'to 15 cm', '2011-08-08T16:12:07.403');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (777, 755, 'dsg-description', 'self', 'Beige or sediment-colored; smooth body with no papillae.', '2015-03-29T14:27:46.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (778, 755, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-03-29T14:27:31.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (779, 755, 'dsg-depth-distribution', 'self', '179 - 2200 m (Lambert 1997), 100 - 5203 m (Maluf 1988).', '2015-03-29T14:27:22.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (780, 755, 'dsg-range', 'self', 'Gulf of Alaska to the Galapagos Islands.', '2015-03-29T14:27:01.550');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (781, 2809, 'dsg-description', 'self', 'Body rarely seen; 10 white tentacles.', '2015-04-07T13:37:47.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (782, 2809, 'dsg-size', 'self', 'to 13 cm', '2011-08-08T16:34:10.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (783, 2809, 'dsg-range', 'self', 'Bering Sea to Cape Horn, South America.', '2015-04-07T13:37:52.107');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (784, 2809, 'dsg-habitat', 'self', 'Benthic, attached to rocks or buried entirely except for the feeding tentacles.', '2015-04-07T13:37:59.853');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (785, 2809, 'dsg-depth-distribution', 'self', '37 - 1067 m', '2015-04-07T13:38:08.810');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (786, 2816, 'dsg-description', 'self', 'Generally flat. Purple, purple-brown, or sediment-covered.', '2015-03-29T14:29:31.333');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (787, 2816, 'dsg-habitat', 'self', 'Epibenthic on soft sediment, common on the abyssal plain.', '2015-03-29T14:29:16.177');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (792, 961, 'dsg-reference', 'self', 'MBA Link Notes (unverified)', '2011-08-09T15:11:01.397');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (797, 618, 'dsg-description', 'self', 'Confirmed new species: orange-pink and somewhat opaque; turgid; posterior feet allow body to stand above the seafloor; robust feeding tentacles; tips more darkly colored than body; two short dorsal fused parapopia are visible on the sharp, nearly 90 degree inflection at the "head".', '2015-03-29T14:18:57.030');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (802, 5488, 'dsg-description', 'self', 'Transparent pink; two very long and two shorter dorsal fused parapodia visible; no sharp 90 degree inflection at "head"; robust feeding tentacles, 8-9 pairs of tube feet along the posterior 2/3 of the body.', '2015-03-29T14:15:48.530');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (809, 491, 'dsg-reference', 'self', 'Ebert, D. (2003). Sharks, rays, and chimeras of California. University of California Press, Berkeley, California. 284 pp.', '2015-09-15T14:55:54.530');
