INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (818, 2805, 'dsg-depth-distribution', 'self', '1645 - 4087 m', '2015-03-29T14:24:24.960');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (820, 2816, 'dsg-depth-distribution', 'self', '1571 - 4070 m (Maluf), 500 - 4300 m (IUCN).', '2016-10-19T10:31:15.553');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (823, 126, 'dsg-description', 'self', 'Bright white; many long, stiff projecting parapodia. This category includes O. mutabilis mutabilis and O. mutabilis affinis which may be indistinguishable on video.', '2015-03-29T14:23:33.583');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (824, 126, 'dsg-depth-distribution', 'self', '1805 - 6000 m', '2015-03-29T14:22:54.827');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (826, 2802, 'dsg-depth-distribution', 'self', '212 - 2599 m', '2015-04-07T14:02:06.830');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (829, 3808, 'dsg-description', 'self', 'Dark purple; long; many short projecting papillae.', '2015-04-07T14:03:32.063');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (830, 3805, 'dsg-description', 'self', 'Confirmed new species. Light brown or sediment-colored. Very small and difficult to see on video; 4-5 pairs of stiff, projecting dorsal papillae.', '2015-03-29T14:20:09.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (832, 2803, 'dsg-depth-distribution', 'self', '1975 - 7250 m', '2015-04-07T14:06:51.947');
