INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1496, 2172, 'dsg-description', 'self', 'Body slender and compressed; anal fin base long and about twice the length of dorsal fin base; eye diameter about twice snout length; upper end of gill slit reaching above midline of side of body.', '2015-04-06T13:29:07.563');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1497, 2169, 'dsg-description', 'self', 'Adipose fin far back on caudal peduncle, relatively large and long; pectorals small.', '2011-10-17T15:42:50.587');
