INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1507, 2173, 'dsg-range', 'self', 'Eastern Pacific in the California Current region from Oregon to southern Baja California.', '2015-04-06T13:45:55.827');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1508, 2173, 'dsg-description', 'self', 'Slender body, narrowed toward the end of caudal peduncle; maximum depth slightly behind the pectoral fin base; caudal peduncle short and narrow; pectoral fins short, far from reaching origin of dorsal fin.', '2015-04-06T13:46:13.853');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1509, 1983, 'dsg-description', 'self', 'The scaleless body is covered with thick, elastic skin. The caudal fin is replaced by a rudder-like structure. Dorsal and anal fins very high with short base. Pectorals small and rounded, directed upward. Mouth very small; teeth fused to form a parrot-like beak.', '2015-04-02T12:58:02.880');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1510, 1983, 'dsg-range', 'self', 'Warm and temperate zones of all oceans.', '2011-10-17T16:00:51.193');
