INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1515, 130, 'dsg-size', 'self', 'to 91 cm', '2015-04-02T15:59:41.040');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1516, 130, 'dsg-range', 'self', 'Eastern Pacific from northern Vancouver Island, Canada to northern part of the Gulf of California.', '2011-10-17T16:10:00.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1517, 130, 'dsg-description', 'self', 'Head short. Pectoral fin tips usually reaching to or beyond the origin of anal fin. Caudal fin always concave. Color silvery on back grading to whitish ventrally.', '2011-10-17T16:10:57.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1520, 938, 'dsg-consulting-taxonomist', 'self', 'Daphne Fautin, University of Kansas.', '2015-04-06T07:39:26.220');
