INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1524, 873, 'dsg-consulting-taxonomist', 'self', 'Daphne Fautin, University of Kansas.', '2015-04-06T07:58:19.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1525, 873, 'dsg-description', 'self', 'Usually orange; the mouth and tentacles rest on a thick, knobbed column, vs. a thin column as seen in the genus Actinoscyphia (the fly trap anemone). Can often been observed in a "flytrap" position.', '2015-04-06T07:59:18.150');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1526, 2374, 'dsg-description', 'self', 'Usually orange; the mouth and tentacles rest on a thin column, vs. a thick column as seen in anemones in the family Hormathiidae.', '2015-04-06T07:35:01.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1527, 875, 'dsg-range', 'self', 'Confimed at Station M (east Pacific).', '2015-04-07T15:24:27.647');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1528, 701, 'dsg-size', 'self', 'Bell diameter up to 70 cm.', '2015-04-23T14:56:38.943');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1529, 701, 'dsg-range', 'self', 'Coastal California.', '2015-04-23T14:56:44.157');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1530, 701, 'dsg-description', 'self', 'Adults have purple stripes, but juveniles have pinkish bells lacking distinctive stripes; 4 long frilly oral arms and 8 marginal tenticles that alternate with nematocysts.', '2015-04-23T14:56:51.043');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1532, 2634, 'dsg-size', 'self', 'Bell up to 30 cm.', '2015-04-23T14:57:39.753');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1533, 2634, 'dsg-range', 'self', 'Eastern Pacific from British Colombia to Mexico.', '2015-04-23T14:57:44.540');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1534, 2634, 'dsg-description', 'self', 'Distinctive golden-brown bell; white oral arms; 24 thin maroon tentacles; may occur in dense swarms at or near the surface.', '2015-04-23T14:57:51.260');
