INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1561, 303, 'dsg-description', 'self', 'Exumbrellar surface of the bell has many small bumps which are composed of dense aggregations of nematocysts; three or four gonads and three or four oral arms with larger nematocyst laden bumps; translucent blue-white colour; tentacles are completely lacking.', '2015-04-23T15:02:55.047');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1562, 303, 'dsg-range', 'self', 'Monterey Bay to the Gulf of California.', '2015-04-23T15:03:00.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1563, 1947, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:23:10.903');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1564, 3861, 'dsg-description', 'self', 'Four oral arms, each reaching greater than 1 meter in length; Bell morphology resembling a wide-brimmed hat; Young have 20 or 21 marginal sense organs and 60 marginal lappets.', '2015-04-23T15:03:38.947');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1565, 3861, 'dsg-habitat', 'self', 'Mesopelagic.', '2015-04-23T15:03:51.727');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1566, 575, 'dsg-depth-distribution', 'self', '1164 - 1890 m', '2012-02-06T10:06:48.087');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1567, 575, 'dsg-range', 'self', 'Pacific.', '2015-04-15T10:52:38.860');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1568, 575, 'dsg-description', 'self', 'Bell-shaped (medusoid) doliolid with four muscle bands. All known specimens have occurred as solitary individuals, the majority with buds. Living specimens have a medusoid shape yet are bilaterally symmetrical. The buccal opening is very large and highly elastic, capable of expanding to the full height (diameter) of the animal, and of contracting to less than 5% of height.', '2015-08-07T12:59:45.523');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1569, 2640, 'dsg-description', 'self', 'Lacking long stinging tentacles; 8 bell lobes; may capture food on the surface of the bell using mucus to ensnare zooplankton prey; cilia transport the food to the bell margin and tentacles, then pass it to the frilly manubrium.', '2015-04-23T15:00:02.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1570, 2640, 'dsg-size', 'self', 'Bell up to  40 cm diameter.', '2015-04-23T15:00:07.947');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1573, 2609, 'dsg-size', 'self', 'Bell diameter up to 5 cm.', '2015-04-23T14:47:58.607');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1574, 2609, 'dsg-description', 'self', 'Twenty relatively short, somewhat stiff tentacles which alternate with 20 rhopalia around the bell margin; Bell has 40 lappets; A single long tentacle, with unknown function, trails behind the jelly; 8 light-colored gonads are large and obvious, surrounding the base of the stomach.', '2015-04-23T14:48:06.443');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1575, 2609, 'dsg-depth-distribution', 'self', '500 - 1000 m', '2011-12-15T14:20:36.990');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1576, 2613, 'dsg-depth-distribution', 'self', 'Up to 5000 m.', '2015-04-23T14:48:54.263');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1577, 2613, 'dsg-size', 'self', 'Up to 15 cm bell diamter.', '2015-04-23T14:48:44.517');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1578, 2613, 'dsg-description', 'self', ' 8 oval-shaped gonads in pairs; Usually 22 tentacles, but ranging from 20 to 36; Uniform red coloration of the bell (although some individuals may lack this pigmentation).', '2015-04-23T14:48:38.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1579, 2613, 'dsg-reference', 'self', 'Wrobel, D. and C. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2018-03-21T10:03:04.563');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1586, 5526, 'dsg-description', 'self', 'Chelipeds usually, but not always, are markedly unequal, the right largest. ', '2011-12-19T10:09:47.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1588, 1160, 'dsg-description', 'self', 'Chelipeds are equal, subequal or grossly unequal.', '2011-12-19T10:11:03.030');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1589, 1160, 'dsg-reference', 'self', 'McLaughlin, P.A., T. Komai, and R. Lemaitre (2010). Annotated checklist of anomuran decapod crustaceans of the world Part I. The Raffles Bulletin of Zoology, 23: 5–107.', '2018-07-10T08:36:09.697');
