INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1605, 5530, 'dsg-reference', 'self', 'McLaughlin, P.A., T. Komai, and R. Lemaitre (2010). Annotated checklist of anomuran decapod crustaceans of the world Part I. The Raffles Bulletin of Zoology, 23: 5–107.', '2018-07-10T08:37:31.880');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1607, 2537, 'dsg-description', 'self', ' 1). All “little red jellies” below 3,000 m should be annotated as Benthocodon unless sampled and confirmed to species 2). Both Benthocodon and Pectis (prior name Voragonema) have a hole in the subumbrella. 3).The presence of centripetal canals would indicate Pectis sp., but these are rarely seen on camera.', '2018-11-05T07:20:11.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1609, 2550, 'dsg-description', 'self', ' 1). All “little red jellies” below 3,000 m should be annotated as Benthocodon unless sampled and confirmed to species 2). Both Benthocodon and Pectis (prior name Voragonema) have a hole in the subumbrella. 3).The presence of centripetal canals would indicate Pectis sp., but these are rarely seen on camera.', '2018-11-05T07:20:58.717');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1611, 5530, 'dsg-description', 'self', 'Large, orange, right claw (bearing a large triangular protusion) is much larger that the left.', '2011-12-19T13:07:13.237');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1612, 5530, 'dsg-depth-distribution', 'self', '90 - 1400 m', '2015-03-30T12:34:44.867');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1613, 5530, 'dsg-range', 'self', 'Bering Sea to California.', '2015-03-30T12:34:51.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1614, 5530, 'dsg-taxonomist-assessment', 'self', 'L. Kuhnz ID''d from MARS site; housed in large Neptunea and Bathybemix shells.', '2015-04-25T17:33:37.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1615, 294, 'dsg-description', 'self', 'White to tan, distinctive shape when foot extended; look very rounded, but actual shell shape unknown. Observed near eggcases that are very similar to moon snail (Neverita lewisii) cases, so it may belong to family Naticidae, sub family Polinicinae.', '2016-08-12T09:15:33.783');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1616, 766, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T09:53:11.487');
