INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1618, 766, 'dsg-description', 'self', 'All fins may have some black on them. White band extends all the way down the body. Compare with Rougheye (S. aleutianus), which are redder and large S. melanostomus. Pink and brown with white splotches, black on the on the rear edge of the gill cover; short dorsals, heavy body.  ', '2015-03-12T14:49:09.780');
