INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1871, 3776, 'dsg-description', 'self', 'Corallum of large specimens ceratoid, firmly attached, and distally flared (trumpet-shaped). Theca white, porcellaneous, and smooth, except near calice where the theca overlaying the S 3 is flared outwards.', '2015-04-06T10:00:18.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1874, 5543, 'dsg-depth-distribution', 'self', '33 - 2248 m', '2012-02-15T15:06:40.737');
