INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1876, 5543, 'dsg-description', 'self', 'Corallum ceratoid, often flaring at calice (trumpet-shaped), attached through a robust pedicel. Corallum light brown or grey.', '2015-04-06T09:53:50.613');
