INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1898, 5544, 'dsg-description', 'self', 'Corallum trochoid, firmly attached through a robust pedicel  firmly anchored to gastropod or bivalve shells or small pebbles by a thin expansive base up to twice calicular diameter in size. Upper quarter to third of well-preserved coralla, including all calicular elements, pigmented a light to dark brown.', '2015-04-06T09:55:58.597');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1901, 2393, 'dsg-depth-distribution', 'self', '0 - 293 m', '2012-02-16T14:00:52.827');
