INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1904, 2393, 'dsg-description', 'self', 'Corallum cylindrical to trochoid, often short and squat, but occasionally taller and more vasiform.', '2015-04-06T09:58:24.457');
