INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1919, 2551, 'dsg-description', 'self', '1). All “little red jellies” below 3,000 m should be annotated as Benthocodon 2). Both Benthocodon and Voragonema have a hole in the subumbrella. 3).The presence of centripetal canals would indicate Voragonema sp., but these are rarely seen on camera.', '2012-02-21T14:31:45.023');
