INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1958, 730, 'dsg-description', 'self', 'Branching from main branch sympodial in an ascending spiral (clockwise or counterclockwise) producing a bottlebrush colony, or dichotomous in one or more planes. Branch- lets repeatedly and dichotomously branched; terminal branchlets short. Polyps large in relation to branch and well separated. Sclerites consist of spindles, rods, and scales. Axis with a brilliant metallic luster, usually golden or yellow in color.', '2012-03-02T10:40:28.620');
