INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1989, 738, 'dsg-description', 'self', 'Loosely dichotomously branched and having branch axils of 40–50° divergence. The axis is woody in texture and a dark golden brown in color, easily seen through the thin, single layer of translucent coenenchymal scales. Calyces are white and arranged in whorls of 3 or 4; calyces face upward. ', '2015-04-07T15:04:31.533');
