INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1994, 739, 'dsg-range', 'self', 'Known only from type specimen in deep waters off Washington; likely US West Coast or more.', '2012-03-02T13:57:28.173');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (1995, 739, 'dsg-size', 'self', '32 cm (h) and 59 cm (w)', '2012-03-02T13:58:23.180');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2006, 739, 'dsg-description', 'self', 'Branches originating from the main branch just 1 cm from the basal attachment and filling approximately 160° of the flabellate plane. Branching is dichotomous and the branching axils are quite narrow, about 10–15°. The axis is straw colored, the calyces white. Calyces are arranged in whorls of 3 or 4 (usually 4) and face upward. There are 10–12 whorls per 3 cm branch length, the whorls spaced 1.2–1.3 mm apart; the whorl diameter is 2.8–3.9 mm. Calyces are 1.5–2.0 mm in horizontal length. The basal scales are 0.8–0.9 mm in height and have rounded dorsolateral edges. Each basal scale bears a smooth spine on its dorsolateral margin that extends up to 0.55 mm. These spines are round in cross section, about 0.1 mm in diameter at the base. Most of these spines also have a lower secondary spine or extension on their sagittal side, these spines only 0.12–0.15 mm in height and flattened in shape. The buccal scales are 1.0–1.05 mm in length and have rounded dorsolateral edges. Each calyx bears 4 (rarely 6) perfectly smooth, slender buccal spines, intact spines up to 0.6 mm in length and 0.1 mm in basal diameter. The crescent-shaped infrabasal scales are up to 0.45 mm in height; the two adjacent coenenchymal scales are often reflected upward near the calyx. The opercular scales are triangular in shape, with a pointed tip. The operculars are longitudinally creased above and keeled on their inner surface; their edges are finely serrate. The abaxial operculars are symmetrical in shape, 0.95–0.97 mm in length, with a L:W of 2.2–2.4. The 4 lateral operculars are only slightly asymmetrical, 0.71–0.90 mm in length, with a L:W of 1.7–2.1. The small adaxial operculars are symmetrical, about 0.7 mm in length, with a L:W of about 2.', '2012-03-02T14:21:00.587');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2007, 737, 'dsg-reference', 'self', 'Cairns, S.D. (2007). Calcaxonian Octocorals (Cnidaria; Anthozoa) from Eastern Pacific Seamounts. Proceedings of the California Academy of Sciences, 58: 511-541.', '2018-03-22T11:48:19.530');
