INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2021, 734, 'dsg-range', 'self', 'Gulf of Panama, Rodriguez Seamount, Davidson Seamount, Monterey Bay, Axial 1998 South Flow, off British Columbia, Gulf of Alaska.', '2015-04-07T14:58:04.267');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2022, 734, 'dsg-size', 'self', '33 cm (h), 16 cm (w).', '2015-04-07T14:58:09.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2023, 734, 'dsg-description', 'self', 'All colonies but one (T833-R56) are uniplanar, the odd specimen being a small, three-dimensionally branching bush. The axis is dark bronze in color, easily seen beneath a single layer of white, translucent coenenchymal scales. Branching is dichotomous and somewhat irregular.', '2015-04-07T14:58:57.050');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2024, 735, 'dsg-reference', 'self', 'Cairns, S.D. (2007). Calcaxonian Octocorals (Cnidaria; Anthozoa) from Eastern Pacific Seamounts. Proceedings of the California Academy of Sciences, 58: 511-541.', '2018-07-10T09:16:51.843');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2025, 735, 'dsg-size', 'self', '28 cm (h)', '2012-03-06T15:45:32.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2026, 735, 'dsg-description', 'self', 'All colonies are strictly uniplanar. The axis is bronze in color. Branching is dichotomous and somewhat irregular.', '2015-04-07T14:57:33.163');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2027, 735, 'dsg-range', 'self', 'Juan de Fuca Ridge off Oregon and eastern Pacific seamounts from off Oregon (Vance Seamount) to the Gulf of Alaska south of the eastern Aleutian Islands (Derickson Seamount, Gulf of Alaska).', '2015-04-07T14:57:43.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2028, 735, 'dsg-depth-distribution', 'self', '1962 – 2773 m', '2015-04-07T14:57:50.963');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2029, 359, 'dsg-reference', 'self', 'Cairns, S.D. (2007). Calcaxonian Octocorals (Cnidaria; Anthozoa) from Eastern Pacific Seamounts. Proceedings of the California Academy of Sciences, 58: 511-541.', '2018-07-09T11:23:24.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2030, 359, 'dsg-description', 'self', 'Long, white, thin. Stems eminate from basal branches. Polyps are very tiny and probably cannot be seen on video, rather it is the calyces that are observable in close-ups. Colonies dichotomously or pinnately branched, or unbranched. Calyces arranged in whorls, the calyces always facing downward. Each polyp enclosed by 3 or 4 pairs of unfused body wall scales (1 pair of basals, 1 or 2 pairs of medials, and 1 pair of buccals), 1–3 pairs of small adaxial buccal scales, and occasionally additional small, unpaired scales on the adaxial body surface. Distal margin of body wall scales often lobate of spinose; dorsolateral edge of basal scales often ridged. Operculum consists of 8 triangular scales, each with a pronounced medial keel on its inner surface. Coenenchymal scales usually elongate or elliptical in shape, often bearing tall vertical keels or ridges. ', '2014-08-03T15:08:06.193');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2031, 359, 'dsg-range', 'self', 'Cosmopolitan', '2012-10-15T11:01:39.647');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2032, 359, 'dsg-depth-distribution', 'self', '55 – 4,594 m', '2012-03-06T15:59:37.873');
