INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2038, 740, 'dsg-description', 'self', 'Long, white, thin. Stems eminate from basal branches. Polyps are very tiny and probably cannot be seen on video, rather it is the calyces that are observable in close-ups.', '2015-04-01T07:12:15.230');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2039, 3863, 'dsg-description', 'self', 'Colonies erect, arborescent from one main stalk. Polyps non-retractile. ', '2015-04-06T11:02:10.827');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2040, 3863, 'dsg-range', 'self', 'Worldwide distribution in temperate to polar regions, mostly in colder waters.', '2012-03-13T12:47:28.283');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2041, 3863, 'dsg-depth-distribution', 'self', 'Subtidal - 2000 m.', '2015-08-08T14:06:41.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2042, 3864, 'dsg-description', 'self', 'Coloration of the tentacles and the distal regions of the polyps (anthocodiae) is salmon pink; basal portion of polyps white; the holdfast and lower region of the stalk are white; the branches of the stalk and the middle to upper parts of stalk are pale pink. The coloration is permanent and was observed in situ and in all preserved specimens as well, including those collected in 1973. Polyps non-retractable.', '2015-04-06T11:03:54.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2045, 2111, 'dsg-description', 'self', 'Body rounded and very slightly compressed, with very loose, flaccid skin; body tapering to a small rounded tail. Head very large and globose, roughly cuboid and bearing especially prominent open lateral-line canals; eyes dorsolateral and covered with a clear ‘window’ of skin; mouth large, oblique to nearly vertical, with relatively small, sharp slender teeth.', '2015-04-30T14:58:37.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2046, 2111, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-15T15:22:29.350');
