INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2066, 1796, 'dsg-description', 'self', 'Shape, coloration and dorsal pattern variable. Height and position of eyes distinctive. Can live up to 47 years.', '2015-03-29T14:58:07.397');
