INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2198, 207, 'dsg-description', 'self', 'A carbonate precipitate structure typically produced by microbial activity at seeps', '2012-07-05T14:26:16.010');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2199, 5144, 'dsg-description', 'self', 'A long continuous steep face of a ridge or plateau formed by erosion; any steep slope, such as one resulting from faulting', '2012-07-05T14:28:35.670');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2200, 5335, 'dsg-description', 'self', 'A blocky and fragmented form of lava occurring in flows with fissured and angular surfaces', '2012-07-05T16:18:26.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2201, 3668, 'dsg-description', 'self', 'This concept is to be used only after examination of a sample', '2012-07-09T15:23:27.457');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2202, 5140, 'dsg-description', 'self', 'Mineral fragments smaller than 1/256 mm (4 microns)', '2012-07-06T15:54:30.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2204, 5337, 'dsg-description', 'self', 'A planar or gently curved fracture where there has been displacement', '2012-07-05T16:23:17.577');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2205, 5341, 'dsg-description', 'self', 'A crack, break or fracture in the rocks with no offset', '2012-07-10T09:01:48.793');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2206, 5345, 'dsg-description', 'self', 'Particles larger than 2 mm in size and includes cobbles and boulders', '2012-07-05T16:26:05.677');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2207, 5326, 'dsg-description', 'self', 'Particle size of 64 mm (2.5 in) to 256 mm (10.1 in); larger than a pebble, smaller than a boulder', '2012-07-06T15:56:13.297');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2208, 5342, 'dsg-description', 'self', 'A small steep-sided valley or erosional channel from 1 meter to about 10 meters across', '2012-07-05T16:33:18.450');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2209, 5328, 'dsg-description', 'self', 'A large and relatively planar fracture in a rock across which there is no relative displacement of the two sides', '2012-07-05T16:34:35.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2210, 3372, 'dsg-description', 'self', ' Jointed, usually hexagonally. Indicator of massive flow', '2012-07-10T09:00:11.497');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2211, 5264, 'dsg-description', 'self', 'This concept is to be used only after examination of a sample', '2012-07-09T13:43:20.310');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2212, 3708, 'dsg-description', 'self', 'A mineral deposited at lower temperature hydrothermal vents', '2012-07-06T09:03:42.467');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2213, 3708, 'dsg-description', 'self', 'This concept is to be used only after examination of a sample', '2012-07-10T08:00:35.290');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2215, 5167, 'dsg-description', 'self', 'General seafloor region (vs. water column)', '2012-07-06T10:55:14.913');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2216, 5329, 'dsg-description', 'self', 'A polished and striated rock surface that results from friction along a fault plate', '2012-07-06T14:42:40.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2217, 5257, 'dsg-description', 'self', 'Used for sediment tracks made by equipment (example ROV, Benthic Rover, grappling), however use the specific annotation "trawl mark" when appropriate', '2016-11-28T12:10:10.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2221, 5141, 'dsg-description', 'self', 'A mixture of water and silt- or clay-sized material', '2012-07-06T15:57:51.430');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2222, 5256, 'dsg-description', 'self', 'A rock fragment, generally rounded by abrasion; diameter 4 to 64 mm (pea to tennis ball sized)', '2012-07-06T15:59:29.707');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2225, 5138, 'dsg-description', 'self', 'Aggregation of detrital particles; diameter between 1/16 to 2 mm', '2012-07-06T16:02:06.960');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2227, 3452, 'dsg-description', 'self', 'An aggregation of small broken shell fragments (usually from bivalves and gastropods)', '2012-07-06T16:03:46.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2228, 5139, 'dsg-description', 'self', 'Solid material that has settled down from a state of suspension in a liquid', '2012-07-06T16:05:03.403');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2230, 3426, 'dsg-description', 'self', 'Used for black volcanic rocks underwater: can''t tell petrologic composition from video', '2012-07-09T08:00:50.050');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2232, 3471, 'dsg-description', 'self', 'Rust colored coating', '2012-07-09T08:47:58.247');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2233, 5120, 'dsg-description', 'self', 'Viscous form of hydrocarbon; tar.', '2015-05-13T16:10:53.880');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2234, 3695, 'dsg-description', 'self', 'General term for broken volcanic rocks (ash and larger grain size) deposits from explosions, debris flows, spalled off glassy bits on a flow front, etc.', '2012-07-09T12:27:53.983');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2236, 5558, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-04-06T15:03:27.200');
