INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2340, 3445, 'dsg-description', 'self', 'A black mineral that can form a crust on rock, or also occur in potato-shaped masses which also contain cobalt, copper, and nickel (see manganese nodule)', '2012-07-10T08:32:15.943');
