INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2346, 5269, 'dsg-description', 'self', 'The arrangement of sedimentary rock in layers; bedding can be used in conjunction with rock outcrop.', '2015-04-01T14:09:17.060');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2347, 3786, 'dsg-description', 'self', 'A narrow shelf or projection of rock, longer than wide, formed on a cliff or rock wall', '2012-07-10T09:09:16.757');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2348, 5271, 'dsg-description', 'self', ' A high, steep face of rock. Video obs: Vertical rock face with little sediment cover. Use rockwall for steep but not vertical rock faces', '2012-07-10T09:10:13.250');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2350, 5161, 'dsg-description', 'self', ' General term for long, narrow elevation, usually sharp-crested and with steep sides; can be rock or sediment', '2012-07-19T14:46:34.333');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2351, 3395, 'dsg-description', 'self', 'Rock that is exposed above surrounding soft sediment', '2012-07-10T09:27:39.267');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2352, 5162, 'dsg-description', 'self', 'Large rock exposure, not necessarily vertical; may be of hard, consolidated rock, but also may be a steep wall of firm, resistant sediments', '2012-07-19T14:45:23.120');
