INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2463, 158, 'dsg-habitat', 'self', 'Epipelagic, mesopelagic.', '2015-04-02T09:13:15.447');
