INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2702, 5652, 'dsg-range', 'self', 'Found throughout the tropical and temperate regions of the world ocean, except the Mediterranean Sea.', '2015-04-07T10:29:04.067');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2705, 5652, 'dsg-description', 'self', 'Smallest of all oceanic squids; eye photophore has a lid that can open and close and produce a brilliant flash; this genus has four species divided into two groups.', '2015-04-07T10:29:14.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2711, 5653, 'dsg-description', 'self', 'Keels on arms III, 5 small photophores on eye with one large photophore anterior, and 4 tentacular photophores.', '2015-04-07T10:31:51.450');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2712, 5653, 'dsg-range', 'self', 'Eastern tropical Pacific.', '2015-04-07T10:31:58.987');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2713, 5653, 'dsg-size', 'self', 'to 31 mm DGL', '2015-04-07T10:35:53.057');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2718, 5654, 'dsg-description', 'self', 'Long, slender arms; arm lengths slightly less than mantle length; smooth arm tips.', '2015-11-04T09:11:36.733');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2719, 5654, 'dsg-range', 'self', 'Northwestern Pacific; Okhotsk Sea.', '2015-05-05T16:27:57.643');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2724, 5655, 'dsg-habitat', 'self', 'Demersal squid found sitting on or swimming near the ocean floor on continental or island shelves and slopes.', '2015-04-07T11:25:14.520');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2725, 5655, 'dsg-range', 'self', 'The three recognized species are found only in the Indo-Pacific region.', '2015-04-07T11:25:34.620');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2726, 5655, 'dsg-description', 'self', 'Both arms IV strongly hectocotylized in males.', '2015-04-07T11:25:49.973');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2731, 5656, 'dsg-range', 'self', 'Found in scattered localities near landmasses in the Indian and Pacific Oceans.', '2015-04-07T11:28:41.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2732, 5656, 'dsg-depth-distribution', 'self', '0 - 700 m', '2015-04-17T14:51:02.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2733, 5656, 'dsg-description', 'self', 'Solitary and commonly rest on the ocean floor or swim just 10 - 20 cm above the bottom.', '2015-04-17T14:51:17.150');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2734, 5656, 'dsg-size', 'self', 'Up to 250 mm ML.', '2015-04-07T11:32:59.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2740, 1405, 'dsg-reference', 'self', 'Ishihara, H., M. Treloar, P.H.F. Bor, H. Senou, and C.H. Jeong (2012). The Comparative Morphology of Skate Egg Capsules (Chondrichthyes: Elasmobranchii: Rajiformes). Bulletin of the Kanagawa Prefectural Museum of Natural History, 44: 9-25.', '2015-08-08T18:28:16.903');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2743, 431, 'dsg-description', 'self', 'Ribbed shell. MBARI molecular analysis (2012) shows that specimens collected in the Gulf of California are A. sphoni.', '2015-04-06T15:39:28.610');
