INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2777, 5668, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2015-04-07T13:54:15.867');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2778, 5661, 'dsg-description', 'self', 'Brown or sediment-covered with small "bumps" which could be papillae or symbiotic animals.', '2015-04-07T13:54:27.143');
