INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2790, 2803, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2015-04-07T14:06:56.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2793, 5669, 'dsg-description', 'self', 'Transparent; flaccid; two short dorsal fused parapodia; no sharp 90 degree inflection at "head"; small, hard to see feeding tentacles.', '2015-03-29T14:19:21.247');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2796, 3805, 'dsg-size', 'self', 'to about 33 mm', '2012-10-18T13:41:21.933');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2801, 5670, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2015-04-07T13:39:39.050');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2802, 5670, 'dsg-description', 'self', 'Body cylindrical, stiff, white, glassy. Long, stiff papillae, dorsal single rows of 4-35; lateral 4-17; ventrolateral feet 8-28 per row.', '2012-10-23T08:39:30.513');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2804, 5670, 'dsg-size', 'self', 'to 20 cm', '2012-10-23T08:45:48.817');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2805, 5671, 'dsg-size', 'self', 'to 10 cm', '2012-10-23T08:46:17.557');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2806, 5671, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2015-04-07T13:39:12.733');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2807, 5671, 'dsg-description', 'self', 'Body cylindrical, stiff, white. Long, stiff papillae, dorsal double rows of 5-35; lateral 5-11; ventrolateral feet 15-20.', '2015-04-07T13:39:19.483');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2810, 5672, 'dsg-description', 'self', 'Body and fins pink in life.', '2016-03-16T10:41:22.800');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2812, 5669, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-03-29T14:19:08.570');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2816, 5674, 'dsg-description', 'self', 'Orange or white; this genus is a provisional ID.', '2015-03-29T12:24:49.217');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2817, 5674, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-29T12:24:27.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2826, 378, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-04-06T12:59:05.843');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2829, 5676, 'dsg-range', 'self', 'Central California to Baja.', '2018-11-19T08:14:36.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2830, 5676, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-29T14:01:56.387');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2833, 5677, 'dsg-reference', 'self', 'Williams, G.C. and P. Alderslade (2011). Three new species of pennatulacean octocorals with the ability to attach to rocky substrata (Cnidaria: Anthozoa: Pennatualcea). Zootaxa, 3001: 33-48.', '2015-08-08T12:52:14.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2834, 5677, 'dsg-range', 'self', 'NE Pacific.', '2015-04-07T15:11:26.210');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2835, 5677, 'dsg-depth-distribution', 'self', '669 - 700 m', '2012-11-05T15:32:34.540');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2836, 5677, 'dsg-description', 'self', 'Ratio of total colony length to rachis diameter approximately 50:1. Mauve rachis/peduncle and dark purplish-brown autozooids.', '2015-04-07T15:10:45.387');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2838, 5426, 'dsg-depth-distribution', 'self', '3317 - 3503 m', '2012-11-05T15:53:10.420');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2839, 5426, 'dsg-range', 'self', 'Northern California.', '2015-04-07T10:30:57.413');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2840, 5426, 'dsg-description', 'self', 'These white sponges are made up of multiple harp-shaped structures (vanes); branches with terminal balls.', '2015-04-07T10:32:29.507');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2845, 2419, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-07T15:15:56.457');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2847, 2802, 'dsg-range', 'self', 'Cosmopolitan.', '2015-04-07T14:02:31.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2850, 878, 'dsg-description', 'self', 'Small, white zoanthids; can be abundant on the dead stalks of Hyalonema sponges (Station M)', '2012-12-11T11:08:56.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2853, 5680, 'dsg-description', 'self', '', '2013-01-02T12:02:06.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2854, 5680, 'dsg-consulting-taxonomist', 'self', 'Gretchen Lambert', '2013-01-02T12:01:45.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2855, 5681, 'dsg-consulting-taxonomist', 'self', 'Gretchen Lambert, Seattle, WA.', '2015-03-31T07:25:05.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2856, 5681, 'dsg-description', 'self', 'Star-shaped with 8 rays, flat.', '2015-03-31T07:22:20.813');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2859, 5685, 'dsg-description', 'self', 'Long transparent red, purple, or white tentacles with a darker colored center. Exhibits both deposit and predatory (raptorial) feeding behaviors.', '2015-05-12T07:44:56.550');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2861, 3747, 'dsg-description', 'self', 'Vase-shaped with long basal spicules.', '2015-04-07T11:06:31.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2863, 5686, 'dsg-description', 'self', 'White, 10 arms. Identification established via specimens trawled from Station M (4,070 – 4,135 m by R/V New Horizon). ', '2017-08-01T13:03:54.923');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2866, 5687, 'dsg-description', 'self', 'Opaque pink, not shiny. This possibly new genus is close to the new Hansenothuria, but differs by the presence of mid ventral tube feet.', '2015-03-29T14:25:28.470');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2872, 5694, 'dsg-description', 'self', 'Very large (can be over 20 cm in length), flared pleopods; this the first record from the Eastern Pacific. Legs on the abdomen are located at right angles laterally--only seen in penaeoids. Note that this name is still in flux. The name C. monstruosus was given to the larval form of this animal years ago. The name of the adult (P. armatus) will take precendence now that they are known to be the same animal. No ruling has been made by the ICZN as of Nov. 2018.', '2019-01-23T10:29:11.200');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2873, 5694, 'dsg-consulting-taxonomist', 'self', 'Mary Wicksten, Professor, Texas A&M University, College Station, Texas.', '2015-03-30T13:24:59.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2874, 5688, 'dsg-description', 'self', 'Long (can reach at least 35 cm), thin, white; sometimes appears to have a "bulb" at the base where it enters the sediment; may not be sessile (may be capable of readily moving)', '2013-05-02T11:58:20.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2875, 770, 'dsg-size', 'self', 'to 55.2 cm', '2013-01-30T10:53:11.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2876, 770, 'dsg-description', 'self', 'White blotches on dorsal side, light lateral line, and tiny speckles are common features.', '2015-04-02T12:03:34.777');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2877, 770, 'dsg-consulting-taxonomist', 'self', 'Mary Yoklavich, Research Fishery Biologist, Supervisor NOAA Fisheries, Santa Cruz, CA.', '2015-04-02T12:03:40.937');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2878, 2862, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-04-06T14:14:57.033');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2883, 5700, 'dsg-description', 'self', 'Large compared to other species, look for black gut', '2013-03-06T16:34:33.113');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2892, 5702, 'dsg-consulting-taxonomist', 'self', 'Richard E. Young, Professor of Oceanography, University of Oceanography.', '2015-03-27T11:34:12.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2893, 5702, 'dsg-description', 'self', 'Long arms, elongate body, large fins. C. murrayi often has heavier pigmentation around the arms and lighter pigmentation on head and mantle, particularly near the eyes.  The critical factor, however, are the extremely small eyes. Even though some other cirroteuthids and stauroteuthids have small eyes, those of C. murrayi are distinctly smaller and they don''t have lenses.', '2015-03-27T11:34:22.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2894, 125, 'dsg-description', 'self', 'Occasionally observed at the surface, but they remain buried most of the time. Animals in this genus are difficult to tell apart unless collected.', '2015-04-07T12:43:04.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2895, 2744, 'dsg-description', 'self', 'Occasionally observed at the surface, but they remain buried most of the time; animals in this genus are difficult to tell apart unless collected.', '2015-04-07T12:42:43.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2896, 1539, 'dsg-consulting-taxonomist', 'self', 'John Paxton, Australian Museum.', '2015-04-15T14:33:02.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2897, 3108, 'dsg-depth-distribution', 'self', '0 - 20 m', '2015-04-07T08:43:10.593');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2898, 3108, 'dsg-range', 'self', 'Monterey to Baja', '2013-03-20T07:48:36.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2911, 3088, 'dsg-description', 'self', 'Rounded profile, often with cirripedia (barnacles), or anemones attached.', '2015-04-07T09:42:47.923');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2912, 5715, 'dsg-depth-distribution', 'self', 'to 180 m', '2013-03-29T12:25:07.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2914, 931, 'dsg-description', 'self', 'Yellow-green in color, often attached to dead sponge stalks.', '2015-03-30T14:59:24.230');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2918, 292, 'dsg-description', 'self', 'Usually settled in sediment, but they have a distinctive warty column when it is visible.', '2015-04-07T14:32:12.233');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2920, 5708, 'dsg-reference', 'self', 'Moore, J. A. (2002). Upside-Down Swimming Behavior in a Whipnose Anglerfish (Teleostei: Ceratioidei: Gigantactinidae). Copeia, 2002: 1144-1146.', '2018-06-28T09:57:49.760');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2923, 641, 'dsg-consulting-taxonomist', 'self', 'Jean Vacelet, Centre of Oceanology, Aix-Marseille University, France.', '2015-04-07T10:33:24.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2924, 641, 'dsg-description', 'self', 'This species is probably not Chondrocladia concrescens (Schmidt 1880), which has verticillate branches around the stalk.', '2015-04-07T10:33:30.267');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2925, 2983, 'dsg-description', 'self', 'Large-bodied and generally gray, but can change color very quickly.', '2015-05-05T16:55:01.920');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2926, 2983, 'dsg-size', 'self', 'to 3.6 m', '2013-05-10T08:49:15.023');
