INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2945, 5729, 'dsg-description', 'self', 'Transparent; flaccid; two short dorsal fused parapodia visible; no sharp 90 degree inflection at "head"; small, hard to see feeding tentacles on video, but they have orange/pink coloration on them.', '2015-03-29T14:18:23.290');
