INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2989, 621, 'dsg-range', 'self', 'California, Hawaii, Atlantic. Worldwide in tropical and temperate waters.', '2020-12-23T16:56:37.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2991, 2102, 'dsg-consulting-taxonomist', 'self', 'Theodore Pietsch, University of Washington Professor, Aquatic & Fishery Sciences Curator of Fishes, Burke Museum of Natural History and Culture.', '2015-04-06T13:21:29.310');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2994, 5743, 'dsg-description', 'self', 'The overall appearance of the colony is brown-red in color. Nectophores, with upper and upper lateral surfaces densely covered in patches of nematocysts. The bracts are nearly transparent and give the siphosome a ragged appearance rather than a well-defined outline.', '2015-04-17T14:57:03.900');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2995, 5742, 'dsg-description', 'self', 'The orange-white tinge of the siphosome, with deep red gastrozooids, contrasts with  the complete lack of color in the nectosome. Large nectophores with patches of nematocysts covering their upper and upper-lateral sides. Refractile cells scattered in and around these patches. Bracts, gastrozooids and numerous palpons give the siphosome a relatively thick and well-defined fleece-like outline.', '2015-04-17T14:57:42.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2998, 5745, 'dsg-description', 'self', 'Six-rayed, light-colored, pink to darker pink (see images). Note that these often appear to have 5 arms (sometimes a 6th arm may be underneath the others).', '2015-06-23T08:36:39.607');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (2999, 5745, 'dsg-range', 'self', 'Northwest Pacific; Axial Seamount area.', '2015-03-29T13:42:34.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3000, 5745, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-29T13:42:27.443');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3003, 5746, 'dsg-description', 'self', 'Tan to white, flat; attached to scaphopod shells.', '2015-04-06T08:51:33.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3004, 5746, 'dsg-size', 'self', 'to 65 mm', '2013-09-04T13:25:09.993');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3005, 5746, 'dsg-range', 'self', 'California and Oregon.', '2015-04-06T08:51:40.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3006, 5746, 'dsg-depth-distribution', 'self', '530 - 4,325 m', '2013-09-04T13:27:25.200');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3011, 5747, 'dsg-description', 'self', 'White to light grey, with pinkish-brown pedal disc (when visible), tentacles slightly thickened aborally at base and arrayed in 3 cycles.', '2015-04-06T08:54:05.843');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3012, 5747, 'dsg-range', 'self', 'Appears endemic to the NW Pacific, but only verified from Station M at this time.', '2015-04-06T08:54:15.353');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3013, 5747, 'dsg-size', 'self', 'Oral disc diameter 34 – 48 mm.', '2015-08-08T12:00:51.087');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3022, 2801, 'dsg-description', 'self', 'Long papillae compared to Pannychia; Laetmogone lacks podia in the mid-ventral ambulacrum.', '2019-10-31T08:25:09.867');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3029, 5762, 'dsg-size', 'self', 'To at least 1.75 m in length.', '2015-04-17T14:53:09.867');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3030, 5762, 'dsg-range', 'self', 'Currently known from the Gulf of California.', '2015-04-07T10:11:47.663');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3031, 5571, 'dsg-description', 'self', 'White; have thus far only been observed floating above the seafloor.', '2015-04-07T10:11:30.567');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3032, 5762, 'dsg-description', 'self', 'Purple or orangish in color.', '2016-09-27T13:27:18.817');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3033, 5561, 'dsg-description', 'self', 'Narrow-lipped species; divet on one side of the body is characteristic of this genus.', '2015-04-07T09:58:18.200');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3036, 5766, 'dsg-consulting-taxonomist', 'self', 'Bill Newman, Scripps Institution of Oceanography.', '2015-04-07T13:54:05.947');
