INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3048, 5773, 'dsg-consulting-taxonomist', 'self', 'Richard Mooi, California Academy of Sciences, San Francisco, California.', '2015-04-07T12:23:26.587');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3049, 5773, 'dsg-description', 'self', 'Compare to Pilematechinus, which has much shorter spines, and a periproct that is much more above the margin.', '2015-04-07T12:23:31.667');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3050, 5773, 'dsg-range', 'self', 'Axial region of the Juan de Fuca Ridge. Previously this species was only known only from the type material collected by the Albatross in the Gulf of California in the late 1800''s.', '2015-04-07T12:23:36.707');
