INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3130, 5783, 'dsg-description', 'self', 'This species has only been observed deeper than 1000 meters. Translucent wings, base of shell curved, minimal ribbing on shell.', '2019-02-04T15:01:04.653');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3131, 5782, 'dsg-description', 'self', 'This species was observed in the Gulf of California in trawls; It has also been found in Monterey Bay trawls; difficult to distinguish from Creseis virgula in ROV video.', '2014-01-06T16:51:42.497');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3132, 5748, 'dsg-description', 'self', 'The ratio of marginal to discal tentacles is about 2:1.', '2015-04-06T09:44:07.030');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3133, 5748, 'dsg-consulting-taxonomist', 'self', 'Daphne Fautin, University of Kansas.', '2015-04-06T09:44:14.440');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3138, 5566, 'dsg-description', 'self', 'White, short lipped.', '2015-02-04T08:33:36.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3140, 3728, 'dsg-description', 'self', 'Mostly reddish-purple with a white rachis, but can appear all white.', '2017-09-27T08:08:14.063');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3144, 5790, 'dsg-reference', 'self', 'Opresko, D.M. (2011). Nomenclatural note: Heteropathes (Cnidaria: Anthozoa: Antipatharia: Cladopathidae): A new name for Heliopathes Opresko, 2003. Zootaxa, 2782: 67–68.', '2015-04-20T14:23:16.377');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3149, 5791, 'dsg-reference', 'self', 'Nishi, E., and G.W. Rouse (2014). First whale fall chaetopterid; a gigantic new species of Phyllochaetopterus (Chaetopteridae: Annelida) from the deep sea off California. Proceedings of the Biological Society of Washington. 126: 287-298.', '2018-07-10T09:52:40.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3151, 5482, 'dsg-description', 'self', 'While some of the recorded occurrences of stalked ruffled sponges may represent F. truncata, determination of these imaged specimens to species level on the basis of body form alone can be done only in very special situations where the benthic megafauna is well known and a single body form can be related directly to one species only.', '2014-02-03T10:43:33.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3157, 5799, 'dsg-size', 'self', 'Height to 45 mm.', '2015-05-05T15:22:09.267');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3158, 5799, 'dsg-range', 'self', 'Alaska to Baja/Guyamas, Kamchatka to northern Japan.', '2015-04-06T15:51:04.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3159, 5799, 'dsg-depth-distribution', 'self', '27 - 4100 m', '2015-04-17T14:20:09.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3160, 5799, 'dsg-description', 'self', 'Colorless, translucent, iridescent. Auricles large, posterior merged with disc.', '2014-04-08T09:19:48.737');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3161, 5799, 'dsg-reference', 'self', 'Coan, E.V., P. Valentich-Scott, and F.R. Bernard (2000). Bivalve Seashells of Western North America. Santa Barbara Museum of Natural History Monographs. Santa Barbara Museum of Natural History. Santa Barbara, CA. 764 pp.', '2018-06-13T10:12:07.123');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3162, 5768, 'dsg-consulting-taxonomist', 'self', 'Karen Sanamyan, Kamchatka Branch of Pacific Institute of Geography, Russia.', '2015-04-06T08:54:57.920');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3172, 5809, 'dsg-description', 'self', 'Branching. Can be distinguished from A. rickettsi in that A. monticola is more robust, more opaque, and more densly branched. Sponge is white in situ and in preserved state.', '2015-04-17T13:57:06.270');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3173, 5810, 'dsg-description', 'self', 'An arborescent, dichotomously-branching cladorhizid with bottle-brush arrangement of filaments. It can be distinguished from A. monticola in that it is less densly branched, more transparent, and weaker in appearance. Sponge is white in situ and in preserved state.', '2015-04-07T10:28:32.140');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3178, 5810, 'dsg-depth-distribution', 'self', '990 - 1100 m', '2014-04-30T10:40:11.020');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3179, 5810, 'dsg-range', 'self', 'Low-oxygen basins off southern California.', '2015-04-17T13:56:04.940');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3180, 5809, 'dsg-depth-distribution', 'self', '590 - 2000 m', '2014-04-30T10:43:47.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3181, 5809, 'dsg-range', 'self', 'Northeast Pacific.', '2015-04-07T10:27:11.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3183, 5667, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2015-03-29T14:37:53.770');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3184, 5667, 'dsg-description', 'self', 'Round, transparent, lives commensally on Paroriza holothurians.', '2015-03-29T14:38:20.317');
