INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3191, 5826, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-04-06T14:20:02.043');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3192, 5826, 'dsg-description', 'self', 'No pedicellariae; feeds on deep-sea corals.', '2015-04-06T14:20:07.950');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3194, 2851, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-27T14:17:57.990');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3197, 2860, 'dsg-range', 'self', 'Aleutians, Canada to Gulf of California.', '2015-03-27T14:32:19.790');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3198, 2860, 'dsg-depth-distribution', 'self', '110 - 2373 m (as shallow as 30 m in British Columbia).', '2015-03-27T14:32:34.690');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3199, 2860, 'dsg-description', 'self', 'Substantial morphological variation in specimens in deep and southern range collections.', '2015-03-27T14:32:44.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3202, 5827, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-27T14:26:26.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3205, 2861, 'dsg-description', 'self', 'Can exhibit morphological differences over the geographic range.', '2015-04-06T14:16:34.213');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3206, 2861, 'dsg-range', 'self', 'Cosmopolitan; North Pacific, South Pacific, Atlantic, South Atlantic.', '2015-04-06T14:16:47.920');
