INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3215, 5685, 'dsg-reference', 'self', 'Riemann-Zurneck, K. (1997). A heisessile sea anemone from the Porcupine Abyssal Plan, North Atlantic Ocean: IOSACTIS. Journal of the Marine Biological Association of the UK, 77: 1011–1025.', '2015-08-08T12:15:56.507');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3216, 5685, 'dsg-habitat', 'self', 'Benthic; column normally buried in soft sediment, but it is capable of leaving its burrow (hemisessile). We have observed them somersaulting over the seafloor (see sequence in images 3 - 5). ', '2015-05-12T07:56:21.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3217, 5673, 'dsg-consulting-taxonomist', 'self', 'Daphne Fautin, University of Kansas.', '2015-04-06T10:01:29.570');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3220, 3513, 'dsg-description', 'self', 'water column observations of aggregations, pellets, etc.', '2014-06-30T08:46:12.297');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3249, 2423, 'dsg-description', 'self', 'A long thin stalk with a cluster of polyps at the end indicates Umbellula; a short, more robust stalk may indicate Kophobelemnon.', '2015-04-07T15:16:59.277');
