INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3258, 1178, 'dsg-description', 'self', 'Distinctive rostrum spines and cheliped fingers.', '2015-03-30T12:24:00.587');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3260, 5622, 'dsg-description', 'self', 'Candelabra-shaped, with conspicuous "sweeper-tentacles" at the base and sometimes also observed in the branches. Large root-like calcareous holdfast. Compare to Keratoisis. ', '2019-01-02T09:17:09.207');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3261, 174, 'dsg-description', 'self', 'Compare with small Paragorgia. When touched, these are not flexible. Usually appear as lighter pink than Paragorgia.', '2014-08-01T07:56:14.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3262, 353, 'dsg-description', 'self', 'White. Single, thin (about 1 cm width) rachis, and about 1-2 m length when unbroken. ', '2014-10-17T14:01:58.247');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3265, 5871, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-03-30T08:16:31.997');
