INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3977, 1198, 'dsg-depth-distribution', 'self', '53 - 1900 m', '2014-10-13T10:26:05.760');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3978, 1198, 'dsg-description', 'self', 'Orange to orange-red in coloration. Interspace between brachial regions is deep, brachial region extends beyond the lateral margin. Two spines at the intersection of the branchial ridges.', '2019-01-24T11:14:17.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3980, 1176, 'dsg-range', 'self', 'Northeast Pacific; Bering Sea to San Diego, CA.', '2015-03-30T12:22:20.847');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3981, 1176, 'dsg-size', 'self', 'Carapace length to 18.5 cm.', '2015-03-30T12:22:29.820');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3982, 1176, 'dsg-depth-distribution', 'self', 'Intertidal to 547 m (usually below 18 m).', '2015-03-30T12:22:39.797');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3983, 1176, 'dsg-description', 'self', 'Reddish brown or tan, large chelipeds.', '2015-03-30T12:22:45.993');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3985, 170, 'dsg-range', 'self', 'North Pacific: British Columbia Canada, Bering Sea to San Diego, CA. Russia and Japan.', '2014-10-13T11:06:05.280');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3986, 170, 'dsg-depth-distribution', 'self', '600 - 1665 m', '2014-10-13T11:06:28.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3987, 170, 'dsg-description', 'self', 'Carapace as wide as long. Scarlet red with thick, blunt spines on the carapace and legs; spines longer and closer together than P. verilli. Rostrum with a simple medial spine and two basal spines. Specimens from Monterey Canyon had parasitic/commensal caprellids (Caprella bathytatos) on the mouth parts.', '2019-05-16T12:39:45.473');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3988, 170, 'dsg-size', 'self', 'Carapace length to 8 cm.', '2015-03-30T12:26:31.897');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3989, 1183, 'dsg-size', 'self', 'Carapace length to 10.2 cm.', '2015-03-30T12:33:29.847');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3991, 1183, 'dsg-range', 'self', 'North Pacific: Bering Sea to Cortez Bank (Channel Islands chain). Japan.', '2014-10-13T11:22:04.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3992, 1183, 'dsg-depth-distribution', 'self', '850 - 2379 m', '2014-10-13T11:20:42.040');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3993, 1183, 'dsg-description', 'self', 'Carapace slightly longer than wide. Scarlet red with large spines elevated areas and lateral margins. Flattened walking legs.', '2014-10-13T11:24:08.153');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3995, 5529, 'dsg-description', 'self', 'Scarlet red, four long spines on lateral margin of carapace. ', '2014-10-13T11:30:05.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3996, 5529, 'dsg-range', 'self', 'North Pacific: Bering Sea to San Diego, CA. Midway Island, Japan.', '2015-03-30T12:20:12.980');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3997, 5529, 'dsg-size', 'self', 'Carapace length to 11.5 cm.', '2015-03-30T12:20:24.060');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (3999, 769, 'dsg-depth-distribution', 'self', '87 - 768 m, adults usually deeper than 200 m.', '2015-03-29T16:53:23.453');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4000, 5901, 'dsg-reference', 'self', 'True, F. W. (1885). On a new species of porpoise, Phocoena dalli, from Alaska. Proceedings of the United States National Museum, 8: 95-98.', '2018-07-10T09:41:50.287');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4002, 5904, 'dsg-description', 'self', 'Yellow; narrow-lipped; could be Coleodesmium.', '2016-09-28T07:37:15.583');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4003, 5904, 'dsg-range', 'self', 'Thus far known from Monterey Canyon.', '2015-04-07T10:12:09.623');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4004, 5905, 'dsg-reference', 'self', 'Norman, M (2000). Cephalopods, A World Guide. Conchbooks, Hackenheim, Germany. 318 pp.', '2015-04-07T08:33:09.627');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4005, 5905, 'dsg-size', 'self', 'Body to 14 cm, arms to 30 cm.', '2015-04-07T08:33:17.630');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4006, 5905, 'dsg-range', 'self', 'Gulf of Alaska to Baja Califonia, and possibly Sea of Japan, Russia.', '2015-04-07T08:33:23.573');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4007, 5905, 'dsg-description', 'self', 'Muscular, tan-orange, large eyes (which look orange on video), deep webs (making the arms appear short compared to O. rubescens), raised patches/papillae may be seen over body and arms.', '2017-09-11T13:07:56.793');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4008, 5905, 'dsg-depth-distribution', 'self', '100 - 900 m', '2014-11-03T15:13:55.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4009, 5905, 'dsg-habitat', 'self', 'Benthic.', '2015-04-07T08:33:41.560');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4010, 3016, 'dsg-reference', 'self', 'Norman, M. (2000). Cephalopods, A World Guide. Conchbooks, Hackenheim, Germany. 318 pp.', '2015-04-07T08:34:15.920');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4016, 3767, 'dsg-description', 'self', 'White to light yellow with reticulate lines on the dorsum; these lines may diminish in appearance with depth.', '2015-04-07T09:05:25.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4017, 3767, 'dsg-size', 'self', 'to 3.5 cm', '2014-11-04T08:54:21.533');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4019, 3767, 'dsg-consulting-taxonomist', 'self', 'Angel Valdes, California State Polytechnic University, Pomona, California.', '2015-04-07T09:05:41.827');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4020, 3028, 'dsg-consulting-taxonomist', 'self', 'Alexander Martynov, Zoological Museum, Moscow State University, Moscow, Russia.', '2015-04-07T09:08:02.583');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4021, 5907, 'dsg-consulting-taxonomist', 'self', 'Alexander Martynov, Zoological Museum, Moscow State University, Moscow, Russia.', '2015-04-07T09:04:10.733');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4022, 5907, 'dsg-habitat', 'self', 'Benthic.', '2015-04-07T09:04:17.530');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4023, 3028, 'dsg-description', 'self', 'Pink-peach, reddish, white-colored, gill appendages line the dorsum, oral veil with long appendages, large rhinophores may be visible. Normally dark pink (in our range) with white gills along the edge when near Paragorgia, possibly Funiculina, and other deeply-colored prey. Lighter color when feeding elsewhere.', '2019-01-28T07:33:02.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4024, 3028, 'dsg-size', 'self', 'to 20 cm', '2014-11-04T10:08:10.643');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4026, 5907, 'dsg-description', 'self', 'Yellow-orange with a white margin, large tubercles cover the body.', '2015-04-07T09:04:24.913');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4027, 5907, 'dsg-size', 'self', 'to 30 cm', '2014-11-04T10:15:53.843');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4029, 3335, 'dsg-description', 'self', 'junk', '2018-01-31T08:17:58.790');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4030, 1469, 'dsg-reference', 'self', 'Love, M.S. (2011). Certainly more than you want to know about the fishes of the Pacific coast. Really Big Press, Santa Barbara, CA. 649 pp.', '2018-06-13T11:34:43.477');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4031, 1469, 'dsg-size', 'self', 'to 24.8 cm', '2014-11-06T08:06:16.240');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4032, 1469, 'dsg-range', 'self', 'Gulf of Alaska to southern Baja California.', '2015-04-01T13:41:12.227');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4033, 1469, 'dsg-depth-distribution', 'self', 'to 310 m', '2014-11-06T08:07:29.983');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4034, 1469, 'dsg-description', 'self', 'Large, underslung mouth, silvery. Compare to Sardinopsis sagax (sardine) which have a series of black spots on the sides.', '2015-04-01T13:41:20.240');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4035, 1466, 'dsg-reference', 'self', 'Love, M.S. (2011). Certainly more than you want to know about the fishes of the Pacific coast. Really Big Press, Santa Barbara, CA. 649 pp.', '2018-07-11T09:26:23.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4038, 5908, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-03-30T09:00:02.890');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4039, 5908, 'dsg-consulting-taxonomist', 'self', 'Greg Rouse, Scripps Institute of Oceanography.', '2015-03-30T09:00:09.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4040, 5908, 'dsg-description', 'self', 'Relatively long and curved, can be very dense.', '2015-03-30T09:00:21.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4042, 5456, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-27T14:44:50.953');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4043, 1796, 'dsg-habitat', 'self', 'Benthic.', '2015-03-29T14:57:15.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4047, 5909, 'dsg-description', 'self', 'Biologically formed sedimentary structures found in sediments including tracks, trails, traces, burrows, borings, fecal casts, and coprolites', '2014-11-10T15:32:13.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4048, 5917, 'dsg-description', 'self', 'Conical sediment mound (lighter in color) with hole at apex and second hole on flank or base of cone', '2014-11-10T15:39:12.890');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4049, 5943, 'dsg-description', 'self', '?Short? spoke, holes spaced at intervals > 2 spoke lengths', '2014-11-10T15:43:14.783');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4050, 5941, 'dsg-description', 'self', '?Short? spoke, holes spaced at intervals < 2 spoke lengths', '2014-11-10T15:45:07.507');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4051, 5919, 'dsg-description', 'self', 'Narrow, deep burrow. Compare with crater pit which is wide and shallow.', '2014-11-10T15:47:27.613');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4053, 5933, 'dsg-description', 'self', 'Wide plowed v-shaped groove with gently sloping sides.', '2014-11-10T15:53:17.570');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4054, 5929, 'dsg-description', 'self', 'Intermediate-width plowed groove, as though a finger was drawn through the sediment.', '2014-11-10T15:54:51.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4056, 5945, 'dsg-description', 'self', 'Fecal cast with mixed shapes', '2014-11-10T15:58:15.413');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4057, 5949, 'dsg-description', 'self', 'Coil of ''string of pearls'' cast, often with a ''tail'' extending straight in the direction of travel. Compare to knotted cast.', '2014-11-10T16:00:53.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4058, 5948, 'dsg-description', 'self', 'Elongate cylindrical cast composed of tightly grouped rings perpendicular to the long axis of the cast. Compare to coiled cast.', '2014-11-10T16:00:18.330');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4061, 5944, 'dsg-description', 'self', 'Pentagonal depression with straight arms', '2014-11-10T16:10:56.810');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4062, 5951, 'dsg-description', 'self', 'Sediment mound with small irregular grooves radiating from it to approximately 2x diameter of mound', '2014-11-10T16:12:42.747');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4063, 5939, 'dsg-description', 'self', 'general biologically produced sediment disturbance, but not specifically bioturbation (ex: suspected old sponge spicule mound)', '2014-11-10T16:13:40.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4064, 5913, 'dsg-description', 'self', 'Irregularly-shaped scar revealing subsurface sediment.', '2014-11-10T16:18:09.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4065, 5921, 'dsg-description', 'self', 'Track of dense tube feet impressions, often with two distinct rows along the centerline.', '2014-11-10T16:20:50.173');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4067, 5923, 'dsg-description', 'self', 'Narrow, raised track furrowed/broken along crest.', '2014-11-10T16:24:39.947');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4068, 5925, 'dsg-description', 'self', 'Repeating ''V''-shaped depressions. The direction of travel is with points of the ''V''s.', '2014-11-10T16:27:07.177');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4069, 5927, 'dsg-description', 'self', 'Smooth, shallow, wide depression', '2014-11-10T16:28:12.637');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4070, 5931, 'dsg-description', 'self', 'Track of sparse tube feet impressions, generally in two rows.', '2014-11-10T16:29:20.180');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4072, 5935, 'dsg-description', 'self', 'W-shaped plowed track with raised centerline', '2014-11-10T22:02:34.153');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4073, 5937, 'dsg-description', 'self', 'Wide, shallow depressed track with small grooves along it. Possibly created by holothurians', '2014-11-10T22:18:51.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4076, 5952, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-04-07T13:54:38.523');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4077, 5953, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-04-07T13:54:47.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4078, 5953, 'dsg-description', 'self', 'Short dorsal papillae in rows.', '2015-04-07T13:54:52.520');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4081, 5954, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2015-04-07T11:47:02.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4082, 2698, 'dsg-depth-distribution', 'self', 'to 1000 m', '2014-12-19T08:16:31.703');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4083, 2698, 'dsg-size', 'self', 'to 15 cm', '2014-12-19T08:16:57.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4084, 2698, 'dsg-description', 'self', 'Generally transparent; swarms are common.', '2015-03-29T14:32:36.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4085, 2706, 'dsg-description', 'self', 'Relatively rare. Look for a pointed apex.', '2015-03-29T14:32:08.223');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4086, 2014, 'dsg-description', 'self', 'Long, slender; often observed hanging vertical (head up) before quickly darting away.', '2015-01-06T14:51:41.857');
