INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4230, 5828, 'dsg-description', 'self', 'Compare with H. californica. Deep orange-red, generally flat - less inflated, much larger, perimeter spines shorter and may be more closely spaced.', '2015-03-27T14:30:24.527');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4231, 2860, 'dsg-description', 'self', 'Compare with H. lepidonotus. Light orange-pink, numerous long dorsal spines (note pattern), inflated, relatively small, longer perimeter spines.', '2015-01-20T16:27:53.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4232, 5968, 'dsg-range', 'self', 'Alaska to San Diego.', '2015-03-29T13:48:44.900');
