INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4234, 5977, 'dsg-description', 'self', 'Heterozonias vs. Solaster: the diagnostic feature relates to the pattern of the paxillae on the marginal plate series. A specimen or high definition image is required to ID.', '2015-01-20T16:57:17.217');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4235, 5977, 'dsg-range', 'self', 'Monterey to San Diego.', '2015-03-27T14:13:47.563');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4236, 5977, 'dsg-depth-distribution', 'self', '494 - 1205 m', '2015-03-27T14:13:53.317');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4238, 372, 'dsg-description', 'self', 'Compare with Heterozonias alternatus and Athenactis fisheri. Solaster does not have an osculum in the center of the disc, and spines are primarily located along the perimeter.', '2015-01-21T11:09:52.650');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4239, 372, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2015-03-27T14:05:05.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4240, 5966, 'dsg-description', 'self', 'Compare with Solaster and Heterozonias alternatus. Note the osculum at the center of the disc, and the complete coverage of spines vs. just around the perimeter in Solaster.', '2015-01-21T11:14:11.030');
