INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4264, 2828, 'dsg-range', 'self', 'Aleutian Islands to Puerto Santo Tomas.', '2015-03-29T12:17:25.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4265, 2828, 'dsg-depth-distribution', 'self', 'Consistently 0 - 120 m with reports of a few deeper (to 435 m).', '2015-03-29T12:17:34.910');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4267, 2831, 'dsg-range', 'self', 'Southern Alaska to San Diego.', '2015-03-29T14:08:33.657');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4268, 2831, 'dsg-depth-distribution', 'self', '60 - 1000 m', '2015-03-29T14:08:38.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4269, 2831, 'dsg-description', 'self', 'Compare with Pycnopodia helianthoides and shallower depths. There is some potential that they are the same species, however this is still unclear. 12-20 arms, disc may be relatively smaller than in P. helianthoides. These seastars develop "galls" in their arms, which are indicative of the presence of an endoparasitic eulimid gastropod (Asterophila rathbunasteri). Readily lose their arms. ', '2018-11-14T12:44:45.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4270, 2828, 'dsg-description', 'self', 'Compare with Rathbunaster californicus. Purple, reddish-orange, yellow, or brown with 15 -24 arms. Arm to disc ratio = 2.5 to 3.5.', '2015-01-21T13:19:32.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4272, 2828, 'dsg-size', 'self', 'Arms to 40 cm long.', '2015-08-07T14:15:57.023');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4273, 2831, 'dsg-reference', 'self', 'Lauerman, L.M.L. (1998). Diet and Feeding Behavior of the Deep-Water Sea Star Rathbunaster Californicus (Fisher) in the Monterey Submarine Canyon. Bulletin of Marine Science, 63: 523-530.', '2018-07-11T09:13:04.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4275, 5979, 'dsg-description', 'self', 'Tentative ID and under review. Potentially Paraliparis.', '2018-11-19T08:50:00.430');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4277, 5979, 'dsg-habitat', 'self', 'Demersal.', '2015-04-02T16:48:00.550');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4278, 5979, 'dsg-size', 'self', 'To at least 29 cm.', '2015-08-08T19:35:02.803');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4279, 3001, 'dsg-consulting-taxonomist', 'self', 'Stephanie Bush.', '2015-05-06T10:33:08.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4280, 3001, 'dsg-range', 'self', 'For O.californiana: Japan, Sea of Okhotsk, Bering Sea, Eureka Bar (CA), Southern California.', '2015-03-27T10:57:17.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4281, 3001, 'dsg-depth-distribution', 'self', 'For O.californiana: 124 - 823 m (shallower at the northern end of the geographic range).', '2015-03-27T10:57:32.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4285, 5981, 'dsg-consulting-taxonomist', 'self', 'Stephanie Bush.', '2015-04-07T07:33:19.997');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4286, 5981, 'dsg-range', 'self', 'For G. bathynectes: Currently known only from the Tufts and Cascadia Abyssal Plains off Oregon.', '2015-03-27T11:29:43.400');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4287, 5981, 'dsg-depth-distribution', 'self', 'For G. bathynectes: 2816 - 3932 m.', '2015-03-27T11:29:53.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4289, 5982, 'dsg-depth-distribution', 'self', '3585 - 3900 m', '2015-04-07T07:34:27.127');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4290, 5982, 'dsg-range', 'self', 'Thus far only known only from the Tufts Abyssal Plain off Oregon.', '2015-04-07T07:34:33.877');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4291, 5982, 'dsg-consulting-taxonomist', 'self', 'Stephanie Bush.', '2015-04-07T07:34:39.967');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4294, 5981, 'dsg-habitat', 'self', 'Benthic, demersal.', '2015-03-27T11:30:02.810');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4295, 5982, 'dsg-habitat', 'self', 'Benthic, demersal.', '2015-03-27T11:06:51.963');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4296, 5980, 'dsg-habitat', 'self', 'Benthic, demersal.', '2015-03-27T10:23:59.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4298, 203, 'dsg-description', 'self', 'White body with red arms and fin tips. No long cirri along sucker row (compare with Cirrotheuthids).', '2015-03-27T11:28:42.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4300, 5984, 'dsg-description', 'self', 'Very large animal. Lower ~25% of the arms appear to extend below the bottom of the web. Red to orange coloration with a diffuse white band in the upper region near/under the eye. Eye does not look particulary small or degenerate on specimens observed in video (compare with C. murrayi). Large barrel-shaped suckers (vs stalked suckers as in C. magna). Skin and underlying body tissue appears soft, exhibiting curtain-like wrinkles.', '2015-02-03T09:44:17.370');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4301, 5985, 'dsg-description', 'self', 'Very short arms, orangish-red coloration with speckling. A diffuse white band well below the eye. Note the distinctive blue eyes.', '2021-10-27T15:48:39.830');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4302, 5986, 'dsg-description', 'self', 'Red. Note the very small eyes. Frequently observed resting on the seafloor.', '2015-03-27T11:07:21.913');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4303, 5984, 'dsg-habitat', 'self', 'Demersal.', '2015-04-07T07:32:12.097');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4304, 5985, 'dsg-habitat', 'self', 'Benthic, demersal.', '2015-03-27T11:09:33.653');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4305, 5986, 'dsg-habitat', 'self', 'Benthic, demersal.', '2015-03-27T11:07:29.943');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4306, 5980, 'dsg-description', 'self', 'Small, relatively flat compared to the various elongate Grimpotheuthis species. Peach-colored, small fins used for steering (vs. robust swimming). White spots, if present, may not be observable on video.', '2015-03-27T10:24:19.470');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4307, 3001, 'dsg-description', 'self', 'Orangish-red to purple-red with white-blue spots in rows (areolae; not previsously reported for this species). Blue eyes.', '2015-02-02T11:37:35.977');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4309, 5990, 'dsg-molecular-data-consultant', 'self', 'Stephanie Bush.', '2015-04-07T07:31:10.013');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4311, 5990, 'dsg-size', 'self', 'Up to 1.5 m in length.', '2015-03-27T11:36:15.703');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4312, 5990, 'dsg-description', 'self', 'Arms with long cirri; do not extend beyond the bottom of the web. Arm tips do not have suckers or cirri present. Red-orange coloration with a diffuse white band in the upper region near/under the eye. Large rounded fins, white near base. Skin and underlying body tissue appears soft, exhibiting curtain-like wrinkles.', '2015-03-27T11:37:23.073');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4313, 5990, 'dsg-range', 'self', 'North Atlantic, Arctic Ocean, North Pacific, New Zealand.', '2015-03-27T11:36:39.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4314, 5990, 'dsg-depth-distribution', 'self', '700 - 4854 m', '2015-03-27T11:36:29.953');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4315, 5990, 'dsg-habitat', 'self', 'Demersal.', '2015-03-27T11:36:24.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4316, 5702, 'dsg-habitat', 'self', 'Demersal.', '2015-03-27T11:34:31.463');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4317, 5702, 'dsg-range', 'self', 'Atlantic, Pacific, and Arctic oceans.', '2015-03-27T11:34:37.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4318, 5702, 'dsg-depth-distribution', 'self', '2430 - 4846 m', '2015-03-27T11:34:44.413');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4319, 5984, 'dsg-consulting-taxonomist', 'self', 'Stephanie Bush.', '2015-04-07T07:32:18.137');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4321, 5566, 'dsg-size', 'self', 'To at least 30 cm length.', '2020-10-28T13:52:37.957');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4324, 5993, 'dsg-description', 'self', 'Eyes on stalks.', '2015-04-14T14:18:30.370');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4325, 5761, 'dsg-description', 'self', 'Bent tail; pointed rostrum; yellow/gold eyes; red/orange body; narrow telson with cleft; antennular peduncle about two-thirds as long as antennal scale.', '2015-09-16T08:39:01.520');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4328, 5989, 'dsg-description', 'self', 'No pigment in eyes; no spine on rostrum; red/pink body; wide telson with cleft.', '2015-04-14T14:13:02.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4333, 5994, 'dsg-depth-distribution', 'self', 'Generally less than 1600 m.', '2015-03-29T14:12:11.613');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4334, 5994, 'dsg-description', 'self', 'Compare with Scotoplanes globosa. This species is ultra-white with body wall annualtions often clearly visible; annulations are less pronounced at deeper depths. Lateral papillae relatively short.', '2015-02-05T06:05:26.467');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4336, 5994, 'dsg-habitat', 'self', 'Benthic.', '2015-03-29T14:12:38.840');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4337, 161, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:26:12.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4338, 1952, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:26:30.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4339, 1953, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:26:45.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4340, 1954, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:28:18.590');
