INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4342, 1955, 'dsg-reference', 'self', 'Love, M.S., M. Yoklavich, and L. Thorsteinson (2002). The rockfishes of the northeast Pacific. University of California Press, Berkeley, CA. 404 pp.', '2018-07-11T10:28:59.667');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4344, 1928, 'dsg-description', 'self', 'May not be distinguishable when compared to S. rosenblatti (which are more abundant in C. CA).', '2015-02-25T07:38:21.790');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4345, 1778, 'dsg-description', 'self', 'Can be left-eyed or right eyed. Olive to brown with darker mottling; usually have two ocelli.', '2015-03-29T15:07:10.717');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4346, 1778, 'dsg-depth-distribution', 'self', '4 to 80 m', '2015-02-27T11:25:09.937');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4347, 1778, 'dsg-size', 'self', 'to 53 cm', '2015-02-27T11:25:45.057');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4348, 1778, 'dsg-range', 'self', 'Monterey Bay to Baja California and Gulf of California.', '2015-03-29T15:07:01.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4349, 1791, 'dsg-reference', 'self', 'Love, M.S. (2011). Certainly more than you want to know about the fishes of the Pacific coast. Really Big Press, Santa Barbara, CA. 649 pp.', '2018-07-09T10:15:39.730');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4350, 1791, 'dsg-size', 'self', 'to 40 cm', '2015-04-01T15:32:32.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4351, 1791, 'dsg-range', 'self', 'Bering Sea to southern Baja California.', '2015-03-29T14:52:45.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4352, 1791, 'dsg-depth-distribution', 'self', '9 - 1145 m, typical 90 - 350 m.', '2015-03-29T14:52:39.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4353, 1785, 'dsg-description', 'self', 'Look for left dorsal brown blotch and two white posterior spots (not always present). Caudal fin longest in the center (double truncated), oval to round, appearing diamond-shaped when fins are extended. Large jawline.', '2015-11-04T12:18:51.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4359, 6003, 'dsg-reference', 'self', 'Hendrycks, E.A. (2007). A new species of Valettiopsis Holmes, 1908 (Crustacea: Gammaridea: Lysianassoidea) from abyssal waters off California. Zootaxa, 1501: 45–56.', '2015-10-19T11:09:31.227');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4360, 6003, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-08-31T07:59:47.640');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4361, 1952, 'dsg-depth-distribution', 'self', '0 - 172 m', '2015-03-12T13:24:15.293');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4363, 767, 'dsg-description', 'self', 'Deep-bodied and more perch-shaped compared to S. melanostomus; saddle on side may form an H pattern. Likely to be perched on top of something.', '2015-03-16T08:03:13.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4364, 767, 'dsg-reference', 'self', 'Butler, J.L., M.S. Love, and T. Laidig (2012). A guide to the rockfishes, thornyheads, and scorpionfishes of the Northeast Pacific. University of California Press, Berkeley, CA. 185 pp.', '2015-04-02T10:00:40.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4366, 159, 'dsg-description', 'self', 'Cherry red, 1st dorsal spot very bright white.', '2015-04-20T13:10:35.857');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4367, 1926, 'dsg-description', 'self', 'Look for bright white anal spine, last two spots are bright white.', '2015-04-02T12:29:35.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4368, 1926, 'dsg-molecular-data-consultant', 'self', 'Donna Kline, Moss Landing Laboratories.', '2015-04-02T12:20:04.887');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4369, 1926, 'dsg-consulting-taxonomist', 'self', 'Donna Kline', '2015-03-12T16:12:51.823');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4370, 1807, 'dsg-description', 'self', 'Very small mouth, truncated caudal fin, narrow caudal peduncle.', '2015-03-29T14:55:03.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4389, 6005, 'dsg-consulting-taxonomist', 'self', 'Gary Williams, California Academy of Sciences.', '2015-03-27T15:10:39.700');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4390, 6005, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2015-03-27T15:12:54.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4393, 705, 'dsg-taxonomist-assessment', 'self', 'From specimen collected May 30, 2007.', '2015-03-29T12:12:11.747');
