INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4476, 134, 'dsg-description', 'self', 'Light to bright white with deeper-living specimens gray. Sloped snout. Very thin tapering tail which is usually reddish-brown, but all white specimens have been occasionally observed. In darker specimens, pre-opercular lower lobe is prominent (see image 3). The orbital ring is mostly black all the way around. Nostrils dark, relatively long chin barbel. Outer pelvic ray long, first dorsal ray often black.', '2016-08-18T14:11:33.747');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4477, 134, 'dsg-range', 'self', 'Gulf of Alaska to southern Baja California.', '2015-04-02T15:17:27.773');
