INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4907, 6231, 'dsg-description', 'self', 'Long antennular flagella not sharply angled; telson longer or as long as exopod/endopod; rostrum long with dorsal spines; pereopods 4 and 5 very long and thin; pigmented eyes.', '2015-09-16T08:44:20.913');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4908, 6231, 'dsg-habitat', 'self', 'Pelagic.', '2015-09-08T13:32:45.727');
