INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4912, 6233, 'dsg-description', 'self', 'Longer pair of antennular flagella sharply bent; shorter pair modified as clasping organ; organ of pesta present; third pereopod as long as body; telson shorter than uropods; exoskeleton mostly transparent with some pink/red speckling; eyes pigmented', '2015-09-08T13:44:24.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4917, 6234, 'dsg-habitat', 'self', 'Pelagic.', '2015-09-08T13:56:46.883');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4918, 6234, 'dsg-description', 'self', 'Longest pair of antennular flagella sharply bent; telson shorter than uropods; exoskelton from transparent with pink/red speckles (small individuals) to solid orange/red (larger individuals); large purple photophores on ventral surface of body; pigmented eyes.', '2015-09-16T08:40:20.707');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4920, 1215, 'dsg-habitat', 'self', 'Pelagic.', '2015-09-08T14:19:27.387');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4921, 1215, 'dsg-description', 'self', 'Shorter antennular flagella, not sharply bent; translucent body with scattered red chromatophores; pigmented eyes.', '2015-09-16T08:46:03.213');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (4925, 6235, 'dsg-depth-distribution', 'self', '500 - 4000 m', '2015-09-16T08:49:50.220');
