INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6594, 1407, 'dsg-description', 'self', 'Light to dark brown or gray with dark mottling around the disc perimeter and tail. Dark dorsal ocelli (eyespots) are prominent. Also white-spotted in some animals, while others may only have two white spots behind the ocelli. Long snout extends beyond indented pectoral fins; wide disc. Short tail often looks striped from a distance. Mature males have relatively long, wide, white-tipped claspers.', '2016-07-07T09:48:14.663');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6601, 117, 'dsg-reference', 'self', 'Polet, S., C. Berney, J. Fahrni, and J. Pawlowski (2004). Small-subunit ribosomal RNA gene sequences of Phaeodarea challenge the monophyly of Haeckel''s Radiolaria. Protist, 155: 53–63. doi:10.1078/1434461000164.', '2016-03-29T10:42:10.697');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6603, 491, 'dsg-reference', 'self', 'Dolganov, V.N. (1999). Geographical and bathymetric distribution of the skates of the Rajidae Family in the far eastern seas of Russia and adjacent waters. Journal of Ichthyology 39: 340-342.', '2018-03-22T09:55:11.980');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6605, 3734, 'dsg-verified-MBARI-geographic-range', 'self', 'Off Monterey', '2016-04-04T09:36:36.400');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6631, 6300, 'dsg-description', 'self', 'Species unknown. Possibly C. cinereus or C. acrolepis juvenile.', '2016-05-11T12:57:39.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6632, 5477, 'dsg-reference', 'self', 'Young R.E., Vecchione M. & Braid H.E. (2014). Mastigotragus, a new generic name for Mastigoteuthis pyrodes Young, 1972 (Cephalopoda: Mastigoteuthidae). European Journal of Taxonomy. 105: 1–6', '2016-06-15T13:00:35.390');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6633, 5979, 'dsg-consulting-taxonomist', 'self', 'David Stein, NOAA NMFS National Systematics Laboratory, National Museum of Natural History.', '2016-06-29T07:15:48.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6641, 1405, 'dsg-range', 'self', 'Eastern Bering Sea to central Baja California and the Gulf of California.', '2016-07-07T09:40:06.970');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6642, 1405, 'dsg-description', 'self', 'Very large brown to brownish-red skate, with darker mottling and white spots. Two large ocelli (eyespots) surrounded by rosettes of white spots. Snout extends far beyond indented pectoral fins. Dorsal fins separated by an interdorsal thorn. ', '2016-07-07T09:40:42.170');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6643, 1405, 'dsg-reference', 'self', 'Castro-Aguirre, J.L. and H. Espinosa Perez (1996). Listados faunísticos de México. VII. Catálogo sistemático de las rayas y especies afines de México. (Chondrichthyes: Elasmobranchii: Rajiformes: Batoideiomorpha). Universidad Nacional Autonoma de Mexico, Mexico. 75 pp.', '2016-07-07T09:45:04.150');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6645, 1407, 'dsg-reference', 'self', 'Castro-Aguirre, J.L. and H. Espinosa Perez (1996). Listados faunísticos de México. VII. Catálogo sistemático de las rayas y especies afines de México. (Chondrichthyes: Elasmobranchii: Rajiformes: Batoideiomorpha). Universidad Nacional Autonoma de Mexico, Mexico. 75 pp.', '2016-07-07T09:48:29.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6646, 1408, 'dsg-description', 'self', 'Brown to gray-brown with darker spots overall. Dorsal ocelli (eyespots) are common, with two white spots visible behind them. Pelvic fins deeply notched. Short tail often looks striped from a distance. May have an interdorsal thorn. ', '2016-07-07T09:50:42.837');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6649, 420, 'dsg-reference', 'self', 'Zorzi, G.D. and M.E. Anderson (1988). Records of the deep-sea skates, Raja (Amblyraja) badia Garman, 1899 and Bathyraja abyssicola (Gilbert, 1986) in the eastern North Pacific, with a new key to California skates. California Fish and Game 74: 87–105. ', '2018-03-22T08:17:22.820');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6653, 1405, 'dsg-reference', 'self', 'Eschmeyer, W.N., E.S. Herald, and H. Hammann (1983). A field guide to Pacific coast fishes of North America. Houghton Mifflin Company, Boston, MA. 336 pp.', '2018-03-22T10:57:12.830');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6658, 881, 'dsg-habitat', 'self', 'Pelagic.', '2016-07-26T14:12:52.823');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6660, 5769, 'dsg-description', 'self', 'Tadpole-like body. Secretes a pair of filters, including a rippled internal filter and a more diffuse outer filter that may be up to 1 meter across. Note the large chambers.', '2020-12-22T18:05:51.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6663, 2739, 'dsg-description', 'self', 'Color variations include purple, tan/yellow, white.', '2016-08-08T10:52:30.200');
