INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6721, 40005432, 'dsg-description', 'self', 'Similar to A. sp. 3, but larger and more amorphus in shape (body and osculum shape). Potentially the same species.', '2017-03-24T10:15:40.507');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6722, 6324, 'dsg-description', 'self', 'Similar to A. sp. 2, but smaller and a more uniform shape (body and osculum shape). Potentially the same species.', '2017-03-24T10:16:07.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6723, 6328, 'dsg-description', 'self', 'Entirely purple. Compare to Yoda sp. A. New species; description in prep (Holland, Kuhnz, Osborn). Purple, narrow-lipped, very large.', '2016-09-12T09:46:12.900');
