INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6787, 6355, 'dsg-reference', 'self', 'Pugh, P.R. and S.H. Haddock (2016). A description of two new species of the genus Erenna (Siphonophora, Physonectae, Erennidae), with notes on recently collected specimens of other Erenna species. Zootaxa, 4189: zootaxa 4189 4183 4181. http://dx.doi.org/10.11646/zootaxa.4189.3.1', '2017-10-23T08:44:28.060');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6788, 6355, 'dsg-description', 'self', 'Tentilla covered by a red-fluorescent layer. First record of an invertebrate producing red bioluminescence (produced by fluorescence of blue-green bioluminescence). Main part of the tentacle, with its tentilla, can be extended away from the siphosomal stem on a long peduncle. Twitches tentilla to mimic the movement of copepods to attract midwater fishes. Each tentilla may contain more than 3,000 powerful nematocysts. Bracts have dots at the end of them (concentrated nematocysts). Eggs are very large and visible, as are the clusters of male gonophores.', '2018-09-26T16:09:53.797');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6789, 672, 'dsg-description', 'self', 'Main part of the tentacle, with its tentilla, can be extended way from the siphosomal stem on a long peduncle. Lures wriggle in an uncoordinated manner. Bracts have dots at the end of them (concentrated nematocysts). Slightly deeper and more abundant in GoC.', '2018-09-26T16:09:09.107');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6792, 6359, 'dsg-description', 'self', 'Distiguishing feature is the blue outline visible around the periphery of the tail.', '2016-12-16T14:37:32.040');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6794, 6359, 'dsg-depth-distribution', 'self', 'Max depth of non-gravid individual is 189 m. Majority of individuals found between 90-120 m.', '2016-12-16T14:40:10.237');
