INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6823, 6201, 'dsg-taxonomist-assessment', 'self', 'Identitification by John McCosker best possible from video only', '2017-01-12T15:27:37.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6828, 6376, 'dsg-description', 'self', 'Tentative ID. Ends of tentacles may appear knobbed.', '2017-02-02T11:09:38.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6829, 859, 'dsg-description', 'self', 'Name change to Buskiella is considered invalid.', '2017-02-06T09:39:40.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6830, 859, 'dsg-consulting-taxonomist', 'self', 'Karen Osborn, Smithsonian Natural History Museum.', '2017-02-06T09:39:56.017');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6832, 6378, 'dsg-description', 'self', 'The conical bell is equally high as wide, up to 2.5 cm. Stomach suspended below the bell margin. Four V-shaped radial canals. A pair of long tentacles are attached on opposite sides of the bell, and about 80 small tentacles line the margin. ', '2017-02-22T14:47:55.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6834, 6383, 'dsg-habitat', 'self', 'Benthic.', '2017-03-15T13:50:28.580');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6837, 6382, 'dsg-habitat', 'self', 'Benthic.', '2017-03-15T13:51:35.510');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6839, 849, 'dsg-description', 'self', 'Dark yellow to cream-colored. Large internal pores, leading to "drooping" external nodules with visible holes (1-3 in them). Some specimens have basal rhizome-like prolongations. ', '2017-03-24T10:43:17.717');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6841, 6386, 'dsg-habitat', 'self', 'Benthic.', '2017-03-23T10:12:32.863');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6842, 6386, 'dsg-description', 'self', 'Pale yellow, elongate in form. Identification is unconfirmed.', '2017-05-01T14:01:09.783');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6843, 3826, 'dsg-habitat', 'self', 'Benthic.', '2017-03-24T10:19:41.977');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6844, 40005431, 'dsg-habitat', 'self', 'Benthic.', '2017-03-24T10:19:52.810');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6845, 40005431, 'dsg-description', 'self', 'Long external spicules appear to collect hydroids and debris. The spicules on this species are matted. Compare to A. sp. 4. Both species look similar from a distance (use A. sp. 1-4 complex).', '2018-12-05T07:53:24.820');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6846, 40005432, 'dsg-habitat', 'self', 'Benthic.', '2017-03-24T10:34:51.480');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6847, 6324, 'dsg-habitat', 'self', 'Benthic.', '2017-03-24T10:35:02.817');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6848, 6382, 'dsg-description', 'self', 'White or cream-colored, elongated and tapering in size from the base to the osculum. Potentially related to Staurocalyptus based on morphological characters (lipped-opening, external nodules, interior pore size). Compare with Heterochone calyx which has large internal pores, leading to "drooping" external nodules with visible holes (1-3 in them).', '2017-03-24T10:41:44.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6849, 857, 'dsg-description', 'self', 'Striking yellow in color, lipped-opening, external nodules, variable, relatively small interior pore size.', '2017-03-24T10:39:55.743');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6851, 6390, 'dsg-habitat', 'self', 'Benthic.', '2017-03-24T14:48:37.953');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (6852, 6390, 'dsg-description', 'self', 'Yellow, long external spicules.', '2017-03-24T14:49:03.473');
