INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7055, 6396, 'dsg-habitat', 'self', 'Benthic.', '2017-04-19T10:43:37.243');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7056, 6383, 'dsg-description', 'self', 'Primarily yellow, but white forms could potentially be the same.', '2017-04-20T08:34:30.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7064, 3722, 'dsg-description', 'self', 'Compare with Antimora microlepis. Distinct silvery color, very long chin barbel, rounded pectoral fins, long first dorsal fin spine, blunt snout with terminal mouth. These are tentative ID''s; the anal fin is not notably indented, rather it is just the opposite (E. Burton, personal communication 2017). Possibly Laemonema or Physiculus rastrelliger.', '2017-06-06T10:37:18.010');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7066, 793, 'dsg-description', 'self', 'Animal is white. Tubes with live animals are typically curved or u-shaped.', '2017-05-22T10:58:00.390');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7068, 6398, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2017-05-23T15:59:32.253');
