INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7094, 6410, 'dsg-range', 'self', 'South central Pacific (SW of Marquesas Islands) and eastern Pacific along the California margin (San Juan and San Marcos Seamounts). Possibly specimens observed on Davidson Seamount (2,422 – 2,491 m), Gorda Ridge (3,130 m), East Pacific Rise, (2,646 m).', '2017-08-01T11:57:23.040');
