INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7156, 6423, 'dsg-description', 'self', 'Gold-colored polyps.', '2017-08-14T14:38:43.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7158, 6424, 'dsg-habitat', 'self', 'Benthic.', '2017-08-23T13:41:10.813');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7160, 6424, 'dsg-description', 'self', 'Tan-yellow periostracum, no shouldering between sutures, fine spiral striae. Not consistent with Retimohnia sp. A, nor Aulacofusus/Colus trophius (for which the taxonomy is currently in flux). Egg cases small, rounded, leaf-like attachment.', '2017-08-23T14:19:16.457');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7165, 6426, 'dsg-habitat', 'self', 'Benthic. Tend to be attached to the seafloor or low rocks (vs. perched on high objects).', '2017-08-25T10:00:54.010');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7166, 6426, 'dsg-description', 'self', 'Brown, grading to white tips (vs. reddish-brown), with long pinnules on the arms which make them look relatively thick.', '2017-08-25T09:23:08.400');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7168, 6424, 'dsg-reference', 'self', 'Kosyan, A.R. and Y.I. Kantor (2013). Revision of the genus Aulacofusus Dall, 1918 (Gastropoda: Buccinidae). Ruthenica 23:1–33. ', '2017-08-25T09:36:57.180');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7170, 6427, 'dsg-habitat', 'self', 'Benthic.', '2017-08-28T15:44:37.370');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7171, 3031, 'dsg-description', 'self', 'Normally dark pink (in our range) with white gills along the edge when near Paragorgia, possibly Funiculina, and other deeply-colored prey. Lighter color when feeding elsewhere.', '2017-08-30T09:10:13.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7172, 6432, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-08-31T07:39:45.143');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7173, 6432, 'dsg-description', 'self', 'Commonly observed in video as large mats of amphipod tubes, which can extend for kilometers.', '2017-08-31T07:59:25.967');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7175, 3270, 'dsg-description', 'self', '', '2017-09-11T15:36:32.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7176, 3268, 'dsg-description', 'self', 'SIlver with crimson fins, large eye, sloping mouth. Long dorsal, highest in front, no anal fin. Caudal fin points up and is relatively small in adults while large in young. Pelvic fin is also long in young, but virtually absent in adults. Young have 3-5 dark spothches along the side.', '2017-09-11T15:37:22.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7177, 3268, 'dsg-size', 'self', 'to 183 cm.', '2017-09-11T15:39:11.390');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7178, 3268, 'dsg-range', 'self', 'Alaska to Chile.', '2017-09-11T15:39:55.657');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7179, 3268, 'dsg-depth-distribution', 'self', 'to at least 500 m.', '2017-09-11T15:40:32.207');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7182, 3266, 'dsg-description', 'self', 'Dorsal fin extends head to tail, extemely elongate with tiny caudal fin. Unspotted (compare to juvenile D. polysticta), silvery with crimson fins. Young have a fan-like tail that disappears with growth and may have round dark spots.', '2017-09-18T08:26:45.097');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7183, 3266, 'dsg-size', 'self', 'to 114 cm.', '2017-09-12T08:34:26.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7184, 3266, 'dsg-depth-distribution', 'self', '0-500 m', '2017-09-12T08:36:29.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7185, 3266, 'dsg-range', 'self', 'Eastern Central Pacific: off central California, USA to southern Baja California, Mexico.', '2017-09-12T08:36:15.023');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7186, 3266, 'dsg-reference', 'self', 'MBNMS unpublished checklist September 2017: Museum Specimen: SIO 74-14 (Within “Davidson Seamount Management Zone”; identifier unknown, CalCOFI).', '2017-09-18T08:12:58.653');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7187, 5708, 'dsg-description', 'self', 'May fish down near the bottom by sculling along on their backs and using their very long fishing poles to work the bottom.', '2017-09-12T11:11:33.950');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7188, 2520, 'dsg-description', 'self', 'Bell small and transparent from a distance, very long tentacles.', '2017-09-13T11:04:16.933');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7189, 3266, 'dsg-reference', 'self', 'Eschmeyer, W.N., E.S. Herald, and H. Hammann (1983). A field guide to Pacific coast fishes of North America. Houghton Mifflin Company, Boston, MA. 336 pp.', '2018-06-13T10:25:51.557');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7190, 3268, 'dsg-reference', 'self', 'Eschmeyer, W.N., E.S. Herald, and H. Hammann (1983). A field guide to Pacific coast fishes of North America. Houghton Mifflin Company, Boston, MA. 336 pp.', '2018-07-12T09:40:26.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7191, 3266, 'dsg-habitat', 'self', 'Epipelagic to mesopelagic.', '2017-09-18T08:16:10.413');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7193, 6439, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-09-18T09:51:36.483');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7195, 6443, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-09-18T15:59:04.390');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7197, 6444, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-09-18T15:59:27.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7198, 6444, 'dsg-reference', 'self', 'Cadien, D.B. and L. Lovell, eds. A taxonomic listing of macro- and megainvertebrates, Edition 12 (2018). Southern California Association of Marine Invertebrate Taxonomists (SCAMIT). 167 pp.', '2018-11-13T11:11:49.553');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7199, 6445, 'dsg-habitat', 'self', 'Benthic, infaunal.', '2017-09-18T16:03:22.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7201, 6445, 'dsg-reference', 'self', 'There is no evidence to support the change back to Prochaetoderma as reported in WoRMS.', '2017-09-20T08:54:50.730');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7202, 6446, 'dsg-habitat', 'self', 'Benthic.', '2017-09-20T19:29:57.810');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7204, 6447, 'dsg-habitat', 'self', 'Benthic, hard substrate. Usually associate with gorgonians or antipatharians, rarely on deep hard corals as we have seen.', '2017-09-21T08:30:07.657');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7205, 6447, 'dsg-consulting-taxonomist', 'self', 'Mary Wicksten, Professor, Texas A&M University, College Station, Texas.', '2017-09-21T08:27:08.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7206, 6447, 'dsg-description', 'self', 'Note the widely-spread chelae, a common feature of members of this family. Relatively thicker arms and heavy spination on body compared to G. perarmatus. Coloration may be lighter in smaller specimens.', '2017-09-22T07:27:39.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7207, 6075, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2017-09-21T08:31:36.513');
