INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (7212, 6452, 'dsg-habitat', 'self', 'Benthic. Parasitic/commensal with Culeolus tunicates. ', '2017-09-27T11:02:27.393');
