INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8341, 6612, 'dsg-description', 'self', 'Long external spicules appear to collect hydroids and debris. The spicules on this species are straight and project outward (vs. matted). Compare to A. sp. 4. Both species look similar from a distance (use A. sp. 1-4 complex).', '2018-12-05T07:54:24.683');
