INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8347, 6615, 'dsg-description', 'self', 'Body elongate, narrow. Notum outline with four invaginations; edge has a ruffled appearance. Dorsum covered with numerous, densely packed elongate tubercles or projections, oriented in different directions, forming a zigzagging pattern in some areas. Velum wide, forming two triangular lateral projections, with several frontal irregular indentations. Rhinophores short and wide, with 9 simple lamellae, located on anterior end of notum. Rhinophoral sheaths elongate, with 12 branched papillae around distal edges. Foot smooth, rounded posteriorly, visible dorsally at posterior end and in notum invaginations. Background color of notum black. Dorsal tubercles primarily white to greyish-brown near posterior notum, giving the body a light appearance, becoming darker towards head, turning completely black on anterior notum; this gives a black and white appearance with a greyish transitional area mid-length, forming a wedge of black pigment. Notum edge primarily white, except for anterior-most end that becomes dark grey. Velum completely black. Rhinophoral sheaths black with grey edges. Rhinophores with black stalks and beige sheath papillae and clubs. Foot dark grey, surrounded by a thin white line.', '2018-12-11T11:42:39.280');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8348, 6615, 'dsg-size', 'self', '82 mm (preserved)', '2018-12-11T11:43:39.033');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8351, 6618, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2018-12-11T12:26:13.860');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8352, 6618, 'dsg-range', 'self', 'Gulf of California.', '2020-09-28T13:20:04.640');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8353, 6618, 'dsg-depth-distribution', 'self', '~2369 m', '2018-12-11T12:27:47.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8354, 6618, 'dsg-size', 'self', '18 mm (preserved)', '2018-12-11T12:28:11.023');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8355, 6618, 'dsg-description', 'self', 'Body long, narrow, with 4-6 pairs of simple, elongate, dorso-lateral cerata. Velum composed of 4 narrow and elongate papillae. Rhinophores with very elongate stalks. Rhinophoral sheaths with 4 elongate, simple papillae on distal edges, the innermost papilla being much larger than the other three. Rhinophoral clubs elongate, with 11 simple lamellae. Color uniformly translucent white with some internal organs visible through the body wall as beige or yellowish areas.', '2018-12-11T12:28:51.870');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8358, 6620, 'dsg-depth-distribution', 'self', '~382 m', '2018-12-11T12:33:09.747');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8359, 6620, 'dsg-range', 'self', 'Monterey Canyon.', '2020-09-28T13:20:25.333');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8360, 6620, 'dsg-description', 'self', 'Body elongate, wide, with numerous elongate, dorso-lateral cerata. Cerata arranged in densely packed rows, running from behind oral tentacles to posterior end of body. Cerata increase in size in each row, lateral cerata typically shorter, dorsal cerata longer. Oral tentacles tentacular, narrow, elongate. Rhinophores elongate (Figs. 2F), with low irregular swellings. Body color brown-ochre, covered with densely arranged yellowish spots. Rhinophores and oral tentacles same color as body but two distal thirds yellowish-white. Cerata also with same color as body with digestive gland branches partially visible, particularly in smaller cerata, giving them a reddish tinge; cnidosacs white.', '2018-12-11T12:35:07.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8361, 6620, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2018-12-11T12:35:33.770');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8363, 6624, 'dsg-depth-distribution', 'self', '595 - 1018 m', '2018-12-11T12:42:11.440');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8364, 6624, 'dsg-habitat', 'self', 'Benthic, soft sediment.', '2018-12-11T12:42:30.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8365, 6624, 'dsg-size', 'self', '20 - 24 mm', '2018-12-11T12:43:04.973');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8366, 6624, 'dsg-range', 'self', 'Monterey Canyon.', '2020-09-28T13:20:44.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8367, 6624, 'dsg-description', 'self', 'Body elongate, narrow, with numerous elongate, thin, dorso-lateral cerata. Cerata arranged in densely packed rows, running from behind oral tentacles to posterior end of body. Cerata increase in size in each row, lateral cerata typically shorter, dorsal cerata longer. Oral tentacles short and wide, nearly conical in live animal. Foot corners tentacular, short, wide, almost spherical. Rhinophores elongate, smooth. Body color cream to reddish-orange, semi translucent, with viscera visible through skin as a yellowish mass. Oral tentacles the same color as body, rhinophores redder and darker. Cerata translucent pale orange, with red digestive branches and white cnidosacs.', '2018-12-11T12:44:44.103');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8368, 6620, 'dsg-size', 'self', '23 mm (preserved)', '2018-12-11T12:47:37.380');
