INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8372, 176, 'dsg-description', 'self', 'Pink polyps, note that branching begins near the base. Compare to Isidella tentaculum. ', '2019-01-02T09:16:11.160');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8376, 6626, 'dsg-habitat', 'self', 'Benthic, parasitic/commensal on crab mouthparts.', '2019-03-06T18:07:08.837');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8378, 6626, 'dsg-reference', 'self', 'Martin J.W. and G. Pettit G. (1998). Caprella bathytatos New Species (Crustacea, Amphipoda, Capresslidae), from the Mouthparts of the Crab Macroregonia macrochira Sakai (Brachyura, Majidae) in the Vicinity of Deep-sea Hydrothermal vents off British Columbia. Bulletin of Marine Science, 63: 189-198.', '2019-01-23T08:29:05.017');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8379, 6626, 'dsg-description', 'self', 'Found on the mouthparts of Paralomis multispina in Monterey Canyon.', '2019-01-23T08:29:28.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8380, 5691, 'dsg-description', 'self', 'Legs on the abdomen are located at right angles laterally.', '2019-01-23T10:28:14.447');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8381, 6630, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2019-01-23T10:58:19.040');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8382, 6630, 'dsg-description', 'self', 'Can''t ID to species unless you have a lateral view of the rostrum. Notice the abdomen bent up at an angle--definitely a feature of a caridean in the family Thoridae (Per Mary Wicksten).', '2019-01-23T11:05:22.577');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8383, 6630, 'dsg-consulting-taxonomist', 'self', 'Mary Wicksten, Professor, Texas A&M University, College Station, Texas.', '2019-01-23T11:05:36.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8384, 1419, 'dsg-reproduction', 'self', 'Eggcases: 70-110 mm in length. Golden-yellow when <1 mo old, after 1 mo egg cases oxidize and become black. Long tendrils on both anterior and posterior ends, thick flanges on both anterior and posterior keel, flanges along the lateral edges resembles a “T” in cross-section. Degrading egg cases will sometimes be covered in a white bacterial mat.', '2019-01-23T13:13:13.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8385, 1419, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories.', '2019-01-23T13:13:36.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8386, 1419, 'dsg-consulting-taxonomist', 'self', 'Amber Reichert, Masters candidate, Moss Landing Marine Laboratories.', '2019-02-06T07:42:26.840');
