INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8389, 1416, 'dsg-consulting-taxonomist', 'self', 'David Ebert, Moss Landing Marine Laboratories.', '2019-01-23T13:16:54.647');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8390, 1416, 'dsg-consulting-taxonomist', 'self', 'Amber Reichert, Masters candidate, Moss Landing Marine Laboratories.', '2019-02-06T07:42:53.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8391, 1417, 'dsg-reproduction', 'self', 'As of Jan. 2019, no eggcases from this shark have been identified in MBARI video. Eggcases are approximately 61–69 mm in length, have no tendrils and are golden-yellow when <1 month old, after 1 month egg cases oxidize and become dark brown/black.', '2019-01-23T13:19:09.343');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8392, 1416, 'dsg-reproduction', 'self', 'Eggcases: approximately 52–72 mm in length, shape is vase-like, with a smooth surface, long tendrils on both anterior and posterior ends. Golden-yellow when <1mo old, then egg cases oxidize and become dark brown/black.', '2019-01-23T13:31:38.250');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8394, 6632, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2019-01-24T08:59:43.043');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8395, 6632, 'dsg-consulting-taxonomist', 'self', 'Mary Wicksten, Professor, Texas A&M University, College Station, Texas.', '2019-01-24T08:59:55.857');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8396, 288, 'dsg-description', 'self', 'These are tentative ID''s and could be deep penaoids. Also note that with the advent of enhanced video over time, there are probably two similar-looking species present in areas where this species is annotated.', '2021-04-04T18:11:02.657');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8397, 1219, 'dsg-description', 'self', 'This is likely P. pacificus.', '2019-01-24T12:01:31.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8398, 1219, 'dsg-habitat', 'self', 'Adult benthic, juvenile pelagic.', '2019-01-24T12:02:25.147');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8399, 1164, 'dsg-description', 'self', 'Look similar to squat lobsters, but they are brachyurans.These have modified hind legs to grip camouflaging material and carry it over the body.', '2019-01-24T12:32:15.773');
