INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8420, 6638, 'dsg-description', 'self', 'Large, heavy-bodied, well-developed fins. Adults are white with wrinkled skin, juvelines are pink and smooth-skinned; lethargic movement.', '2019-01-30T14:51:19.630');
