INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8459, 6645, 'dsg-description', 'self', 'Very delicate. Siphosome is very long in comparison to the nectosome. All known specimens come from Midwater 1 site in Monterey Bay. However, the name refers to another species found in the northwestern Mediterranean Sea that is likely the same species.', '2019-02-05T17:06:22.027');
