INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8627, 2186, 'dsg-description', 'self', 'Distinguished by transparent, cowl-like dome shielding a pair of large, tubular eyes. The anterior of the transparent head is punctuated with two olfactory capsules just above a small mouth. Body dark brown in color and covered by large scales. Distinctively large, dark brown pelvic fins.', '2020-10-26T11:19:59.460');
