INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8649, 193, 'dsg-description', 'self', 'Body slightly compressed in tentacular axis. Viewed from the aboral end, the body has 16 slight ridges, with a broad and prominent row of comb plates occurring on every other ridge. The body consistency is extremely firm. Auricles are short, wide and fleshy, but aren''t very mobile. The pair of oral lobes are fleshy, but appear to be more delicate in larger specimens. Oral lobes are only slightly longer than the body. ', '2020-10-28T11:31:17.967');
