INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8674, 2760, 'dsg-description', 'self', 'Distinguished by its extremely thin test. The test is strongly depressed and flattened on the ventral surface. Spines are 10 to 20 mm long and light in color. Test color is reddish claret, though younger speciemans are orange-red in color.', '2020-10-28T15:01:49.463');
