INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8677, 2760, 'dsg-size', 'self', 'To 94 mm diameter and 44 mm height.', '2020-10-28T15:12:48.503');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8678, 2760, 'dsg-color', 'self', 'Orange-red to red.', '2020-10-28T15:13:13.153');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8679, 2760, 'dsg-key-visual-features', 'self', 'For Monterey Bay, pink.', '2020-10-28T15:14:01.013');
