INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8682, 2760, 'dsg-other-resources', 'self', 'National General Status Working Group (2020). Standardized Common Names for Wild Species in Canada. www.wildspecies.ca. (Accessed 10/10/20)', '2020-12-23T13:04:09.507');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8683, 2888, 'dsg-description', 'self', 'Five rays extend from the central disc and branch dichotomously. Central disc bears 10 prominent spoke-like plates. The finely bifurcated rays are covered in small hooks and are often held like a basket oriented into the currents. Central disc is brown in color while the rays may be tan, beige, orange-red, pink or even white.', '2020-10-28T15:16:25.947');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8684, 2888, 'dsg-size', 'self', 'To 14 cm central disc diameter, to at least 60 cm total diameter.', '2020-10-28T15:16:47.140');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8685, 2888, 'dsg-color', 'self', 'Brown, tan, beige, orange-red, pink or even white.', '2020-10-28T15:17:07.283');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8686, 2888, 'dsg-reproduction', 'self', 'Spawns annually, from June to November.', '2020-10-28T15:17:31.670');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8687, 2888, 'dsg-diet', 'self', 'Small benthic crustaceans, zooplankton (including chaetognaths, fish larvae and jellies).', '2020-10-28T15:17:53.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8688, 2888, 'dsg-range', 'self', 'North Pacific Ocean, from Bering Sea to Mexico and Japan, and North Atlantic Ocean.', '2020-10-28T15:18:16.730');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8689, 2888, 'dsg-habitat', 'self', 'Benthic, rocky substrate and soft sediments with boulders or organic substrate.', '2020-10-28T15:18:41.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8690, 2888, 'dsg-depth-distribution', 'self', '10 - 2000 m', '2020-10-28T15:19:46.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8691, 2760, 'dsg-depth-distribution', 'self', '227 - 620 m', '2020-10-28T15:20:13.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8692, 2888, 'dsg-looks-like', 'self', 'Asteronyx.', '2020-12-23T13:02:58.117');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8693, 2888, 'dsg-key-visual-features', 'self', 'Finely branched rays extending from central disc.', '2020-10-28T15:21:10.917');
