INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8698, 5769, 'dsg-size', 'self', 'Greater than 50 mm total length.', '2020-12-22T18:10:09.003');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8699, 5769, 'dsg-range', 'self', 'Worldwide. In northeast Pacific Ocean, known from Oregon and Central California.', '2020-12-22T18:16:53.307');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8700, 5769, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-22T18:17:29.683');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8702, 5769, 'dsg-looks-like', 'self', 'Bathochordaeus stygius.', '2020-12-23T13:03:28.383');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8703, 5769, 'dsg-key-visual-features', 'self', 'Body is larger in size relative to the internal filter compared to B. stygius. Inner mucous filter has fewer chambers than thsoe secreted by B. stygius.', '2020-12-22T18:23:23.327');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8704, 5769, 'dsg-reference', 'self', 'Sherlock, R.E., K.R. Walz, and B.H. Robison (2016). The first definitive record of the giant larvacean, Bathochordaeus charon, since its original description in 1900 and a range extension to the northeast Pacific Ocean. Marine Biodiversity Records, 9: 79. https://doi.org/10.1186/s41200-016-0075-9.', '2020-12-22T18:26:40.133');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8705, 1090, 'dsg-description', 'self', 'Tube-dwelling polychaete worm with four pairs of red-orange lamellate branchia. Functional gut, with retracile buccal tentacles. Tubes are parchment-like and covered with metallic sulfur.', '2020-12-22T18:42:22.373');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8706, 1090, 'dsg-size', 'self', '15 cm total length, with tubes to 2 cm in diameter.', '2020-12-22T18:42:58.987');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8707, 1090, 'dsg-reproduction', 'self', 'Gonochoric. Engages in pseucopulatory behavior with males directly transferring sperm to females'' spermathecae instead of broadcast dispersion of gametes. Larval development likely lecithotrophic or benthic.', '2020-12-22T18:43:43.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8708, 1090, 'dsg-diet', 'self', 'Bacteria, both free-living and filamented epibiotic bacteria growing on its body.', '2020-12-22T18:49:07.257');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8709, 1090, 'dsg-habitat', 'self', 'Benthic, hydrothermal vents.', '2020-12-22T18:49:42.307');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8710, 1090, 'dsg-reference', 'self', 'Desbruyères, D., M. Segonzac, and M. Bright, ed. (2006). Handbook of Deep-Sea Hydrothermal Vent Fauna. 2nd edition. Linz: Denisia, 18, 544 pp.', '2020-12-22T18:55:02.197');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8711, 1090, 'dsg-reference', 'self', 'Desbruyères, D., P. Chevaldonné, A.-M. Alayse, D. Jollivet, F.H. Lallier, C. Jouin-Toulmond, F. Zal, P.-M. Sarradin, R. Cosson, J.-C. Caprais, C. Arndt, J. O''Brien, J. Guezennec, S. Hourdez, R. Riso, F. Gaill, L. Laubier, and A. Toulmond (1998). Biology and ecology of the “Pompeii worm” (Alvinella pompejana Desbruyères and Laubier), a normal dweller of an extreme deep-sea environment: A synthesis of current knowledge and recent developments. Deep-Sea Research II, 45(1-3): 383-422. https://doi.org/10.1016/S0967-0645(97)00083-0', '2020-12-22T18:55:33.517');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8712, 1355, 'dsg-description', 'self', 'Tadpole-like body. Secretes a pair of filters, including a complex, chambered internal filter and a more diffuse outer filter that may be up to 1 meter across.', '2020-12-22T19:03:24.583');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8713, 1355, 'dsg-size', 'self', 'To 87 mm total length.', '2020-12-22T19:03:46.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8714, 1355, 'dsg-diet', 'self', 'Marine snow.', '2020-12-22T19:04:03.630');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8715, 1355, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-22T19:04:24.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8716, 1355, 'dsg-looks-like', 'self', 'Bathchordaeus charon, Bathochordaeus mcnutti.', '2020-12-23T13:03:17.013');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8717, 1355, 'dsg-key-visual-features', 'self', 'Body smaller in size relative to internal mucous filter than B. charon. Body similar to B. mcnutti, but tail lacks distinctive blue margin as seen in B. mcnutti. Shape and size of mucous house similar to B. mcnutti, but B. mcnutti houses typically have a pair of conspicuous protrusions. Inner mucous filter has more chambers than that of B. charon.', '2020-12-22T19:05:51.133');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8718, 1355, 'dsg-reference', 'self', 'Sherlock, R.E., K.R. Walz, and B.H. Robison (2016). The first definitive record of the giant larvacean, Bathochordaeus charon, since its original description in 1900 and a range extension to the northeast Pacific Ocean. Marine Biodiversity Records, 9: 79. https://doi.org/10.1186/s41200-016-0075-9.', '2020-12-22T19:06:38.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8719, 1355, 'dsg-reference', 'self', 'Sherlock, R.E., K.R. Walz, K.L. Schlining, and B.H. Robison (2017). Morphology, ecology, and molecular biology of a new species of giant larvacean in the eastern North Pacific: Bathochordaeus mcnutti sp. nov. Marine Biology, 164: 20. http://dx.doi.org/10.1007/s00227-016-3046-0', '2020-12-22T19:06:57.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8720, 1355, 'dsg-referenc', 'self', 'Garstang, W. (1937). On the anatomy and relations of the appendicularian Bathochordaeus, based on a new species from Bermuda (B. stygius, sp. N.). Journal of the Linnean Society of London, Zoology, 40: 283-303.', '2020-12-22T19:08:00.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8721, 2661, 'dsg-description', 'self', 'Body cylindrical in shape and distinguished by darkly pigmented gut, which varies in color from pink to deep red.', '2020-12-23T12:45:07.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8722, 2661, 'dsg-size', 'self', 'To 7 cm total length.', '2020-12-23T12:45:31.840');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8723, 2661, 'dsg-color', 'self', 'Pink to deep red to purple.', '2020-12-23T12:45:49.297');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8724, 2661, 'dsg-reproduction', 'self', 'Hermaphroditic with holoplanktonic lifecycle.', '2020-12-23T12:46:20.690');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8725, 2661, 'dsg-diet', 'self', 'Ctenophores.', '2020-12-23T12:46:52.200');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8726, 2661, 'dsg-range', 'self', 'Vancouver Island, British Columbia, to Central California.', '2020-12-23T12:47:19.900');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8727, 2661, 'dsg-habitat', 'self', 'Epipelagic and mesopelagic.', '2020-12-23T12:47:50.850');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8728, 2661, 'dsg-looks-like', 'self', 'Beroe cucumis.', '2020-12-23T12:50:34.160');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8729, 2661, 'dsg-key-visual-features', 'self', 'Paragastric canals are branched with diverticula and color is deeper red than Beroe cucumis. Deep dwelling.', '2020-12-23T12:50:59.123');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8730, 2661, 'dsg-reference', 'self', 'Mills, C.E. and S.H.D. Haddock (2007). Ctenophores. pp. 189-199, with 5 plates. In Light and Smith''s Manual: Intertidal Invertebrates of the Central California Coast. Fourth Edition (J.T. Carlton, editor). University of California Press, Berkeley.', '2020-12-23T12:59:21.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8731, 2661, 'dsg-reference', 'self', 'Wrobel, D. and C.E. Mills (1998). Pacific coast pelagic invertebrates: a guide to the common gelatinous animals. Sea Challengers & Monterey Bay Aquarium, Monterey, CA. 101 pp.', '2020-12-23T12:59:38.067');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8732, 2661, 'dsg-reference', 'self', 'Mortensen, T. (1927). Papers from Dr. Th. Mortensen''s Pacific Expedition, 1914–16, XXXIX, Two New Ctenophores. Videnskabelige Meddelelser-Dansk Naturhistorisk Forening I Kobenhavn. 83: 277–288.', '2020-12-23T13:00:08.163');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8733, 2663, 'dsg-description', 'self', 'Body compressed and conical in shape with a broad oral end and pointed aboral end. Large mouth. Eight comb rows, all equal in size, run almost the entire length of the body. Color often clear to rosy pink with darker red along the comb rows.', '2020-12-23T13:14:00.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8734, 2663, 'dsg-size', 'self', 'To 15 cm total length.', '2020-12-23T13:14:21.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8735, 2663, 'dsg-color', 'self', 'Translucent, frosty white to rosy pink.', '2020-12-23T13:14:49.940');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8736, 2663, 'dsg-reproduction', 'self', 'Hermaphroditic with holoplanktonic lifecycle.', '2020-12-23T13:15:16.350');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8737, 2663, 'dsg-diet', 'self', 'Ctenophores.', '2020-12-23T13:15:37.440');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8738, 2663, 'dsg-habitat', 'self', 'Epipelagic and mesopelagic.', '2020-12-23T13:15:56.087');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8739, 894, 'dsg-Monterey-Bay-Aquarium', 'self', 'https://www.montereybayaquarium.org/animals/animals-a-to-z/comb-jelly', '2020-12-23T13:23:23.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8740, 1255, 'dsg-reference', 'self', 'Scripps Institution of Oceanography. "Phronima sedentaria". Zooplankton Guide. Accessed 12/23/20. http://sio-legacy.ucsd.edu/zooplanktonguide/species/phronima-sedentaria', '2020-12-23T13:52:44.237');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8741, 621, 'dsg-reference', 'self', 'Herring, P.J., P.N. Dilly, and C. Cope (1994). The bioluminescent organs of the deep-sea cephalopod Vampyroteuthis infernalis (Cephalopoda: Vampyromorpha). Journal of Zoology, 233(1): 45-55. https://zslpublications.onlinelibrary.wiley.com/doi/abs/10.1111/j.1469-7998.1994.tb05261.x', '2020-12-23T14:01:03.780');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8742, 2289, 'dsg-description', 'self', 'Distinguished by a long, filamentous first dorsal fin ray and large teeth. Color is dark brown or black with silvery, scale-like appearance. A row of photophores lines the belly.', '2020-12-23T15:28:46.020');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8743, 2289, 'dsg-size', 'self', 'To 29.3 cm total length.', '2020-12-23T15:29:25.213');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8744, 2289, 'dsg-color', 'self', 'Black body with silvery, scale-like appearance.', '2020-12-23T15:30:24.503');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8745, 2289, 'dsg-reproduction', 'self', 'Oviparous with planktonic eggs and larvae.', '2020-12-23T15:31:22.923');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8746, 2289, 'dsg-diet', 'self', 'Small crustaceans, chaetognaths, and small fishes.', '2020-12-23T15:31:49.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8747, 2289, 'dsg-range', 'self', 'North Pacific Ocean.', '2020-12-23T15:33:08.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8748, 2289, 'dsg-habitat', 'self', 'Mesopelagic and bathypelagic.', '2020-12-23T15:33:40.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8749, 2289, 'dsg-MBARI', 'self', 'https://www.mbari.org/products/creature-feature/pacific-viperfish/', '2020-12-23T15:39:33.960');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8750, 2289, 'dsg-key-visual-features', 'self', 'Exceptionally shiny.', '2020-12-23T15:41:13.230');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8751, 2289, 'dsg-reference', 'self', 'Froese, R. and D. Pauly, ed. (2019) "Chauliodus macouni, Pacific viperfish." FishBase. Accessed 10/28/20. https://www.fishbase.de/summary/Chauliodus-macouni.html.', '2020-12-23T15:42:11.123');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8752, 2289, 'dsg-reference', 'self', 'Page, L.M., H. Espinosa-Pérez, L.T. Findley, C.R. Gilbert, R.N. Lea, N.E. Mandrak, R.L. Mayden, and J.S. Nelson (2013). Common and scientific names of fishes from the United States, Canada, and Mexico. American Fisheries Society, Bethesda, MD. 243 pp.', '2020-12-23T15:42:35.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8753, 3007, 'dsg-description', 'self', 'Body small, gelatinous, and semi-transparent to orange in color with large, prominent eyes and eight short arms. Arm length less than mantle length. Sexual dimorphism between sexes. Mature males lack hectocotylized arm, but do possess enlarged distal suckers on third right arm. Mature females have a ring-shaped light organ around the mouth.', '2020-12-23T15:48:17.897');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8754, 3007, 'dsg-size', 'self', 'To 8.5 cm mantle length and to 16 cm total length.', '2020-12-23T15:48:56.200');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8755, 3007, 'dsg-color', 'self', 'Semi-transparent to orange.', '2020-12-23T15:49:59.503');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8756, 3007, 'dsg-reproduction', 'self', 'Upon reaching sexual maturity, iridescence of eyes and digestive glands disappears, pigmentation increases slightly, and individuals migrate to deeper water. Mature males develop enlarged salivary glands, possibly to secrete chemical attractant for females. Bioluminescent organ in females may be used for reproductive signalling to males. Females brood eggs underneath their arms.', '2020-12-23T15:50:31.403');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8757, 3007, 'dsg-range', 'self', 'Worldwide in tropical and subtropical waters, and boreal waters of the northern Pacific Ocean.', '2020-12-23T15:51:32.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8758, 3007, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-23T15:52:01.407');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8759, 3007, 'dsg-depth-distribution', 'self', '200 - 1,000 m.', '2020-12-23T15:52:47.143');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8760, 3007, 'dsg-reference', 'self', 'Hoyle, W.E. (1885). Diagnoses of new species of Cephalopoda collected during the cruise of H.M.S. Challenger, I: The Octopoda. Annals and Magazine of Natural History. series 5, 15:222-236.', '2020-12-23T15:53:18.240');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8761, 3007, 'dgs-reference', 'self', 'Young, R.E. (2016). "Japetella diaphana Hoyle 1885." The Tree of Life Web Project. Last modified 11/16/16. http://tolweb.org/Japetella_diaphana/20224.', '2020-12-23T15:53:29.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8762, 3007, 'dsg-reference', 'self', 'Norman, M.D. and J.K. Finn (2014). "Family Bolitanidae" in P. Jereb, C.F.E. Roper, M.D. Norman, and J.K. Finn (eds.). Cephalopods of the world. An annotated and illustrated catalogue of cephalopod species known to date. Volume 3. Octopods and Vampire Squids. FAO Species Catalogue for Fishery Purposes. Rome: FAO.', '2020-12-23T15:53:50.207');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8763, 570, 'dsg-description', 'self', 'Distinguished by distinctively large, terminal fins that are as long or even longer than the body length and equally as wide.', '2020-12-23T15:56:29.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8764, 570, 'dsg-range', 'self', 'Eastern to central Pacific Ocean, in tropical to subtropical waters.', '2020-12-23T15:56:50.783');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8765, 570, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-23T15:57:15.807');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8767, 570, 'dsg-key-visual-features', 'self', 'Looks like they have bent "elbows."', '2020-12-23T16:01:26.680');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8768, 570, 'dsg-reference', 'self', 'Osterhage, D., H. MacIntosh, F. Althaus, and A. Ross (2020). Multiple observations of Bigfin Squid (Magnapinna sp.) in the Great Australian Bight reveal distribution patterns, morphological characteristics, and rarely seen behaviour. PLoS ONE, 15(11): e0241066. https://doi.org/10.1371/journal.pone.0241066', '2020-12-23T16:01:59.257');
