INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8770, 570, 'dsg-reference', 'self', 'Vecchione, M. and R.E. Young (2019). "Magnapinna pacifica Vecchione and Young, 1998. Pacific bigfin squid." The Tree of Life Web Project. Last modified 3/26/19. http://tolweb.org/Magnapinna_pacifica/19449.', '2020-12-23T16:02:31.990');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8771, 570, 'dsg-reference', 'self', 'Vecchione, M., R.E. Young, A. Guerra, D.J. Lindsay, D.A. Clague, J.M. Bernard, W.W. Sager, A.F. Gonzalez, F.J. Rocha, and M. Segonzac (2001). Worldwide observations of remarkable deep-sea squids. Science, 294: 2505-2506. https://doi.org/10.1126/science.294.5551.2505', '2020-12-23T16:03:04.797');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8772, 6709, 'dsg-description', 'self', 'Dramatic sexual dimorphism. Females globular in shape with a large head and mouth, sharp teeth, distensible stomach, and uniform dark brown or black color. First doral fin ray of female modified into a short lure (illicium) with bulbous, luminous tip (esca). Dwarf males slender in shape and are free-living (non-parasitic). Males have large olfactory organs and inflated nostrils.', '2020-12-23T16:10:23.973');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8773, 6709, 'dsg-size', 'self', 'To 18 cm total length (female) and to 2.9 cm total length (male).', '2020-12-23T16:11:25.163');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8774, 6709, 'dsg-color', 'self', 'Dark brown or black.', '2020-12-23T16:11:49.287');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8775, 6709, 'dsg-reproduction', 'self', 'Oviparous with planktonic larvae.', '2020-12-23T16:12:14.433');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8776, 6709, 'dsg-diet', 'self', 'Fishes and crustaceans.', '2020-12-23T16:12:37.840');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8777, 6709, 'dsg-range', 'self', 'Worldwide in tropical and temperate waters.', '2020-12-23T16:12:59.773');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8778, 6709, 'dsg-habitat', 'self', 'Mesopelagic and bathypelagic.', '2020-12-23T16:13:20.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8779, 6709, 'dsg-depth-distribution', 'self', '100 - 4,500 m', '2020-12-23T16:15:22.860');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8780, 6709, 'dsg-reference', 'self', 'Froese, R. and D. Pauly, ed. (2019) "Melanocetus johnsonii, Humpback anglerfish." FishBase. Accessed 10/28/20. http://www.fishbase.us/summary/SpeciesSummary.php?id=2292. ', '2020-12-23T16:16:52.540');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8781, 6709, 'dsg-reference', 'self', 'Pietsch, T.W. (2005.) "Melanocetidae. Melanocetus. Black Seadevils." The Tree of Life Web Project. Last modified 11/5/05. http://tolweb.org/Melanocetus/22003.', '2020-12-23T16:17:10.577');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8782, 2980, 'dsg-description', 'self', 'A pair of long, elliptical fins runs the length of the body. Tentacles drop off in early life stages, and adults possess just eight arms. Long arms bear hooks instead of suckers along most of their length. Body typically bright red in color with numerous photophores, including prominent photophores at the tip of each arm. Octopoteuthis deletron possess one (rather than two) tail photophores.', '2020-12-23T16:22:51.277');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8783, 2980, 'dsg-size', 'self', 'To 17 cm mantle length.', '2020-12-23T16:23:11.057');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8784, 2980, 'dsg-color', 'self', 'Bright red. Fins may have light edges. Juveniles are a lighter color, semi-transparent.', '2020-12-23T16:23:39.210');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8785, 2980, 'dsg-reproduction', 'self', 'Mature males lack hectocotylus, but have a large penis able to extend well beyond the opening of the mantle. Same-sex mating behavior has been reported, likely as a strategy for reproductive success in an environment where mates are few and far between.', '2020-12-23T16:23:56.630');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8786, 2980, 'dsg-range', 'self', 'Eastern North Pacific Ocean (from Alaska to Baja California), off Peru, and potentially off Japan.', '2020-12-23T16:24:30.170');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8787, 2980, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-23T16:25:05.627');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8788, 2980, 'dsg-looks-like', 'self', 'Octopoteuthis nielseni', '2020-12-23T16:25:26.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8789, 2980, 'dsg-key-visual-features', 'self', 'Bright red color. Eight arms, no tentacles. Ink is a characteristic light cloud.', '2020-12-23T16:25:48.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8790, 2980, 'dsg-reference', 'self', 'Bush, S.L., B.H. Robison, and R.L. Caldwell (2009). Behaving in the dark: Locomotor, chromatic, postural, and bioluminescent behaviors of the deep-sea squid Octopoteuthis deletron Young 1972. Biological Bulletin, 216: 7-22. https://doi.org/10.1086/bblv216n1p7', '2020-12-23T16:26:10.517');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8791, 2980, 'dsg-reference', 'self', 'Hoving, H.J.T., S.L. Bush, and B.H. Robison (2012). A shot in the dark: Same-sex sexual behaviour in a deep-sea squid. Biology Letters, 8: 287-290. https://doi.org/10.1098/rsbl.2011.0680', '2020-12-23T16:26:26.847');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8792, 2980, 'dsg-reference', 'self', 'Roper, C. F. E. and P. Jereb (2010). "Octopoteuthis" in Cephalopods of the world. An annotated and illustrated catalogue of species known to date. Volume 2. Myopsid and Oegopsid Squids. FAO Species Catalogue for Fishery Purposes. No. 4, Vol. 2. Rome: FAO.', '2020-12-23T16:26:54.347');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8793, 2980, 'dsg-reference', 'self', 'Young, R.E. (2014). "Octopoteuthis deletron Young 1972." The Tree of Life Web Project. Last modified 1/21/14. http://tolweb.org/Octopoteuthis_deletron/19843.', '2020-12-23T16:27:41.167');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8794, 1255, 'dsg-description', 'self', 'Transparent hyperiid amphipod carries a barrel-shaped shelter made from the gelatinous tissues of salps and pyrosomes. Fifth pereiopods modified to claw-like shape to grasp barrel. Both males and females hijack pelagic tunicates as barrels, with females using the gelatinous host as food and shelter for her larvae. Thick, bristly uropods well developed. ', '2020-12-23T16:30:52.710');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8795, 1255, 'dsg-size', 'self', 'To 4.2 cm total length.', '2020-12-23T16:31:33.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8796, 1255, 'dsg-color', 'self', 'Transparent.', '2020-12-23T16:31:51.557');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8797, 1255, 'dsg-reproduction', 'self', 'Females lay eggs within the barrel and larvae cohabit the barrel with their mother.', '2020-12-23T16:32:11.547');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8798, 1255, 'dsg-diet', 'self', 'Zooplankton.', '2020-12-23T16:32:33.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8799, 1255, 'dsg-range', 'self', 'Worldwide in tropical and temperate waters.', '2020-12-23T16:32:52.170');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8800, 1255, 'dsg-habitat', 'self', 'Epipelagic and mesopelagic.', '2020-12-23T16:33:15.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8801, 1255, 'dsg-key-visual-features', 'self', 'Swim in circles when in barrels. Also observed free-swimming.', '2020-12-23T16:33:48.360');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8802, 1255, 'dsg-reference', 'self', 'Aoki, M.N., C. Matsumoto-Ohshima, E. Hirose, and J. Nishikawa (2013). Mother-young cohabitation in Phronimella elongata and Phronima spp. (Amphipoda, Hyperiidea, Phronimidae). Journal of the Marine Biological Association of the United Kingdom. 93(6): 1553-1556.', '2020-12-23T16:34:00.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8803, 1255, 'dsg-reference', 'self', 'Diebel, C.E. (1988). Observations on the anatomy and behavior of Phronima sedentaria (Forsskål) (Amphipoda: Hyperiidea). Journal of Crustacean Biology, 8(1): 79-90. https://doi.org/10.1163/193724088X00107', '2020-12-23T16:34:17.053');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8804, 1255, 'dsg-reference', 'self', 'Laval, P. (1978). The barrel of the pelagic amphipods Phronima sedentaria (Forsskål) (Crustacean: hyperiidea). Journal of Experimental Marine Biology and Ecology, 33(3): 187-211. https://doi.org/10.1016/0022-0981(78)90008-4', '2020-12-23T16:34:28.493');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8805, 1255, 'dsg-reference', 'self', 'Laval, P. (1980). Hyperiid amphipods as crustacean parasitoids associated with gelatinous zooplankton. Oceanography and Marine Biology Annual Review, 18: 11-56.', '2020-12-23T16:34:48.280');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8806, 1255, 'dsg-reference', 'self', 'Marine Species Identification Portal. "Phronima sedentaria." Zooplankton and Micronekton of the North Sea. Accessed 10/28/20. http://species-identification.org/species.php?species_group=zmns&menuentry=soorten&id=370&tab=beschrijving.', '2020-12-23T16:35:10.133');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8807, 1070, 'dsg-description', 'self', 'Highly specialized chemosynthetic vent worm resides in smooth, white tubes with red plume protruding. Heavily vascularized plume is comprised of fine lamellae and split along length. Muscular vestimentum is wing-shaped. Trunk contains large trophosome housing chemo-symbiotic bacteria. Parchment-like tubes are flexible and made of chitinous protein. Tubeworms form clusters on rock and mineral substrate in areas of diffuse venting.', '2020-12-23T16:40:30.310');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8808, 1070, 'dsg-size', 'self', 'To 1.5 m tall.', '2020-12-23T16:41:39.717');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8809, 1070, 'dsg-color', 'self', 'Distinctive red plumes and white tubes.', '2020-12-23T16:42:08.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8810, 1070, 'dsg-reproduction', 'self', 'Males broadcast sperm, but fertilization occurs within the tube of the female. Trochophore larvae facilitate dispersal to new hydrothermal vent fields. Symbiotic bacteria are acquired from the environment when suitable habitat for settlement has been found.', '2020-12-23T16:42:34.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8811, 1070, 'dsg-diet', 'self', 'Nutrition provided by symbiotic sulfur-oxidizing bacteria.', '2020-12-23T16:42:59.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8812, 1070, 'dsg-range', 'self', 'East Pacific Rise and Galapagos Islands.', '2020-12-23T16:43:17.733');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8813, 1070, 'dsg-reference', 'self', 'Cary, S.C., H. Felbeck, and N.D. Holland (1989). Observations on the reproductive biology of the hydrothermal vent tube worm Riftia pachyptila. Marine Ecology Progress Series, 52: 89-94.', '2020-12-23T16:43:38.303');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8814, 1070, 'dsg-reference', 'self', 'Desbruyères, D., M. Segonzac, and M. Bright, ed. (2006). Handbook of Deep-Sea Hydrothermal Vent Fauna. 2nd edition. Linz: Denisia, 18, 544 pp.', '2020-12-23T16:43:59.167');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8815, 1070, 'dsg-reference', 'self', 'Jones, Meredith L. (1981). Riftia pachyptila, new genus, new species, the vestimentiferan worm from the Galápagos Rift geothermal vents (Pogonophora. Proceedings of the Biological Society of Washington. 93(4): 1295-1313.', '2020-12-23T16:44:13.513');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8816, 1070, 'dsg-reference', 'self', 'Marsh, A.G., L.S. Mullineaux, C.M. Young, and D.T. Manahan (2001). Larval dispersal potential of the tubeworm Riftia pachyptila at deep-sea hydrothermal vents. Nature, 411: 77-80. https://doi.org/10.1038/35075063', '2020-12-23T16:44:33.490');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8817, 621, 'dsg-description', 'self', 'A thin web of tissue connects eight arms. Two retracile filaments extend from the mantle. Distinctive large, bright blue eyes. A pair of fins on the lateral side of the mantle aid in locomotion. Possesses two large photophores below the fins with a number of smaller light organs in the skin. The tips of all eight arms are also capable of bioluminescence. May invert the webbing between its arms and expose thin, fleshy cirri when disturbed, giving a characteristic pineapple-like appearance. Dark red in color with variations ranging from amber to dark orange to brown.', '2020-12-23T16:52:58.470');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8818, 621, 'dsg-size', 'self', 'To 30 cm total length and 13 cm mantle length.', '2020-12-23T16:53:46.720');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8819, 621, 'dsg-reproduction', 'self', 'Iteroparous, with multiple reproductive cycles. Spawning occurs in deep water. Hatchlings possess pair of fins, which are absorbed during larval development and replaced by a more anterior pair of fins. Juveniles may thus have two pairs of fins depending on developmental stage.', '2020-12-23T16:55:09.167');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8820, 621, 'dsg-diet', 'self', 'Detritus.', '2020-12-23T16:55:57.817');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8821, 621, 'dsg-MBARI', 'self', 'https://www.mbari.org/products/creature-feature/vampire-squid-landing-page/', '2020-12-23T16:59:38.897');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8822, 621, 'dsg-reference', 'self', 'Herring, P.J., P.N. Dilly, and C. Cope (1994). The bioluminescent organs of the deep-sea cephalopod Vampyroteuthis infernalis (Cephalopoda: Vampyromorpha). Journal of Zoology, 233(1): 45-55. https://zslpublications.onlinelibrary.wiley.com/doi/abs/10.1111/j.1469-7998.1994.tb05261.x', '2020-12-23T17:00:16.293');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8823, 621, 'dsg-reference', 'self', 'Hoving, H.J.T. and B.H. Robison (2012). Vampire squid: Detritivores in the oxygen minimum zone. Proceedings of the Royal Society B. 279: 4559-4567. https://doi.org/10.1098/rspb.2012.1357', '2020-12-23T17:00:27.987');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8824, 621, 'dsg-reference', 'self', 'Hoving, H.J.T., V.V. Laptikhovsky, and B.H. Robison (2015). Vampire squid reproductive strategy is unique among coleoid cephalopods. Current Biology, 25(8): R322-R323. https://doi.org/10.1016/j.cub.2015.02.018', '2020-12-23T17:00:43.820');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8825, 621, 'dsg-reference', 'self', 'Norman, M.D. and J.K. Finn (2014). "Family Bolitanidae" in P. Jereb, C.F.E. Roper, M.D. Norman, and J.K. Finn (eds.). Cephalopods of the world. An annotated and illustrated catalogue of cephalopod species known to date. Volume 3. Octopods and Vampire Squids. FAO Species Catalogue for Fishery Purposes. Rome: FAO.', '2020-12-23T17:01:06.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8826, 621, 'dsg-reference', 'self', 'Robison, B.H., K.R. Reisenbichler, J.C. Hunt, and S.H.D. Haddock (2003). Light production by the arm tips of the deep-sea cephalopod Vampyroteuthis infernalis. Biological Bulletin, 205: 102-109. https://doi.org/10.2307/1543231', '2020-12-23T17:01:57.300');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8827, 621, 'dsg-reference', 'self', 'Young, R.E. (2008). "Vampyromorpha Robson, 1929. Vampyroteuthis infernalis Chun, 1903. The Vampire Squid." The Tree of Life Web Project. Last modified 5/30/08. http://tolweb.org/tolarchive/20084/20080530/Vampyroteuthis_infernalis.html.', '2020-12-23T17:02:24.127');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8828, 5794, 'dsg-key-visual-features', 'self', 'Bright orange head/trunk, transparent tail. Swims like a fish.', '2020-12-23T17:04:58.033');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8830, 5794, 'dsg-depth-distribution', 'self', '3,245 m', '2020-12-23T17:06:32.353');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8831, 5794, 'dsg-range', 'self', 'Gulf of California.', '2020-12-23T17:06:51.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8832, 5794, 'dsg-reproduction', 'self', 'Hermaphroditic.', '2020-12-23T17:07:07.197');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8833, 5794, 'dsg-color', 'self', 'Orange head and trunk with translucent tail.', '2020-12-23T17:07:27.367');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8834, 5794, 'dsg-size', 'self', 'To 28.5 mm total length.', '2020-12-23T17:07:48.320');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8835, 5794, 'dsg-description', 'self', 'Head blunt and orange in color. Trunk has uniform width, tapering at junction with tail, and is bright orange in color. Body exhibits a slight ventral bend at junction of trunk and tail. One pair of lateral fins, starting at trunk-tail junction. Both trunk and tail have traverse musculature. Tail transparent.', '2020-12-23T17:08:06.917');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8836, 3094, 'dsg-description', 'self', 'Highly modified gastropod parasitic on Rathbunaster californicus. Head and proboscis form balloon-like pseudopallium that surrounds the visceral mass. Forms cyst (globular to bean-like in shape) within host. Stalk short, with anterior part of foot protruding.', '2020-12-23T17:11:03.343');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8837, 3094, 'dsg-size', 'self', 'To 13 mm diameter.', '2020-12-23T17:11:24.833');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8838, 3094, 'dsg-reproduction', 'self', 'Males considerably smaller than females. Females produce egg mass inside sea star host.', '2020-12-23T17:11:44.837');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8839, 3094, 'dsg-diet', 'self', 'Parasitic on sea stars'' tissue and bodily fluids.', '2020-12-23T17:13:22.637');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8840, 3094, 'dsg-depth-distribution', 'self', '250 - 650 m', '2020-12-23T17:14:12.800');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8841, 3094, 'dsg-reference', 'self', 'Randall, J. and H. Heath (1912). Asterophila, a new genus of parasitic gastropods. Biological Bulletin, 22: 98-106. https://doi.org/10.2307/1536172', '2020-12-23T17:14:36.927');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8842, 3094, 'dsg-reference', 'self', 'Warén A. and L.M. Lewis (1994) Two new species of eulimid gastropods endoparasitic in asteroids. The Veliger, 37(4): 325-335.', '2020-12-23T17:15:02.967');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8843, 763, 'dsg-description', 'self', 'Medusa contains four simple, unbranched radial canals that connect to the ring canal. Bell has a wide velum. Manubrium is half to two-thirds bell height with a cross-shaped mouth. Four highly contractile tentacles are swollen and pigmented at base where they attach to the bell. Exhibits mutualistic symbiosis with pelagic tunicate Doliolula equus with hydroid polyps occurring on the doliolid''s buccal siphon. Hydroid polyps are singular and unbranched with root-like hydrorhiza. Autonomous tentacles may also adhere to doliolid host.', '2020-12-23T17:19:36.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8844, 763, 'dsg-size', 'self', 'Hydroid polyps to 12 mm in height. Medusae to 4.6 mm diameter.', '2020-12-23T17:20:17.657');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8845, 763, 'dsg-reproduction', 'self', 'Hydroid polyps bud one to three medusae at a time. Medusae are released when approximately 2 mm in diameter.', '2020-12-23T17:20:38.747');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8846, 763, 'dsg-habitat', 'self', 'Mesopelagic, occurring on the pelagic tunicate Doliolula equus.', '2020-12-23T17:21:14.700');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8847, 763, 'dsg-depth-distribution', 'self', '78 - 2,843 m', '2020-12-23T17:21:36.887');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8848, 727, 'dsg-description', 'self', 'Outer bell hemispherical in shape. Interior of bell burnt tangerine in color, with ring and eight radial canals, manubrium, and gonads bright pink to lavender in color. Up to 220 tentacles occur in a single row along the edge of the bell.', '2020-12-23T17:23:25.473');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8849, 727, 'dsg-size', 'self', 'Bell to 28 mm diameter and 18 mm height.', '2020-12-23T17:23:48.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8850, 727, 'dsg-color', 'self', 'Bell distinctively orange inside with canals, manubrium, and gonads pink to purple in color.', '2020-12-23T17:24:07.800');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8851, 727, 'dsg-reproduction', 'self', 'Sexually dimorphic with males exhibiting pendant, sausage-like testes and females bearing globular ovaries. Viviparous with juvenile medusae attached to the mother.', '2020-12-23T17:24:31.110');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8852, 727, 'dsg-depth-distribution', 'self', 'Greater than 1,000 m, most common at 2,144 - 3,254 meters off California and 1,200 - 1,300 m off Hawaii', '2020-12-23T17:25:06.467');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8853, 727, 'dsg-habitat', 'self', 'Bathypelagic.', '2020-12-23T17:25:48.130');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8854, 727, 'dsg-range', 'self', 'North Pacific Ocean (including California, Baja California, and Hawaii), Arctic Ocean.', '2020-12-23T17:26:37.407');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8855, 727, 'dsg-reference', 'self', 'Raskoff, K.A., R.R. Hopcroft, K.N. Kosobokova, J.E. Purcell, and M. Youngbluth (2010). Jellies under ice: ROV observations from the Arctic 2005 hidden ocean expedition. Deep-Sea Research II, 57: 111-126. https://doi.org/10.1016/j.dsr2.2009.08.010', '2020-12-23T17:27:22.090');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8856, 727, 'dsg-key-visual-features', 'self', 'Red-orange bell, bright white tentacles. Large, visible gonads.l', '2020-12-23T17:27:53.447');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8857, 727, 'dsg-looks-like', 'self', 'Crossota alba', '2020-12-23T17:28:17.947');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8859, 578, 'dsg-description', 'self', 'Individual zooids link together in a chain. Common stolon links individual zooids together. Zooids ovate, almost spherical, in shape with five girdling muscle bands and a thick tunic. Gut is U-shaped. Buccal siphon often hosts hydroids of Bythotiara dolioeques in mutualistic symbiosis.', '2020-12-23T17:32:26.220');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8860, 578, 'dsg-size', 'self', 'Individual zooids to 22 mm. Total colony length to 4.5 m.', '2020-12-23T17:32:46.337');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8861, 578, 'dsg-color', 'self', 'Tunic and body wall typically transparent, with some zooids exhibiting small, irregularly shaped patches of bright orange pigment.', '2020-12-23T17:33:02.457');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8862, 578, 'dsg-reproduction', 'self', 'Hermaphroditic.', '2020-12-23T17:33:20.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8863, 578, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-23T17:33:47.380');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8864, 578, 'dsg-depth-distribution', 'self', '80 - 550 m, most common 300 - 400 m.', '2020-12-23T17:34:10.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8866, 578, 'dsg-looks-like', 'self', 'Salp chain.', '2020-12-23T17:34:44.867');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8867, 578, 'dsg-reference', 'self', 'Martini, S. and S.H.D. Haddock (2017). Quantification of bioluminescence from the surface to the deep sea demonstrates its predominance as an ecological trait. Scientific Reports, 7: 45750. https://doi.org/10.1038/srep45750', '2020-12-23T17:35:01.503');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8868, 5785, 'dsg-description', 'self', 'Body bush-like in shape and sparsely branched. Body bears eight ruffly fronds, with initial branching occurring just above the basal disc. Truncate clavules are unique to this species.', '2020-12-23T17:38:32.423');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8869, 5785, 'dsg-size', 'self', 'Individual branch length to 42 cm.', '2020-12-23T17:38:58.347');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8870, 5785, 'dsg-color', 'self', 'White, turning brown when dead.', '2020-12-23T17:39:19.007');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8871, 808, 'dsg-description', 'self', 'Pair of rounded, swimming nectophores brilliant blue in color, especially when illuminated with white light. Siphonosome frail and lacks bracts. Gastrozooids bright carmine red. Thin tentilla have a single terminal filament.', '2020-12-23T17:41:37.977');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8872, 808, 'dsg-color', 'self', 'Brilliant glowing blue.', '2020-12-23T17:41:59.930');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8873, 808, 'dsg-habitat', 'self', 'Mesopelagic.', '2020-12-23T17:42:26.253');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8874, 808, 'dsg-depth-distribution', 'self', '357 - 520 m', '2020-12-23T17:42:44.387');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8875, 808, 'dsg-looks-like', 'self', 'Desmophyes haematogaster', '2020-12-23T17:43:20.857');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8876, 808, 'dsg-key-visual-features', 'self', 'While both G. lapislazula and D. haematogaster have rounded nectophores and red-pigmented gastrozooids, D. haematogaster can be distinguished by presence of bracts, disjunct pedicular canal, and a substantial portion of the somatocyst remains in contact with the upper wall of the hydroecium.', '2020-12-23T17:43:40.967');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8878, 6707, 'dsg-reference', 'self', 'Tuskes P.M. and A. McGowan-Tuskes (2019). Calliostoma and Akoya of the Californian Marine Province (Gastropoda: Calliostomatidae). The Festivus, 51(1): 11-28.', '2021-01-28T16:24:51.120');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8879, 6707, 'dsg-reference', 'self', 'Tuskes, P.M. (2019). Calliostomatidae of the northeast Pacific. Zoosymposia, 13: 083-096. http://dx.doi.org/10.11646/zoosymposia.13.1.9', '2021-01-28T16:25:01.407');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8880, 6708, 'dsg-reference', 'self', 'Russell, F.S. (1981). Trachymedusae. Fiches D''Identification du Zooplancton, 165: 4pp. https://doi.org/10.17895/ices.pub.5150', '2021-01-28T16:37:52.840');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8881, 6705, 'dgs-reference', 'self', 'M.R.S. Melo (2009). Revision of the genus Chiasmodon (Acanthomorpha: Chiasmodontidae), with the description of two new species. Copeia, 3: 583-608. https://doi.org/10.1643/CI-08-048', '2021-01-28T16:47:51.133');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8882, 1332, 'dsg-depth-distribution', 'self', '0 — 1500 m', '2021-02-01T11:54:54.413');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8884, 871, 'dsg-reference', 'self', 'Kahn, A.S., C.W. Pennelly, P.R. McGill, and S.P. Leys (2020).  Behaviors of sessile benthic animals in the abyssal northeast Pacific Ocean.  Submitted to Deep Sea Research Part II: Topical Studies in Oceanography, 173:104729, doi: 10.1016/j.dsr2.2019.104729.', '2021-02-26T14:16:36.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8891, 6615, 'dsg-reference', 'self', 'Korshunova T, Martynov A. (2020). Consolidated data on the phylogeny and evolution of the family Tritoniidae (Gastropoda: Nudibranchia) contribute to genera reassessment and clarify the taxonomic status of the neuroscience models Tritonia and Tochuina. PLoS ONE 15(11): e0242103. https://doi.org/10.1371/ journal.pone.0242103', '2021-03-18T15:44:55.403');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8892, 6712, 'dsg-reference', 'self', 'Schulze, F.E. (1887). Report on the Hexactinellida collected by H.M.S. ‘Challenger'' during the years 1873-76. Report on the Scientific Results of the Voyage of H.M.S. Challenger during the years 1873–76. Zoology. 21 (part 53): 1-514, pl. 1-104.', '2021-03-18T15:45:46.470');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8893, 6712, 'dsg-consulting-taxonomist', 'self', 'Henry Reiswig, University of Victoria, BC.', '2021-03-18T15:57:14.487');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8895, 6712, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2021-03-18T15:58:29.713');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8896, 6712, 'dsg-description', 'self', 'Likely a new species. We have only seen this in deep water, below 2200 meters at Taney Seamounts.', '2021-03-18T15:59:25.480');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8897, 480, 'dsg-color', 'self', 'Light and dark purple specimens have been observed.', '2021-12-21T16:39:59.183');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8898, 480, 'dsg-verified-MBARI-depth-distribution', 'self', '2447 - 3981 m', '2021-03-18T18:57:03.573');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8899, 480, 'dsg-taxonomist-assessment', 'self', 'Possibly P. raripes.', '2021-12-21T16:39:50.073');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8900, 2797, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2021-03-18T19:24:25.143');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8901, 2792, 'dsg-description', 'self', 'Adults are small in size and with no sharp 90 degree inflection at "head"; cannot see feeding tentacles. Indistinguishable on video from young Peniagone sp. A.. Identified from samples D232 E-J.', '2021-03-18T19:38:29.273');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8902, 5669, 'dsg-consulting-taxonomist', 'self', 'David Pawson, National Museum of Natural History, Smithsonian Institution.', '2021-03-18T19:48:13.793');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8903, 3805, 'dsg-consulting-taxonomist', 'self', 'Linda Kuhnz, MBARI.', '2021-03-18T19:53:36.777');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8904, 3805, 'dsg-taxonomist-assessment', 'self', 'Other species ruled out: E. minutissima only gets to 13 mm and has 3 pairs of dorsal papillae. E. atakama is similar, but can get up to 50 mm; 4-6 pairs of dorsal papillae, E. theeli.', '2021-03-18T19:56:30.313');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8906, 5729, 'dsg-consulting-taxonomist', 'self', 'Linda Kuhnz, MBARI.', '2021-03-18T20:20:16.880');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8907, 5489, 'dsg-taxonomist-assessment', 'self', 'Needs further evaluation. Thus far, does not fit the description of any known holothurian from the area.', '2021-03-18T20:22:10.410');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8908, 5729, 'dsg-taxonomist-assessment', 'self', 'Needs further evaluation. Thus far, does not fit the description of any known holothurian from the area.', '2021-03-18T20:23:55.260');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8909, 5994, 'dsg-consulting-taxonomist', 'self', 'Linda Kuhnz, MBARI.', '2021-03-18T20:25:37.333');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8910, 6662, 'dsg-consulting-taxonomist', 'self', 'Linda Kuhnz, MBARI.', '2021-03-18T20:27:05.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8913, 2422, 'dsg-taxonomist-assessment', 'self', 'March 2021: The taxonomy of this genus is in need of major revision. West Coast species should be designated to genus only for now. ', '2021-03-22T18:09:56.347');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8914, 2422, 'dsg-consulting-taxonomist', 'self', 'Gary Williams, California Academy of Sciences.', '2021-03-22T17:59:17.873');
