INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8917, 2850, 'dsg-taxonomist-assessment', 'self', 'March 2021: Need a specimen for review. Possibly a Lophaster or Henricia.', '2021-03-22T18:03:34.460');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8918, 2850, 'dsg-consulting-taxonomist', 'self', 'Christopher Mah, Smithsonian Natural History Museum.', '2021-03-22T18:04:21.827');
