INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8930, 6723, 'dsg-description', 'self', 'Potentially T. crossei and/or T. kiiensis.', '2021-03-27T17:19:51.000');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8931, 6723, 'dsg-color', 'self', 'Bright white to tan.', '2021-03-28T09:41:44.500');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8932, 1200, 'dsg-description', 'self', 'Rounded rostrum compared to Loxorhyncus. Can be difficult to tell apart on video.', '2021-04-04T18:06:12.910');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8934, 1201, 'dsg-description', 'self', 'Pointed rostrum compared to Loxorhyncus. Can be difficult to tell apart on video.', '2021-04-04T18:07:39.337');
