INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8972, 6738, 'dsg-description', 'self', 'Funiculina and Balticina look the same on video and have overlapping depth ranges; mostly reddish-purple or pink with a white rachis, but can appear all white. Because Balticina and Funiculina are indistinguishable per G. Williams, the morphotype is annotated as Funiculina-Balticina complex when observed between 600-799 m).', '2022-02-16T22:03:57.310');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8973, 6738, 'dsg-taxonomist-assessment', 'self', '2008.', '2022-02-16T22:07:15.070');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8974, 6736, 'dsg-depth-distribution', 'self', 'Under 800 m (but indistinguishable from Funicula between 600-800 m).', '2022-03-11T16:50:11.610');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8975, 6744, 'dsg-description', 'self', 'Long, parasol-shaped sponge measuring 30 cm in total length with a stalk width of 1 mm. Parasol diameter of 2.6 cm with seventy-six long filaments, 3.3–4.2 cm in length, radiating out in all directions from the parasol edge. Spheroid top-knot on apical surface of parasol measures 9 mm in length and 7.3 mm in diameter with dense, small filaments radiating in all directions in lengths from 4–9 mm. On the stalk 6.9 cm below the parasol is an oocyte swelling (immature specimens will not have this). Basal holdfast for attachement to hard substrate.', '2022-03-11T17:08:03.467');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8976, 6744, 'dsg-depth-distribution', 'self', '2435 - 2472 m', '2022-03-11T17:08:40.993');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8978, 6744, 'dsg-reference', 'self', 'Lundsten, L., H.M. Reiswig, and W.C. Austin (2017). Three new species of Cladorhiza (Demospongiae, Poecilosclerida, Cladorhizidae) from the Northeast Pacific Ocean. Zootaxa, 4317: 247. http://dx.doi.org/10.11646/zootaxa.4317.2.3', '2022-03-11T17:10:26.740');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8979, 6744, 'dsg-range', 'self', 'Gulf of California', '2022-03-11T17:11:35.353');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8980, 6744, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2022-03-11T17:11:58.197');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (8981, 6743, 'dsg-description', 'self', 'Large, parasol-shaped sponge 32.5 cm total length with 2-4 10.5 mm long apical extensions ending in 3.8 mm diameter discs. Parasol is 2.7 cm in diameter with fifty-four 2.4–3.7 cm long filaments radiating in all directions. Stalk is 1–2.1 mm in width and ends in a terminal rhizoid 5.5 cm long and 2.6 cm wide. On the stalk, 7.5 cm below the parasol an oocyte-embryo swelling is present that is 1.9 cm long and 2.9 mm. Younger animals have not have developed apical disks or oocyte swellings. ', '2022-03-11T17:12:41.000');
