INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9015, 6754, 'dsg-description', 'self', 'Mostly pink; chest, belly and underside of head white. Approximately three or four narrow, wavy yellow stripes on dorsal two-thirds of body posterior to head (stripes more numerous in juveniles). Yellow stripes separated by pearly pink stripes in juveniles, with two and then one pink stripe becoming accentuated midlaterally in adults; single stripe reaching from posterodorsal extent of opercular flap to below fourth segmented dorsal fin ray in largest specimen examined. Head with wavy yellow stripes and marks; first stripe broad, directed forward from ante-rior extent of orbit, connecting widi corresponding stripe from opposite side across snont; second stripe forming broad yellow border to entire upper lip, continuing posterodorsally around posteroventral quarter of orbital rim and then directed posterodorsally to upper angle of gill opening; several other short irregular marks on side of head including vertical line or blotch on posterior margin of preopercle and short horizontal line ventrally on cheek below posterior extent of orbit. Narrow black border present on dorsal side of eye. Large oval spot on upper fleshy caudal base black in juveniles, becoming blood red in adults (change in color occurring at about 75 mm ) , spot becoming diffuse in very large individuals; spot outlined, at least anteriorly, by broad pearly pink border. Dark pigment in spinous portion of dorsal fin black, two anteriorly converging reddish pink stripes present on segmented portion of fin, one basally and one midlaterally; broad distal portion of fin and area between pink stripes yellow. Anal fin white with broad distal yellow stripe. Caudal fin pinkish dorsally and ventrally, separated by broad yellowish expanse; narrow black posterior margin of fin present in some specimens. Pectoral fins transparent with broad blood red band on fleshy base. Pelvic fins white.', '2022-04-05T15:46:14.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9016, 6754, 'dsg-range', 'self', 'Baja California to Colombia; Cocos Island.', '2022-04-05T15:49:06.163');
