INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9029, 6758, 'dsg-reference', 'self', 'Holland, N.D., A.S. Hiley, and G.W. Rouse (2022). A new species of deep-sea torquaratorid enteropneust (Hemichordata): A sequential hermaphrodite with exceptionally wide lips. Invertebrate Biology, 141( 3), e12379. https://doi.org/10.1111/ivb.12379', '2022-09-21T13:05:28.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9030, 6758, 'dsg-description', 'self', 'Transparent body, high dome proboscis and extra-wide lips which can be transparent, light or dark purple; very broad collar, genital wings sometimes visible; highly sinuate intestines. Wholly transparent specimens are found north of Monterey, while animals with purple proboscis and lips were found to the south. Specimens with light purple anteriors were seen throughout the range. ', '2022-09-22T13:29:00.873');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9031, 6758, 'dsg-range', 'self', 'Co-Axial, South Axial, Vance, Juan de Fuca, North Cleft, South Cleft, Gorda Ridge, Guide, Taney, Davidson, and Rodriquez seamounts; Gulf of California.', '2022-09-22T13:30:15.800');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9032, 6758, 'dsg-depth-distribution', 'self', '1576 - 3287 m', '2022-09-22T13:35:56.660');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9033, 6758, 'dsg-habitat', 'self', 'Benthic, hard substrate (sedimented lava).', '2022-09-22T13:36:34.080');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9034, 6758, 'dsg-consulting-taxonomist', 'self', 'Kuhnz L., MBARI; Holland, N., Scripps Insitute of Oceanography; Osborn, K., Smithsonian Natural History Museum.', '2022-09-22T13:44:38.670');
