INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9037, 6758, 'dsg-reference', 'self', 'Osborn, K.J., L.A. Kuhnz, I.G. Priede, M. Urata, A.V. Gebruk, and N.D. Holland (2011). Diversification of acorn worms (Hemichordata, Enteropneusta) revealed in the deep sea. Proceedings of the Royal Society B. http://dx.doi.org/10.1098/rspb.2011.1916', '2022-09-22T13:50:03.880');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9056, 6788, 'dsg-consulting-taxonomist', 'self', 'Theodore Pietsch, University of Washington Professor, Aquatic & Fishery Sciences Curator of Fishes, Burke Museum of Natural History and Culture.', '2023-11-02T17:37:08.067');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9059, 6795, 'dsg-consulting taxonomist', 'self', 'Ben Burford, PhD Candidate, Hopkins Marine Station, Stanford University.', '2023-12-14T20:06:39.027');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9062, 6800, 'dsg-habitat', 'self', 'Benthic.', '2024-02-15T11:16:50.060');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9063, 6800, 'dsg-description', 'self', 'Bright red with white or cream-colored polyps. Note that the polyps may not appear white in insitu specimens (Horvath 2019).', '2024-02-15T11:18:35.670');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9064, 20000003, 'dsg-description', 'self', 'Long, thin rachis. Single or multiple stems, attached at the base. Color leans to a dull brick red with the polyps always the same color as the coenenchyme (Horvath 2019).', '2024-02-15T11:21:30.950');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9065, 20000003, 'dsg-habitat', 'self', 'Benthic, hard substrate.', '2024-02-15T11:21:51.590');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9066, 20000004, 'dsg-description', 'self', 'Densely branched fan-shaped. Branches thin, delicate, rusty red. It is possible that some of these animals are S. torreyi which are darker in color, with thinner branches and anastomosed branches.', '2024-02-15T12:08:58.470');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (9067, 783, 'dsg-reference', 'self', 'McFadden C.S., L.P. van Ofwegen, and A.M. Quattrini (2022). Revisionary systematics of Octocorallia (Cnidaria: Anthozoa) guided by phylogenomics. Bulletin of the Society of Systematic Biologists. Vol. 1 No. 3. DOI: https://doi.org/10.18061/bssb.v1i3.8735 ', '2024-02-15T12:34:07.750');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000372, 40005382, 'dsg-consulting-taxonomist', 'self', 'Adriana Gaytan-Caballero, Universidad Nacional Autonoma de Mexico.', '2015-04-17T11:46:12.827');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000373, 40005382, 'dsg-description', 'self', 'Red, moderately long arms with red and white bars, white chelipeds.', '2015-03-30T11:08:54.683');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000376, 40005385, 'dsg-description', 'self', 'Purplish and or yellowish in color. Occasionally observed at the surface, but they remain buried most of the time.', '2021-05-04T08:01:02.683');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000377, 40005385, 'dsg-range', 'self', 'Has not previously been collected in the Gulf of California.', '2015-04-07T12:43:53.753');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000382, 40005394, 'dsg-description', 'self', 'Tadpole-shaped; very large gills. In the Gulf of California, these sharks co-occur with Parmaturus xaniurus and may be difficult to tell apart when distant, when small, or when P. xaniurus uncharacteristically has the gills expanded in a low O2 environment.', '2018-11-19T07:39:43.387');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000383, 40005394, 'dsg-range', 'self', 'Southern Baja, Gulf of California', '2012-03-10T11:38:11.633');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000384, 40005394, 'dsg-depth-distribution', 'self', '155 - 957 m', '2015-03-31T10:31:23.577');
INSERT INTO LinkRealization (id, ConceptDelegateID_FK, LinkName, ToConcept, LinkValue, LAST_UPDATED_TIME) VALUES (40000387, 40005412, 'dsg-description', 'self', 'Head lightly tinged with color, medium-sized genital wings, dark hepatic region of intestine more posterior compared to T. sp. 2.', '2015-04-07T10:20:34.737');
